INSERT INTO `artikel` (`id_artikel`, `isi_artikel`, `judul_artikel`) VALUES
(1, 'tercyduk dari media cetak tepatnya pagi ini sebuah pojok iklan menampilkan siluet samping dari sebuah daihatsu terios dan penampakan depan dari toyota rush dapat dipastikan ini adalah model all new karena dari siluet tersebut garis-garis desain sangat berbeda dengan rush-terios yang kita kenal sekarang lagipula tertulis pula rush dan terios di masing-masing gambarsiluet toyota rush dan daihatsu terios dalam teaser ini mirip dengan duo mobil tertutup kamuflase beberapa waktu yang lalu sekilas dari gambar kelihatannya dimensi samping tidak terkesan besar kemungkinan masih mirip dengan generasi sebelumnya untuk bagian depan citra dari drl seperti brv dan desain grill sedikit membuat kami bertanya apakah mobil ini kembali akan menyandang gelar baby fortuner ya grill garis yang besar sangat menunjukkan bahasa desain yang sama dengan fortunerlalu bagaimana untuk sektor lain sayangnya kami tidak bisa berbicara banyak terkait ukuran roda fender ground clearanceoverhang departure angle dan sebagainya memang kalau ground clearance terlihat tinggi dari iklan rush namun masih belum cukup mengambil kesimpulan dari gambar yang hanya sepotong tersebut beberapa hal yang pasti roof rail sudah tersedia sebagai standar lampu belakang kini tidak berdiri melainkan tidur seperti mobil kekinian dan spion yang cukup besarharapan kami sih duo rush-terios ini bisa menjadi mobil yang proper setelah sebelumnya publik dibuai oleh penampilannya yang gagah namun kurang enak dikendarai sebagai sebuah mobil yah setidaknya itulah yang kami rasakan disebutkan saja ya rasakan saja girboksnya yang lemot atau suspensinya yang begitu keras padahal mayoritas pembelinya kaum urban yang hanya ingin gagah-gagahan toksatu hal yang menurut kami dapat diandalkan adalah ground clearance yang membuat pede apabila melewati jalan lubang atau polisi tidur besar tetapi kembali lagi saat melibas semua itu suspensi yang tidak baik membuat badan pengendara cepat lelah untuk duet rushter setidaknya kali ini kita juga bisa berharap melalui penampilannya tapi semoga tidak enak dipandang doang tapi harus enak dikendaraihadir untuk bersaing dengan mitsubishi xpander dan honda br-v semoga kelemahan yang kami sebutkan tadi seharusnya sudah diperbaiki mengingat membawa br-v dan xpander masih terasa seperti bawa mobil bukan bawa perahu satu hal yang sepertinya absen adalah pintu belakang yang bukanya ke samping dan ban serep konde yang akan pindah ke bagian bawah jadi semakin tidak sabar dengan kemunculannya bersiaplah mitsubishi jangan sampai jumlah pesanan batal makin meningkat karena kelamaan inden yang satu ini toyota-daihatsu lho bagaimana menurut kalian sampaikan di kolom komentar ya', 'ini teaser toyota rush dan daihatsu terios leh uga sob'),
(2, 'setelah kemarin kami memberikan sejumlah detail dari toyota rush 2018 baik dari rupa sisi depan samping dan belakang serta sejumlah fitur  fitur yang sekiranya akan hadir di lsuv pabrikan asal jepang ini maka kini kami kembali akan menyajikan kepada kalian mengenai interior dari toyota rush 2018 seperti apa bentuk dan kelengkapan yang ada di interiornyainterior dari toyota rush 2018 ini sebenarnya nampak tak terlalu jauh berbeda dibandingkan dengan model yang ada saat ini jika dilihat dari urusan kelegaan ya mungkin sedikit saja lebih lapang dan dari foto yang kami kutip dari rockomotif terlihat bahwa lingkar kemudi dari toyota rush 2018 benar  benar baru sedikit mirip toyota agya karena ada bentuk membulat di tengah setir namun setir toyota rush 2018 ini terlihat lebih oke dengan garnish berwarna silver dan audio steering switch control disana selanjutnya panel di doortrim mobil ini sudah menggunakan bahan softtouch yang berwarna putihberlanjut ke sisi konsol tengah tak akan ada console box maupun arm rest di mobil ini namun sebagai gantinya ada tiga buah cup holder yang akan mengakomodir kebutuhan untuk menyimpan minuman cocok bagi kalian yang suka haus panel transmisinya menggunakan laburan warna silver yang dipadukan dengan warna gelap senada dengan dashboard tuas transmisinya sendiri berwarna gelap dengan model gate yang nampaknya belum mendukung mode manual berupa tiptronic panel ac juga terlihat dari sini dengan bentuk dua tombol putar dan tombol lain berjajar horisontal serta layar indikator di sisi atas tombol tersebut jelas ac-nya sudah digitalmasih di dashboard-nya kini toyota rush 2018 mendapatkan bahan softtouch berwarna putih yang diberikan di sisi bawah dengan lis berwarna silver yang memisahkan bagian softtouch dengan sisa dashboard konfigurasi bahan lunak berwarna putih ini sendiri mengingatkan kita pada honda hr-v eh iya kan toyota rush 2018 memang mau menyentuh kelas cuv seperti honda hr-v masih di dashboard kisi ac di tengah berbentuk segi lima kaku dengan hazard yang terapit dan slot head unit berukuran cukup besar di bawahnya jika kisi ac di sisi tengah lebih mengotak lain halnya dengan kisi ac di sisi pinggir yang cenderung membulatuntuk laci di doortrim sendiri bisa mengakomodir dua botol dan menyisakan ruang untuk membawa jajanan atau sekedar majalah kursi dari toyota rush 2018 sendiri mengingatkan kita pada model milik toyota grand new veloz dengan side support dan bahan fabric bangku barid kedua dari toyota rush 2018 juga sudah mendukung penggunaan tiga orang karena sudah diberikan tiga headrest yang proper panel instrumen dari toyota rush 2018 juga terlihat keren dengan perpaduan analog yang berlatar warna biru futuristis dan layar digital di tengahnyakabin dari toyota rush 2018 sendiri nampaknya tak bisa dikatakan luas  luas amat dari gambar terlihat jika bangku dalam posisi tegak semua ruang bagasi hanya tersisa sedikit saja ruang kaki antara baris ketiga dan kedua juga terlihat bukan yang terlega di kelasnya namun terlihat jika bangku dari toyota rush 2018 ini cukup tebal yang menarik bahan softtouch berwarna putih masih ada hingga ke pintu baris kedua serta adanya airbag yang bisa dikatakan paling banyak di kelasnya jadi bagaimana menurut kalian interior dari toyota rush 2018 ini yuk sampaikan pendapat kalian kawan', 'inilah interior dari toyota rush 2018 lebih modern'),
(3, 'pertarungan akselerasi tercepat di dunia sudah berlangsung sekian lama masih ingat kala bugatti veyron bisa lari dari 0-100 dalam waktu 25 detik saja sekarang dengan chiron waktunya kian menyusut jadi 23 detikan namun masih ada penantang lagi koenigsegg berani dengan 23 detikan juga dodge hellcat juga namun tesla model s dengan 223 detik bisa bikin kompetisi jadi makin sengitsekarang kelihatan kalau tesla sangat ambisius merebut tahta akselerasi tercepat ini adalah tesla roadster generasi kedua dan di balik tampang seksinya tersimpan performa buas bak monster bayangkan mobil ini sanggup lari dari 0-100 kmjam dalam 19 detik saja otomatis ini bisa saja menjadi mobil masspro dengan akselerasi paling kencang aspark owl yang dari jepang itu belum siap tesla malah siap dan sangat pedetidak hanya sampai di situ mobil ini bisa lompat dari 0-160 kmjam dalam 42 detik dan lari sejauh 402 m dalam 89 detik saja kecepatan maksimal well elon musk tidak bilang secara spesifik namun ia bilang bisa tembus 400 kmjam fantastis dan kelihatannya mereka mengincar rekor koenigsegg agera rs yang bisa 4472 kmjam dengan kapasitas baterai 200 kwh tesla roadster baru bisa menempuh jarak 992 km wah revolusioner sekali inidari segi desain ia seksi namun juga sangat dramatis dibandingkan tesla lain mukanya dihiasi sepasang lampu depan tipis berteknologi led sementara bagian belakang terlihat lebih mirip mobil konsep radikal yang sepertinya lumayan rumit untuk sebuah model produksi di antara elemen desain yang paling menarik adalah lampu belakang setipis rambut dan diffuser yang agresif seperti coupe lain format joknya 22 dengan jok belakang yang sempitteknologi lain tesla roadster adalah torque steering yang bisa mengarahkan mobil dengan distribusi torsi kanan-kiri yang beda beda dengan nissan leaf yang pakai 1 motor listrik atau mercedes benz sls amg serta mitsubishi lancer evo miev yang pakai 4 motor listrik tesla roadster pakai 3 motor listrik seperti honda nsx bedanya kalau nsx ada 2 di depan dan 1 di belakang tesla punya 1 di depan dan 2 di belakangselama pidato di peluncuran tesla roadster musk mengatakan bahwa dia menginginkan mobil ini sebagai sentuhan terakhir di peti mati yang akan mengubur mesin biasa dalam-dalam oleh karena itulah target mobil performa tinggi baru telah ditetapkan jika semuanya tercapai itu bisa sangat mewakili masa depan mobil performa tinggi ferrari lamborghini porsche koenigsegg dan bugatti pasti kelabakan soal ininamun tidak mengherankan bahwa tesla roadster kedua ini akan lebih mahal dari pendahulunya faktaya harga paling murahnya akan dimulai dari 200000 27 m rupiah dengan dp sebesar  50000 6764 juta rupiah bagi penggemar tesla yang benar-benar garis keras akan ada tesla roadster founders edition yang harganya tembus 250000 34 m rupiah apa opinimu mengenai mobil sadis ini sampaikan di kolom komentar', 'dahsyatnya tesla roadster 2020 0-100 19 detik saja'),
(4, 'nama mazda 6 sudah wara-wiri cukup lama di dunia namun sayang di indonesia ia tidak terlalu mentereng gengsinya dibandingkan camry accord dan teana saat camry bisa jadi mobil pejabat mazda 6 malah jadi mobil polisi yang mengawal pejabat yang pakai camry sayang sekali padahal sedan ini termasuk keren dengan fitur yang komplit namun yang facelift ini bakal membawa kekerenan itu lebih jauh lagikami yakin sebab mazda 6 facelift turut mendapatkan tambahan mesin baru unit skyactiv 2500 cc 4 silinder yang lama sekarang akan ditemani pilihan mesin skyactiv turbo 2500 cc 4 silinder turbo yang sama dengan mazda cx-9 mazda belum bilang berapa angka tenaga dan torsi mesin turbo itu di mazda 6 pokoknya mereka hanya bilang bahwa mesin ini menawarkan performa yang halus yang seirama dengan ketenangan dan keasyikanfyi kalau di mazda cx-9 mesin itu sanggup menghasilkan 250 hp dan torsi 420 nm wah kalau tenaga dan torsi segini ada di mazda 6 pasti ngacir sih mobilnya untuk mesin 2500 cc non turbonya mazda menambahkan fitur cylinder deactivation yang bisa mematikan beberapa piston saat kondisi tertentu demi menghemat bahan bakarsoal penampilan mazda 6 mengambil sedikit detail desain dari mazda cx-5 generasi kedua itu kelihatan pada foto teaser yang menampilkan bumper depan gril dan lampu utamanya sementara interiorya tetap mazda banget dengan kabin yang lebih driver-oriented dan layar mzd connect yang berdiri layaknya idrive milik bmwurusan fitur keselamatan mazda 6 akan membawa pake fitur safety i-activsense lebih jauh lagi dengan dipasangnya adaptive cruise control dengan radar yang bisa membantu memelankan mobil hingga berhenti total lalu jalan lagi plus all around view monitor yang bisa menampilkan gambar dari segala sisi mobil macam nissan x-trail nah apa ekspektasimu tentang mazda 6 facelift sampaikan di kolom komentar', 'mazda 6 facelift  tampilan baru plus mesin turbo'),
(5, 'seperti yang kita tahu mayoritas pabrikan otomotif dunia memang sedang bergerak untuk mengembangkan mesin baru untuk mobil  mobilnya yang menggunakan listrik sebagai tenaga utama maupun tenaga sekunder dan salah satu diantaranya adalah bmw yang kita tahu sudah cukup handal dalam bidang ini dengan varian dari divisi bmw i miliknyadan kabar terbaru pihak bmw baru saja mendaftarkan sebuah paten terhadap nama dari mobil  mobil listrik terbaru mereka dengan nama bmw ix1 hingga bmw ix9 menariknya seperti yang kita tahu bmw sendiri memiliki seri bmw x models yang memiliki rupa sebagai cuv dan suv yang sudah ada cukup lama dan benar saja seri dari bmw ix akan menggunakan tenaga listrik sebagai penggerak mesinnya namun memiliki rupa dari bmw x models dan model pertama yang sudah dikonfirmasi akan menyapa pasar terlebih dahulu adalah model bmw ix3 yang merupakan suv listrik dari bmw x3dan hal unik lainnya jika bmw i3 dan bmw i8 benar  benar di desain dari nol alias dari awal jajaran mobil di bmw ix tidak diperlakukan demikian bmw nampaknya ingin efisien dalam hal anggaran riset dan pengembangan sehingga jajaran bmw ix akan dibangun dari jajaran bmw x models yang ada hal ini tentunya nampak agak berbeda dengan para pesaing utamanya seperti audi yang memiliki e-tron suv dan mercedes benz yang memiliki eq c yang kesemuanya merupakan model yang benar  benar berbeda dibanding model yang sudah ada namun walaupun begitu jajaran bmw ix masih akan ditangani oleh divisi bmw idan dengan paten ini maka kita bisa tahu bahwa di masa depan bmw akan memproduksi varian  varian cuv dan suv untuk mobil listrik mereka bmw sendiri sejuah ini memang sudah cukup sukses menghasilkan beberapa mobil listrik dan hibrida seperti bmw i3 bmw i8 bmw 330e bmw x5 xdrive40e dan bmw 740 le xdrive yang sudah disebar ke pasar selain produk  produk dari jajaran bmw ix bmw juga sedang mempersiapkan produk baru lainnya di bawah divisi bmw i yaitu bmw i5 yang akan diposisikan diantara bmw i3 dan bmw i8 mobil listrik berbentuk sedan ini akan bisa menempuh 600 km untuk sekali pengisian dayaselain itu bmw i5 yang menggunakan tenaga listrik murni ini sendiri akan mampu berakselerasi dari keadaan diam hingga 100 kmjam hanya dalam empat detik saja menarik tentunya melihat kehadiran jajaran bmw ix dari mulai bmw ix1 ix3 hingga ix9 serta kehadiran bmw i5 di masa depan bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'bmw patenkan nama bmw ix1 hingga ix9 untuk mobil listriknya'),
(6, 'sudah setahun lamanya toyota yaris di indonesia atau yang akrab kita sebut toyota yaris lele dijual versi facelift-nya tak banyak ubahan berarti jika di sisi eksterior dan interior setidaknya jika dibandingkan dengan mesinnya yang kini sudah mengusung mesin dual vvt-i dan kala itu ada sebuah varian pamungkas yang mau bergaya ala crossover yang diberi nama toyota yaris heykersya varian toyota yaris heykers memang sontak menimbulkan perdebatan bahkan di kolom komentar autonetmagz ada yang suka ada yang tidak namun ada kenyataan bahwa sebenarnya beberapa pecinta toyota yaris di thailand sempat berharap versi toyota yaris heykers masuk ke negeri gajah putih walaupun sebenarnya perawakan toyota yaris heykers sendiri tak sepenuhnya enak dipandang dan cenderung maksa namun bagi kalian yang masih ingin memiliki toyota yaris heykers segeralah beli unitnya karena kami mendapatkan informasi dari sumber kami bahwa keberlangsungan varian ini akan disudahiya nampaknya toyota astra motor tam melihat kehadiran toyota yaris heykers kurang oke dan akan dipensiunkan kapan saat toyota yaris terbaru diperkenalkan sejauh ini kami belum mendapatkan kabar kapan toyota yaris terbaru akan dijual di indonesia namun tampangnya sendiri sudah bisa kita lihat dalam diri toyota yaris di thailand dan kabar berikutnya nampaknya toyota yaris terbaru nantinya tidak akan mendapatkan terlalu banyak sunatan di versi indonesianya mobil ini akan mendapatkan 7 airbag hill start assist dan vehicle stability assist menarik tentunya jika akhirnya toyota yaris bisa memberikan fitur yang melimpah itudan selain itu pihak tam juga akan mengampakkan varian e yang menjadi entry level pada toyota yaris saat ini dan menggeser varian g menjadi varian termurah dari toyota yaris terbaru jadi nantinya menurut sumber kami toyota yaris terbaru hanya akan dijual dalam dua varian saja varian g untuk varian yang biasa dan varian tertinggi dalam diri toyota yaris trd sportivo langkah ini sendiri seperti yang dilakukan honda saat mengampakkan honda jazz tipe a dan juga suzuki yang menghapus suzuki swift gl beberapa waktu silam namun untuk toyota yaris terbaru yang memiliki fitur melimpah ini tentu ada konsekuensi yang diterimaya pasti masalah harga kawan walau masih jauh dari kepastiannya sumber kami menyebutkan bahwa toyota yaris terbaru akan menembus harga 300 jutaan untuk varian tertingginya tentunya bukanlah pricing yang oke jika melihat harga dari honda jazz yang masih bertahan di bawah 300 jutaan rupiah namun segalanya masih mungkin kawan karena memang toyota yaris terbaru sendiri masih belum terlihat sejauh ini di indonesia bagaimana menurut kalian yuk sampaikan pendapat kalian', 'toyota yaris terbaru akan punya 7 airbag tembus 300 jutaan'),
(7, 'suzuki swift adalah sebuah mobil kecil yang lucu manis dan asyik namun sayang pamornya kalah jauh dengan sesama subcompact hatchback jepang yang jadi lawannya di sini tahu-tahu malah suzuki indomobil sales mengimpor baleno hatchback bermesin 1400 cc untuk menggantikan swift yang sudah stop dijual kalau sudah membahas swift sport generasi kemarin jangan ditanya itu adalah mobil kecil nan asyik dan sangat layak didambakan apalagi dimilikipasca meluncurkan sx4 s-cross facelift tempo hari kabar mengenai produk baru suzuki mulai terendus meski tidak menyengat seperti duet rush-terios yang sebentar lagi meluncur selain suzuki ertiga generasi kedua yang tertangkap basah sedang diuji coba di india suzuki swift pun tertangkap basah sedang diuji di thailand foto-foto dari headlightmag ini adalah bukti tak bergeraknyameski lebih rendah dan pendek dibanding suzuki swift lama suzuki swift baru ini punya wheelbase yang sedikit memanjang urusan penampilan sejujurnya kami masih agak sulit untuk mencerna dan menerima desain swift baru pengecualian untuk swift sport boosterjet turbo itu keren itu sih kalau luarnya sebab kalau interiornya kami akui memang punya desain yang membaik dan lebih cakephatchback ringan dan enteng ini sebenarnya punya beberapa pilihan mesin termasuk mesin 3 silinder turbo atau mesin hybrid namun menurut sumber yang sama suzuki swift thailand akan memakai mesin 1200 cc 4 silinder dualjet naturally aspirated bertenaga 91 ps dan torsi 118 nm lucu juga sih dulu swift pakai mesin 1500 cc terus turun ke 1400 cc sekarang turun lagi ke 1200 ccmungkin ini persiapan supaya tidak bentrok dengan suzuki baleno yang bermesin 1400 cc 4 silinder vvt berkode k14b sisi baiknya berarti ada kemungkinan bahwa banderol suzuki swift nanti bisa lebih ramah dan bersahabat dengan kantong sebab mesinnya pun mengecil gosipnya suzuki swift akan mengaspal tahun depan di indonesia dengan status cbu thailand apa opinimu sampaikan di kolom komentar', 'suzuki swift sudah diuji di thailand mesin 1200 cc'),
(8, 'bagi kalian yang suka dengan mobil  mobil di segmen small hatchback maka jelas kabar segera meluncurnya perodua myvi generasi terbaru menjadi salah satu berita yang hangat diperbincangkan beberapa hari terakhir ya karena peluncurannya hanya menunggu 24 jam saat berita ini diangkat dan sejauh ini sudah ada 1500 orang malaysia yang sudah memesan mobil sejuta umat dari perodua inilalu bagaimana dengan kembarannya bukan bukan toyota passo namun daihatsu sirion daihatsu sirion sendiri memang telah menghiasi segmen small hatchback beberapa tahun belakangan ini masuk di kelas yang sama dengan suzuki ignis kia picanto chevrolet spark hyundai grand i10 dan juga toyota etios mobil yang diimpor dari malaysia ini memang tak begitu menonjol ya kecuali versi facelift terakhir yang memang memiliki tampang yang kelewat sporty untuk sebuah mobil dalam kota which is good lalu bagaimana kelanjutan daihatsu sirion di masa depanmasih sama kok masih serupa dengan perodua myvi jadi jika nantinya perodua myvi sudah dijual di malaysia hanya menunggu momen yang pas saja untuk astra daihatsu motor memesan perodua myvi berlabel daihatsu sirion untuk indonesia yap daihatsu sirion 2018 masih akan diimpor dari malaysia dan tidak dirakit lokal namun ada yang menarik dari daihatsu sirion 2018 yaitu pada mesinnya daihatsu sirion 2018 akan meninggalkan mesin 1300cc lawas yang selama ini kita kenal dan beralih ke mesin 1500cc 2nr-ve dual vvt-i yang merupakan mesin milik toyota grand new avanzaitu artinya daihatsu sirion 2018 akan menyusul chevrolet sparks dan nissan march di luar negeri yang juga naik level dan tentunya semakin menarik lagi jika kalian melihat seperti apa fitur  fitur yang hadir di perodua myvi seperti vsc enam buah airbags advance safety assist pre-collision warning rem otomatis di kecepatan rendah front departure alert dan pedal misoperation control menarik iya dong tapi sekali lagi ingat itu untuk perodua myvi 2018 kalau daihatsu sirion 2018 mungkin akan ada ritual sunatan fitur seperti yang sudah  sudah namun siapa tahu kali ini fitur  fitur tak akan disunat mengingat levelnya yang sudah naiknah untuk kapan daihatsu sirion 2018 akan dirilis kami belum mendapatkan informasi yang jelas namun sepertinya tahun depan generasi terbaru dari daihatsu sirion sudah akan menyapa pasar indonesia bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'daihatsu sirion naik kelas bermesin 1500cc tetap impor dari malaysia'),
(9, 'setelah dua tahun meluncur toyota hilux generasi kedelapan yang sekarang kita kenal akhirnya mendapatkan penyegaran dan versi penyegaran ini sendiri meluncur di thailand dengan tampang yang sedikit lebih segar dan mengingatkan kita pada truk lain toyota yang berukuran lebih besar yaitu toyota tacomatampang depan dari toyota hilux facelift inilah yang kami sebut mirip dengan toyota tacoma lihat saja grille heksagonal yang digunakannya yang memang mirip dengan grille milik truk midsize yang dijual khusus untuk pasar amerika serikat itu selain pada grille toyota hilux facelift juga mendapatkan ubahan baru pada bumper depannya yang kini banyak lekukan tegas dengan housing pada foglamp yang lebih terihat modern walaupun bentuknya terkesan agak kurang pas namun untuk mendapatkan toyota hilux facelift dengan wajah ala tacoma ini kalian harus menyediakan uang lebihtoyota hilux facelift berwajah baru ini sendiri hanya hadir di varian tertinggi yaitu toyota hilux facelift 44 dan toyota hilux facelift high riding 42 prerunner sedangkan untuk varian toyota hilux facelift low riding 42 masih mengandalkan muka lama walaupun mendapatkan grille yang kini dilabur warna hitam dan juga tambahan berupa front bumper guard sisanya tak ada ubahan yang berarti pada toyota hilux facelift karena semuanya masih sama dengan varian sebelum facelift masuk ke interiornya apa yang berubah tak ada untuk varian  varian yang dijual sebelumnya di thailand tak akan mengalami perubahan berarti kecuali sebuah varian baru bernama roccoya toyota hilux facelift mendapatkan sebuah varian baru dengan nama toyota hilux rocco yang tak memiliki hubungan apapu dengan scirocco toyota hilux rocco sendiri tersedia dalam pilihan mesin 2800cc dengan pilihan penggerak dua maupun empat roda yang terlihat berbeda dari toyota hilux rocco adalah grille berwarna hitam glossy dan abu  abu lalu bumper belakang berwarna abu  abu velg berukuran 18 inci berlabur warna hitam dengan ban all terrain sport bar bed lining dan stiker  stiker yang menunjukkan bahwa ini adalah sbuah toyota hilux rocco selain itu pada sisi interior toyota hilux rocco mendapatkan laburan warna gelam dengan trim berwarna black metallicsecara umum tak ada ubahan yang mendasar dari toyota hilux terbaru ini namanya juga facelift toyota hilux facelift ini masih akan mengusung mesin 2400cc 2gd-ftv turbodiesel bertenaga 150 dk dengan torsi maksimal 400 nm mesin ini akan dipasangkan dengan transmisi otomatis enam percepatan dan manual lima percepatan sedangkan mesin lain berkubikasi 2800cc dengan tenaga maksimal 177 dk dan torsi maksimal 450 nm yang menggunakan transmisi otomatis enam percepatan dan manual enam percepatan sedangkan versi bensin dengan mesin 2700cc dual vvt-i bertenaga 166 dk dengan torsi 245 nm masih dipertahankan dengan transmisi yang sama dengan unit mesin 2400cc dieselnyadan melihat toyota hilux sudah mendapatkan facelift bisa jadi tak lama lagi saudara sebasisnya yaitu toyota kijang innova dan toyota fortuner juga bisa saja mendapatkan penyegaran pula ya sejauh ini kedua produk itu hanya mendapatkan penambahan varian seperti venturer dan trd-sportivo serta minor change pada toyota fortuner yang menambah rem cakram di sisi belakang saja facelift bisa jadi menyusul kawan bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'toyota hilux facelift meluncur tanpa upgrade fitur dan mesin'),
(10, 'jika ada mobil yang sanggup menjadi lawan toyota sienta di indonesia mobil itu tak lain dan tak bukan adalah honda freed freed yang pernah dijual di indonesia dulu melenggang bebas tanpa lawan yang benar-benar sekelas dan sepadan tapi sekarang roda telah berputar kini giliran toyota sienta yang berkeliaran di jalanan indonesia tanpa rival sekelas yang bisa mengganggu eksistensinyasayang honda prospect motor belum berminat memasukkan honda freed generasi kedua ke jajaran modelnya di indonesia beruntung waktu perjalanan ke motegi kemarin ada sebuah honda freed generasi kedua yang siap dites dan dijelajah luar dalam tidak tanggung-tanggung sebab yang disediakan adalah freed hybrid sebenarnya ada fit hybrid dan odyssey hybrid juga tapi freed ini lebih menarik perhatian kamijadi apa kabarnya generasi baru ini simak dalam first impression review honda freed hybrid 2017 jdm-spec bersama autonetmagzeksteriorbentuk dasar honda freed masih sama  kotak namun jika kalian pikir honda freed lama saja sudah cukup kotak ini lebih kotak lagi entah karena faktor suasana sekitar atau apa freed generasi kedua ini kelihatan tampil lebih jepang dibanding generasi pertamanya toyota sienta sebenarnya juga terlihat jdm banget seperti freed hanya saja pendekatan desainnya beda sienta lebih nyentrik dan berani sedangkan freed lebih kalem dan sederhanaini bagus sebab bisa mengakomodir selera yang berbeda buat yang mau tampil unik bisa lirik sienta dan bagi yang mau desain yang tidak aneh-aneh mungkin bisa tertarik dengan freed kembali ke freed mukanya masih mengandalkan soild wing face yang jadi ciri khas honda jaman now dilengkapi dengan gril berbahan panel plastik mengkilap dengan kontur yang memberi efek belang wah jangan-jangan bakal muncul sebutan mobil hidung belang deh buat mobil inilampu depan honda freed hybrid ini sudah projector led namun sayang belum sekeren lampu cr-v civic jazz atau accord yang sudah mengadopsi gaya lampu acura di bawah gril belangnya ia dilengkapi bilah-bilah chrome mobil yang kami coba ini tidak punya lampu kabut entah dijual sebagai opsional atau baru ada di tipe yang lebih tinggi lagi bumper depan freed ini bersih tidak ada sensor parkir depan di siniunit honda freed hybrid yang ini sudah pakai pelek two tone lumayan oke buat meningkatkan penampilannya beda dengan toyota yang mau memberi logo khusus dengan pendaran warna biru untuk varian hybrid honda ogah repot tidak ada beda logo h antara freed biasa dengan freed hybrid hanya dibedakan via emblem hybrid di samping dan belakang fitur seperti keyless entry dan power sliding door pastinya sudah standaruntuk mengakali pilar a supaya tidak terlalu menghalangi pandangan honda freed hybrid punya kaca pengintip yang sama seperti freed lama di pilar a ini adalah freed hybrid varian ex namun freed hybrid ini belum dilengkapi paket fitur keselamatan honda sensing menurut spesifikasi yang dipajang di motegi kualitas pembuatannya bagus dengan ketebalan pelat yang pas dan celah antar panel yang konsistenrem depan belakang sudah cakram dan sudah pasti ada abs dan ebd beranjak ke belakang bentuknya kotak banget meski sudah ada beberapa lekuk bodi yang didesain sebagai pemanis lampu belakangnya punya model yang sederhana dan garnish chrome di pintu bagasi sudah standar sayang meski sudah punya kamera parkir seperti civic turbo sama sekali tidak ada sensor parkir di mobil ini apa harus membujuk sales juga di sana biar dikasihinteriorhonda berusaha membawa konsep dashboard open cafe milik honda freed menjadi lebih kompleks dan itu bisa dilihat di freed hybrid ini beda dengan freed lama yang simpel dashboard freed baru kelihatan seperti kue lapis legit karena didesain dengan berbagai macam panel dengan warna berbeda topi panel instrumennya berwarna cerah panel kayunya coklat gelap dan bagian bawah dashboardnya plastik hitampengerjaan interior baik sebab tidak ada panel yang renggang atau bergoyang seperti pada mobilio brio dan br-v duduk di bangku pengemudi kontur joknya terasa kur