girboks kopling ganda bisa memberikan perubahan di bagian bawah persneling ada port hdmi serta 2 port charger dan jenis rem parkirnya adalah model injak seperti kia grand sedonasebagai driver kita akan menemukan banyak tombol di sisi kanan bawah posisi duduk kita selain tombol untuk pintu gesernya ada juga tombol untuk pre-collision warning autonomus braking lane departure warning stability control dan lain-lain ada yang lucu di setirnya sebab di samping adanya tombol untuk audio telepon dan adaptive cruise control tombol buat mengaktifkan cruise control sendiri malah ditulis main aneh normalnya kan cruiseruang baris kedua honda freed hybrid yang kami coba sudah dipasangi captain seat atau kalau bahasa hondanya king  queen seat dengan jarak sliding kursi tengah hingga 120 mm kursi ini sangat fleksibel meski tak bisa digeser kiri-kanan untuk diduduki pun nyaman dan ruangannya lega baik legroom maupun headroom saat dihuni orang dewasa dengan tinggi 178 cmnamun seperti biasanya mpv yang ukurannya sepantaran dengan freed dan sienta kabin belakangnya terlalu ngepas untuk orang dewasa namun cocok buat anak kecil headroom sisa sedikit dan legroom bakal mentok jika penumpang baris kedua egoisnya sudah level akut bagasi freed memiliki kapasitas yang cukupan bisa untuk menampung beberapa tas punggung atau travel bag pelipatan kursinya mirip dengan kijang innova yakni dilipat ke sampingmesinadalah mesin 1500 cc 4 silinder i-vtec plus bantuan baterai dan motor listrik yang menjadi jantung honda freed hybrid untuk mesin bensinnya tenaganya 110 ps dan torsinya 134 nm namun ingatlah kalau ia dibantu motor listrik yang bertenaga 22 ps dan torsi 160 nm nikmatnya torsi 160 nm itu sudah siap sejak mobil diam dan terus ada hingga 1313 rpm baru setelahnya giliran mesin bensin yang unjuk gigidiperkuat girboks i-dcd kopling ganda 7 percepatan honda freed yang ini pakai penggerak roda depan sistem hybrid freed akan memprioritaskan penggunaan mesin bensin sementara mesin listrik hanya sebagai bantuan saja saat diam macet atau berjalan pelan mesin bensin akan mati dan menyerahkan tugasnya ke mesin listrik barulah saat kecepatan mobil berangsur naik mesin bensin akan langsung hidup dan beraksikami menyempatkan diri untuk mencoba mobil ini sebentar saat dinyalakan tidak ada getaran atau suara mesin bensin hidup yang ada hanya lampu bertuliskan ev ready di panel instrumen masuk ke d dan mulai berjalan mobil masih hening karena motor listriklah yang menjalankan mobil barulah saat kickdown mesin bensin mulai aktif dan menjalankan mobil dengan transisi peralihan mesin listrik ke bensin yang halus dan minim interupsi transmisinya juga bagus pindah giginya cepat dan tidak ndut-ndutan saat jalanan lancar saat macet entahlahsetir honda freed ini tidak enteng-enteng amat namun masih berbobot cenderung santai dan tidak responsif feedback pun tidak terlalu terasa mengenai perihal performa peredaman suara dan bantingan kami tak bisa banyak komentar karena area yang kami lalui super mulus terkontrol dan sepi apalagi kecepatan kami dibatasi di 50 atau 60 kmjam namun saat putar balik setirnya cukup patah dan radius putarnya sangat kecil serta memudahkansaat mesin bensin aktif ia kadang akan turut berperan sebagai genset dan menyediakan listrik untuk baterai namun saat kita gaspol habis mesin bensin langsung tidak berperan sebagai genset dan full menggerakkan roda depan semaksimal yang ia bisa saat kita melepas gas meluncur dan mengerem energi yang tercipta akan disalurkan untuk mengisi ulang baterai yang ada di belakang mobil ini bukan plug-in hybrid jadi tak ada port charger untuk ditancapkan di tembok rumah via stop kontakkesimpulanwaktu yang cukup singkat untuk mencoba freed dan kami sebenarnya masih belum puas honda freed baru ini berusaha memanjakan mereka yang mementingkan kenyamanan terlihat dari kabinnya yang makin lega disertai dengan mesin hybrid yang halus dan hening fitur keselamatannya lengkap maklum spek jepang tampangnya pun terasa jepang meski memang cenderung konservatif dibandingkan rivalnya yang nyentriknamun buat yang mengincar keasyikan berkendara freed ini sepertinya bukan pilihan yang bijak meski setirnya masih ada bobot yang sedikit menambah rasa mantap ia tetap tidak begitu menggugah kontur joknya pun bisa lebih baik lagi namun rasanya semua itu cukup minor dibanding kehalusan dan kemudahan yang ditawarkan jika ada kesempatan di lain waktu kami ingin membahas habis freed ini setuntas-tuntasnyasayang honda prospect motor belum menyatakan apa mereka mau mengimpor freed ke indonesia atau tidak jika jawabannya adalah tidak maka nasib freed akan sama seperti honda stream yang generasi penerusnya tidak diimpor ke sini namun berharap saja soalnya mumpung mau berganti tahun ke 2018 masa iya honda indonesia tidak punya mobil baru buat dijual apa opinimu sampaikan di kolom komentar', 'first impression review honda freed hybrid 2017 jdm-spec'),
(11, 'sebuah kabar akan recall mobil kembali menghampiri dunia otomotif namun kali ini cukup spesial karena program recall ini sendiri terjadi di indonesia ya kali ini mitsubishi melalui mitsubishi motor krama yudha sales indonesia mmksi mengumumkan field fix campaign alias kampanye perbaikan alias recall pada salah satu produk jualan mereka yaitu mitsubishi outlander sport di tanah airhe ada apa nih dengan mitsubishi outlander sport airbag inflator bukan kawan tenang saja karena masalah dari mitsubishi outlander sport ada pada parts di pintu belakang dan juga di wiper depan dari suv kompak ini komponen pertama yang terkena masalah adalah tailgate gas spring assy atau bagian pegas dari pintu belakang mobil dan bagian kedua adalah front motor wiper assy alias bagian motor dari wiper depan lalu apakah dampak dari kedua komponen yang bermasalah ini apakah membahayakan jiwa pengemudi tidak kok namun bisa fatal jika tak ditanganioke pertama bagian tailgate gas spring assy ini sendiri ada di kondisi tidak cukup lapisan anti karat di area end cap outer tube pada tailgate gas spring seiring waktu membuat karat dapat terbentuk pada outer tube jika outer tube telah berkarat end cap dapat terlepas dan mencederai konsumen karena tailgate akan terjatuh secara tiba-tiba dan berpotensi menyebabkan cedera kedua adalah bagian front motor wiper assy ketidaktepatan struktur tahan air pada front motor wiper mengakibatkan adanya potensi air masuk ketika hujan atau mencuci kendaraan ke dalam motor wiper dan menyebabkan short serta membuat motor wiper tidak bekerja kalau wiper tak bekerja di kala hujan deras dan mobil melaju tentunya akan bahaya juga sobkampanye perbaikan ini sendiri merupakan sebuah wujud tanggung jawab dari pihak mmksi terhadap masalah ini dan kampanye ini sendiri sepenuhnya gratis dan sudah bisa dilakukan di seluruh dealer mitsubishi sejak tanggal 13 november 2017 ini konsumen bisa menghubungi dealer mitsubishi dan melakukan service booking sebelum mengikuti kampanye perbaikan ini waktu perbaikan yang diperlukan sendiri sekitar 1 jam untuk setiap komponen alias 2 jam secara keseluruhan oiya kampanye perbaikan ini sendiri khusus untuk mitsubishi outlander sport lansiran 2012 hingga 2016 dengan jumlah unit sebanyak 17064 unit dengan 10839 unit diantaranya harus diganti kedua komponen tersebut sedang sisanya hanya untuk komponen di tailgateya memang tak ada produk yang sempurna kawan karena semuanya buatan tangan manusia bukan tuhan namun dengan kampanye perbaikan alias recall ini kita bisa tahu kan kalau pihak mmksi juga peduli pada konsumen setelah kita membeli produknya bagaimana kalau menurut kalian yuk sampaikan pendapatmu bro', 'sebanyak 17 ribu mitsubishi outlander sport di-recall di indonesia'),
(12, 'sebagaimana vw mengumumkan bahwa vw id buzz concept siap diproduksi massal sebagai sebuah minibus listrik vw punya pemikiran serupa bagi 2 produk mereka yang belum lama ini disuntik mati produk pertama adalah vw scirocco hatchback coupe 3 pintu yang sudah siap untuk disuntik mati tapi masih dijual termasuk di indonesia vw pernah bilang kalau scirocco bisa kembali sebagai coupe listrik bertenaga 300 hp-ankedua adalah vw beetle vw beetle akan stop produksi di 2018 namun mustahil membahas vw tanpa menyinggung beetle kepala vw herbert diess memberikan sedikit indikasi pada autocar soal nasib beetle ke depannyakalau kita mau bikin beetle jadi mobil listrik itu bakal jadi lebih bagus daripada sekarang dan lebih dekat ke akar sejarahnya karena ia akan jadi mobil listrik penggerak roda belakang katanyaiya sih vw beetle kan aslinya sama seperti porsche 911  mesin belakang penggerak roda belakang atau yang lebih kita kenal sebagai format rr rear engine-rear wheel drive merombak vw beetle menjadi mobil listrik rwd akan membuat beetle menarik bagi konsumen baru vw perlu dicatat ini semua masih rencana belum ketuk palu fyi vw sendiri sebenarnya mematikan produksi scirocco dan beetle karena satu alasan yang sama  tuakedua mobil itu memakai platform vw golf mk6 yang benar-benar sudah terasa tua dan jadul coba kendarai sebuah scirocco r baru dan habis itu coba vw golf gti mk7 pasti sasis gti mk7 terasa lebih mantap untuk beetle dan scirocco kemungkinan besar mereka akan pakai platform modularer elektrobaukasten meb yang sudah dirancang vw sejak 2015 platform meb adalah platform khusus untuk mobil listrikplatform ini sangat fleksibel dan modular sehingga bisa dipakai untuk semua jenis penggerak mobil mulai dari fwd rwd hingga awd penerima platform meb pertama adalah vw id buzz baru setelahnya mobil lain mengikutiplatform meb dirancang untuk menjadi tulang punggung bagi 15 mobil listrik baru dan 5 mobil di antaranya akan dijual dengan menyandang merek volkswagen tutup diess setujukah kamu jika vw beetle jadi mobil listrik rwd sampaikan di kolom komentar', 'vw beetle bisa kembali sebagai mobil listrik rwd'),
(13, 'pada giias 2017 toyota membawa crossover nyentrik toyota c-hr untuk dipamerkan jelas sangat menarik apalagi dengan warna hijau telur asinnya tapi toyota c-hr sebenarnya sudah diuji coba di thailand sebelum melakukan preview di malaysia dan indonesia persiapan toyota c-hr untuk pasar asean nampaknya kian matang sebab toyota thailand sudah mulai mengumumkan harga untuk toyota c-hrmengacu pada headlightmag toyota c-hr thailand akan dipasarkan dengan 2 pilihan mesin  1800 cc 4 silinder biasa dan 1800 cc 4 silinder hybrid yang mesinnya identik dengan milik toyota prius baru untuk fitur toyota c-hr hybrid thailand sudah komplit seutuhnya dengan fitur toyota safety sense p yang mencakup auto high beam collision warning system autonomous braking adaptive cruise control lane departure alert dan rear cross traffic alert ingat ya ini versi thailandterus berapa harganya nah sumber tersebut menyampaikan bahwa rentang harga toyota c-hr thailand ada di kisaran 900 ribu baht sampai 12 juta baht kalau dirupiahkan artinya sekitar 368 juta rupiah hingga 491 juta rupiah wah kirain harga toyota c-hr jdm spec yang diimpor iu ke indonesia seharga 420 jutaan saja sudah mahalini lebih mahal lagi rupanya namun bagaimana dengan rival c-hr di thailandsebagai contoh kita lihat honda hr-v versi thailand yang harganya dimulai sekitar 933 ribu baht sampai 1099 juta baht 382 juta-450 juta rupiah lalu kita lihat mazda cx-3 spek thailand dengan banderol berada di rentang 835000 baht hingga 1193 juta baht 342 juta-488 juta rupiah harga permulaan mazda cx-3 bisa murah karena ia punya pilihan yang mesinnya 1500 cc sementara hr-v dan c-hr tidaksementara honda hr-v rentang harganya lebih sempit dari toyota c-hr karena mesinnya hanya satu 1800 cc 4 silinder dan tidak ada varian hybrid karena tidak ada hybrid harga hr-v termahal tidaklah setinggi c-hr hybrid namun harga permulaan hr-v lebih tinggi dari c-hr untuk sesama varian entry level c-hr 368 juta vs hr-v 382 juta pemesanan akan dibuka di bangkok motor expo 2017 yang digelar mulai 30 november hingga 11 desember mendatangmenurut bangkok post ada salah satu eksekutif toyota thailand yang menjelaskan kenapa kedatangan toyota c-hr ke thailand begitu terlambat alasannya adalah karena pihak toyota thailand meminta restu untuk menyetel ulang sasis c-hr supaya cocok dengan kondisi jalanan thailand nah jika harga c-hr di thailand seperti itu maka harusnya harga toyota c-hr indonesia juga mirip-mirip dengan permulaan harga di bawah hr-v namun harga varian tertinggi pasti bisa dipangkas karena mustahil versi hybrid dijual di sini apa opinimu sampaikan di kolom komentar', 'harga toyota c-hr thailand muncul  mulai 368 jutaan'),
(14, 'sebelumnya kita tahu bahwa mitsubishi jepang masih agak galau perkara mitsubishi delica mobil yang sudah berumur ini memang bisa dibilang masih sangat laku di pasar jepang sana dan keputusan untuk memperkenalkan generasi terbaru di kuartal pertama ataupun kedua tahun 2018 yang sempat kami informasikan sebelumnya pun akhirnya terpental karena nyatanya versi konsep mitsubishi delica yang seharusnya hadir di tokyo motor show 2017 lalu juga tak kunjung hadirya mitsubishi memang nampaknya masih galau dengan kehadiran mitsubishi delica generasi terbaru namun mau tak mau suka tak suka mitsubishi delica generasi terbaru harus segera muncul untuk menghadapi para pesaingnya yang sudah berganti model dan kabar terbaru menunjukkan beberapa perkiraan dari carsensor mengenai kehadiran mitsubishi delica generasi terbaru mitsubishi delica generasi terbaru diperkirakan akan menyapa publik jepang pada peghujung tahun 2018 mendatang lebih tepatnya pada bulan november 2018 namun hal ini masih sangat bisa berubah menjadi awal tahun 2019 tergantung pabrikanselain itu ada beberapa detail yang diketahui akan hadir di mitsubishi delica generasi terbaru pertama jelas bahasa desain dynamic shield akan ditanamkan pada mitsubishi delica generasi terbaru ini yang akan membuat fascia depannya tak akan jauh dari mitsubishi pajero sport mitsubishi xpander atau bahkan mitsubishi eclipse cross ngomong  ngomong perkara mitsubishi eclipse cross mitsubishi delica generasi terbaru juga akan berbagi mesin dengan suv terbaru dari pabrikan berlogo tiga berlian ini ya mitsubishi delica generasi terbaru akan memiliki varian bermesin 1500cc turbo bertenaga 163 ps dan dengan torsi 250 nmnamun selain itu mitsubishi delica generasi terbaru juga akan mengusung mesin clean diesel 2200cc bertenaga 170 ps dengan torsi maksimal 226 nm yang merupakan pengembangan dari generasi mesin mitsubishi delica yang dijual saat ini ya mesin ini juga yang memang menjadi salah satu kendala dari kehadiran mitsubishi delica generasi terbaru ini karena adanya gesekan dengan regulasi terkait mesin dieselnya ini mitsubishi delica generasi terbaru juga masih akan menunjukkan bentuk yang kokoh dan rigid namun futuristis hal ini diperkuat dengan sistem gerak empat roda yang akan dipertahankan di model inikabarnya karena menganut desain ala dynamic shield lampu utama dari mitsubishi delica generasi terbaru akan bergeser dari sisi teratas bumper menjadi agak ke tengah posisi lampu ini mengingatkan kita pada mitsubishi xpander yang juga memiliki desain serupa selain itu grille dari mitsubishi delica generasi terbaru diprediksi akan memiliki ukuran yang besar untuk sebuah mpv peningkatan di fitur keselamatan juga akan menjadi konsentrasi di mitsubishi delica generasi terbaru ini kabarnya fitur seperti collision damage mitigation brakes akan hadir di mobil ini dan walaupun mitsubishi sudah berkawan dengan nissan nampaknya mitsubishi delica generasi terbaru in tak banyak berbagi part dengan produk nissanjadi tentunya menarik jika melihat bagaimana nantinya mitsubishi delica generasi terbaru akan hadir seperti apa bentuknya dan keunggulannya ya karena seperti kita tahu para pesaingnya sepeti toyota voxy dan noah nissan serena dan honda stepwgn juga sudah berbenah malah mazda sudah beralih ke bentuk suv dengan mazda cx-8 bagaimana menurut kalian yuk samapaikan pendapat kalian kawan', 'mitsubishi delica terbaru akan rilis november 2018 ada mesin turbo'),
(15, 'pernah bermain need for speed most wanted dan carbon di situ ada sosok polisi yang paling rese bernama cross sergeant cross saat kita dalam kejar-kejaran polisi dan sudah mencapai heat level 5 biasanya dia akan muncul menggunakan armada pengejar polisi berupa chevrolet corvette tapi itu kan 10 tahun yang lalu jadi kalau sergeant cross masih ada pasti corvette zr1 ini yang akan ia pakai sebagai speed enforcer andalannyacukup satu kata untuk menggambarkan penampilan corvette zr1 ini  bengis di balik muka bengisnya ada 4 radiator baru untuk mendinginkan mesin 6200 cc v8 yang diperkuat dengan supercharger dan bisa menghantarkan 755 hp serta 963 nm tuh kan tampang bengis tenaga dan torsi juga bengis pilihan girboksnya ada manual 7 percepatan ya 7 gigi maju atau otomatis 8 percepatan dengan kecepatan maksimal tembus 337 kmjamlip spoiler bumper depan dijanjikan bisa menambah gaya tekan ke bawah khusus untuk model ini ada kap mesin baru berbahan carbon fiber dengan desain yang lebih berotot buat yang punya nyali lebih besar ada tipe low wing yang bisa meraih top speed lebih tinggi lagi dari standarnya ada opsi ztk performance package dengan ekstra splitter depan dan high wing bertipe adjustable yang memberikan gaya tekan ke bawah sebesar 430 kgpaket tersebut juga termasuk ban michelin pilot sport cup 2 modifikasi chassis dan sistem magnetic ride control yang sudah disetel ulang demi menghasilkan kemampuan menikung yang lebih mantap lagi chevrolet juga akan menawarkan sebring orange design package yang mencakup eksterior berwarna sebring orange dengan kaliper rem merah dan aksen oranye interior akan dihiasi seatbelt orange jahitan orange dan trim interior bronze aluminiuminteriornya juga bisa dilengkapi dengan berbagai pilihan lain termasuk jok lapis kulit nappa yang sudah dipasangi pemanas dan ventilasi lingkar kemudi berbahan carbon fiber sistem audio premium bose dan performance data recorder menilik buasnya mobil ini  baik dari tampilan hingga performa yang ditawarkan  sepertinya sergeant cross bisa langsung minta mobil ini buat jadi andalannya dalam mengejar penjahat apa opinimu sampaikan di kolom komentar', 'corvette zr1 2019  sergeant cross approves');
INSERT INTO `artikel` (`id_artikel`, `isi_artikel`, `judul_artikel`) VALUES
(16, 'mal taman anggrek menjadi arena pertarungan para peserta honda jazz tuning contest kontes modifikasi yang digelar oleh pt honda prospect motor seperti tahun lalu kali ini kontes modifikasi honda jazz digelar bersamaan dengan kontes modifikasi honda brio acara yang dinamai jazz  brio tuning contest jbtc yang kali ini berlangsung pada tanggal 9-12 november 2017 jadi kamu bisa melihatnya sampai minggu 1211 besok pada tahun ini sebanyak 135 peserta yang terdiri dari 46 honda jazz dan 89 honda brio terdaftar sebagai peserta para peserta ini hadir dari 13 kota di berbagai wilayah di indonesia termasuk jakarta bogor bandung banten cilacap yogyakarta surabaya malang kudus pati banjarmasin pekanbaru dan makassar setelah melalui seleksi sebanyak 10 honda jazz dan 10 honda brio lolos sebagai finalis dan tampil di jakarta untuk memperebutkan gelar king of honda jazz dan king of honda brioberbeda dengan tahun sebelumnya pada ajang jbtc kali ini honda menambahkan tiga kategori baru untuk honda jazz yakni the best jazz racing look the best jazz rally look dan the best jazz advanced in technology sedangkan honda brio juga memiliki penambahan tiga kategori yang sama yaitu the best brio racing look the best brio rally look dan the best brio advanced in technology secara total terdapat 26 kategori dengan hadiah rp 5000000- bagi setiap pemenang dan hadiah utama sebesar rp 50000000- untuk the king of jazz dan the king of brioseluruh peserta akan dinilai oleh tim juri yang terdiri dari 5 orang wartawan otomotif yang telah berpengalaman di bidang modifikasi aspek penilaian untuk peserta meliputi 7 poin yaitu modifikasi pada bagian audio body kit cat eksterior interior mesin velg dan bantak hanya dari sisi peserta ajang honda jazz  honda brio tuning contest juga semakin populer di kalangan penonton dan pencinta modifikasi khususnya di jakarta pada tahun 2016 lalu ajang honda jazz  honda brio tuning contest dikunjungi oleh sekitar 10000 orang selama 4 hari penyelenggaraan jumlah pengunjung tersebut meningkat hampir 2 kali lipat dibanding penyelenggaraan tahun 2015pada tahun ini ajang tersebut juga melibatkan komunitas honda dengan mengadakan pemilihan modifikasi komunitas terfavorit finalis untuk kontes online ini meliputi 15 mobil modifikasi dari 5 komunitas honda yaitu brionesia brio indonesia hdi hr-v devotee indonesia hocy honda odyssey community invernity indonesia braver community dan mobility mobilio indonesia communityjonfis fandy marketing and after sales service director pt honda prospect motor mengatakan ajang honda jazz brio tuning contest merupakan bentuk apresiasi kami terhadap kreativitas para tuners di indonesia khususnya pemilik honda jazz dan honda brio sejalan dengan popularitas mobil hatchback yang terus meningkat saat ini dari tahun ke tahun kami juga terus menangkap tren terbaru dan mengakomodasi antusiasme dari para pencinta modifikasi dengan menambah kategori baru dan melibatkan lebih banyak pihak termasuk peserta penonton hingga komunitas honda', 'kontes modifikasi honda jazz dan brio meriahkan mal taman anggrek'),
(17, 'siapa yang tak tahu mclaren f1 sebuah supercar yang memang cukup terkenal berkat model dan juga peformanya yang sudah tak usah diragukan lagi dan siapa dibalik layar produksi mobil kencang ini mclaren sendiri tentu tidak ada bmw yang juga turut memberikan sumbangsih dalam mclaren f1ya bmw dan mclaren memang bahu membahu dalam memproduksi mclaren f1 pada masa lampau sayangnya mobil ini sendiri sudah tak dilanjutkan lagi produksinya semenjak tahun 1998 dan setelah itu sementara ini kiprahnya di segmen supercar digantikan oleh mclaren p1 namun ada gosip yang menyebutkan bahwa proyek untuk mengembalikan kolaborasi kedua merk ini ke ranah produksi sedang dilakukan dan mengutip dari laman automotivemagazine mclaren dan bmw dikabarkan telah duduk bersama sejak awal tahun 2017 ini untuk mewujudkan tujuan mereka melahirkan mobil super terbarutak terlalu banyak detail yang bisa didapatkan dari informasi ini namun ada informasi yang jelas mengatakan bahwa akan ada generasi terbaru dari mobil super diantara keduanya dan mobil tersebut kali ini akan berlabel bmw bukan seperti mclaren f1 pada masa silam kabarnya mobil ini nantinya akan memiliki perawakan yang unik dengan interior yang akan dikembangkan secara maksimal dan juga teknologi mesin hybrid yang telah direvisi sehingga lebih baik selain itu untuk mesin konvensionalnya akan menggunakan mesin v8 bmw dengan bespoke cylinder headsdan hal ini semakin diperkuat dengan statement dari bos divisi bmw m frank van meel yang mengatakan bahwa dirinya menghabiskan waktu lebih banyak dikala malam hari untuk bekerja di munich pada musim panasnya secara terpisah seorang senior manager dari bmw mengatakan bahwa mobil ini adalah sebuah mobil yang hebat namun pada akhirnya pihak bmw mengatakan bahwa mereka merasa salah jika mobil ini hadir di masa sekarang yang cenderung mencari kehematan bahan bakar oleh karena itu pihak bmw sedang mengembangkan kemungkinan mobil ini menggunakan mesin lain yang canggih dan bertenaga listriknamun semua peluang masih terbuka bagi bmw untuk membuat mobil super mereka selain kerjasama mereka dengan mclaren bmw juga diketahui masih menjalankan kerjasama dengan jaguar land rover untuk mengembangkan mesin dengan konfigurasi v8 yang diberi nama project jennifer mesin ini dikabarkan akan digunakan oleh produk range rover dengan spesifikasi mesin berkubikasi 4400cc twin turbo v8 yang bertenaga 640hp dengan torsi 799 nm menarik jadi entah akan bersama mclaren atau jaguar land rover nyatanya bmw sedang berhasrat untuk memunculkan kembali sebuah supercar seperti mereka membuat mclaren f1 dulu kita tunggu saja bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'bmw akan buat mobil super versi mereka sendiri bersama mclaren'),
(18, 'beberapa bulan yang lalu honda kepergok tengah mendaftarkan paten desain mobil sport baru yang digadang-gadang bakal jadi nsx junior tidak hanya itu ada nama zsx yang dipatenkan honda juga apa ini calon mobil baru honda ya tapi bukan mobil nyata inilah realisasi virtual paten-paten tersebut namanya honda sports vision gran turismo yah tadinya dikira bakal jadi mobil sungguhan ternyata mobil vgt tohpendekatan yang diambil honda sedikit konservatif dibandingkan mobil vision gran turismo lainnya jika mobil-mobil vision gran turismo lain mengambil tema mobil konsep atau mobil balap le mans honda memilih jalur konvensional ya memang desain mobil sport ini sangar tapi tidak terlihat susah atau mustahil untuk langsung dijadikan ke dunia nyata selain honda bmw vision gran turismo juga termasuk mobil yang tidak susah untuk direalisasikansaat mendesainnya honda memutuskan proyek ini untuk dikerjakan seorang desainer dari los angeles dikerjakan di studio desain di california dan perancangan finalnya dilakukan di jepang meski ini mobil digital honda sports vision gran turismo sudah dibuatkan model asli dengan ukuran 11-nya untuk dites di terowongan angin sungguhan bukan simulator belaka mayoritas konstruksinya mengandalkan carbon fibermenurut informasi dari honda bobot honda sports vision gran turismo ini hanya sekitar 991 kg-an benarkah tidak tahu itu kan mobil virtual memangnya bagaimana cara menimbang mobil di gt sport formatnya adalah mid-engine 2 seater coupe dengan mesin mungkin 2000 cc 4 silinder turbo yang sanggup menghasilkan 400 hp dan dikawinkan dengan girboks 8 percepatan oh ya girboksnya kopling gandamobil ini sama sekali tidak ekstrim atau radikal seperti lm55 lf-lc vision gran turismo viziv vision gran turismo atau hyundai n vgt namun ya itu ia cenderung konvensional dan realistis seperti bmw vision gran turismo menarik untuk melihat mobil ini beraksi di gt sport namun lebih menarik lagi kalau honda berani memproduksinya untuk dijual bukan sebagai penerus s2000 atau integra memang karena formatnya beda jauh apa opinimu sampaikan di kolom komentar', 'honda sports vison gran turismo  inilah mobil misterius honda'),
(19, 'kalian pasti sudah tak asing lagi dengan produk  produkd ari wuling kan di indonesia wuling memang cukup fenomenal dengan wuling hongguang alias wuling confer s dan tak lama lagi pihak sgmw motor indonesia akan menyapa lagi dengan wuling cortez alias baojun 730 namun pernahkah kalian mendengar suv dari wulingmungkin beberapa dari kalian teringat dengan beberapa suv yang kami sempat beritakan dan menyinggung nama wuling namun nyatanya suv  suv tersebut adalah produk dari baojun bukan dari wuling sebelum bulan november 2017 ini wuling di china hanya menjual mobil  mobil entry level dengan segmen mpv dan mobil komersial tak ada suv dan kini wuling resmi memperkenalkan kepada publik china lsuv terbaru dan pertama dari mereka yaitu wuling hongguang s3mungkin bagi kalian yang suka bermain ke situs  situs media otomotif china kalian sudah tak asing dengan wuling hongguang s3 karena tahun ini sudah banyak bocoran fotonya secara penuh wuling hongguang s3 sendiri akan menyasar pasar lsuv alias suv murah di china dengan rentang harga antara 59800 yuan hingga 84800 yuan harga tersebut jika dikurskan ke rupiah mendekati angka 1218 juta rupiah untuk varian termurah dan 1727 juta rupiah untuk varian termahal range harga yang mirip dengan wuling confero s di tanah airsecara desain wuling hongguang s3 memang hadir dengan desain yang cukup unik bukan selera semua orang memang seperti wuling hongguang alias wuling confero s namun melihat bentuknya wuling hongguang s3 menjanjikan kabin yang lega namun yang cukup mengganggu pandangan adalah velg dari mobil ini yang terlihat kecil untuk ukurannya lampu depan dari wuling hongguang s3 ini sendiri sudah menggunakan model proyektor dengan foglamp besar di bawah dan grille dan bumper depan yang terlihat kokoh di sisi samping tak ada lampu sein di spion namun ada lis krom yang menghiasi bagian bawah jendelanyasisi belakang nampaknya akan menjadi sisi yang penuh perdebatan karena desainnya yang bukan selera semua orang lampunya memanjang secara horisontal hingga ke pintu bagasi dengan high mount stop lamp pada rear upper spoiler dan juga bumper belakang yang lumayan oke tapi itu emblem banyak sekali ya wuling hongguang s3 akan menggunakan mesin 1500cc dengan tenaga maksimal 112 hp dan juga mesin 1500cc turbo dengan tenaga maksimal 150 hp sayangnya seperti wuling hongguang mobil ini hanya memiliki transmisi manual jangan berharap ada transmisi otomatis ataupun cvt sebuah kelemahan yang sayang jika dipertahankan ya kanmasuk ke sisi dalam kita akan dihibur dengan bentuk interior yang simpel namun tetap menarik beberapa komponen dari wuling hongguang alias wuling confero s masih ada disana seperti setir yang sama dan juga jam analog yang keren dari interior wuling hongguang s3 ini adalah panel instrumennya yang sudah full digitalselain itu sistem infotainment di mobil ini menggunakan layar senuth 8 inci seperti mobil eropa jangan berharap ada android auto atau apple carplay cukup disyukuri karena hanya ada bluetooth konfigurasi jok mobil ini adalah 2  2  3 alias pakai captain seat menarik jelasya nampaknya bisa dibilang wuling hongguang s3 ini adalah wuling confero s dengan sosok suv jadi bagaimana menurut kalian kalau masuk ke indonesia bagaimana ya yuk sampaikan pendapat kalian kawan', 'wuling hongguang s3 dirilis di china suv pertama wuling'),
(20, 'awal tahun lalu kita sudah dihibur dengan kehadiran versi kencang dari bmw m4 yaitu bmw m4 cs kala itu mobil dua pintu tersebut sukses mengusung mesin 454 hp yang tak bisa dibilang pelan dan di penghujung tahun ini serta di penghujung generasi f80 dari seri 3 bmw kembali memberikan kejutan pada publik dengan merilis bmw m3 cskehadiran bmw m3 cs sendiri merupakan sebuah alternatif lain bagi kalian yang menyukai bmw m4 cs namun merasa dua pintu agaknya kurang lega bmw m3 cs hadir untuk memenuhi hasrat konsumen yang menyukai peforma tinggi namun masih menuntut mobil ini untuk memiliki kepraktisan untuk digunakan harian tentunya yang paling menarik dari bmw m3 cs adalah mesinnya bmw m3 csmenggunakan mesin 3000cc twin-power turbo yang sudah dilakukan upgrade mesin dengan enam silinder ini sendiri kini mampu memproduksi 453 hp dengan torsi 600 nmangka  angka di mesin tersebut sebenarnya mirip dengan bmw m4 cs hanya saja tenaganya turun 1 hp saja sedang torsinya sama persis mesin bertenaga buas tersebut dipasangkan dengan transmisi otomatis dengan tujuh percepatan m double clutch perpaduan keduanya membuat bmw m3 cs mampu berlari dari keadaan diam hingga 100 kmjam hanya dalam 37 detik saja menarik sedangkan untuk kecepatan maksimal mobil ini sendiri ada di angka 280 kmjam salah satu peningkatan peforma ini sendiri bukan semata  mata karena tuning dari mesin melainkan juga dari pengurangan bobot mobil inibmw m3 cs lebih ringan sekitar 50 kg dibandingkan dengan versi bmw m3 standar pengurangan bobot ini sendiri berkat penggunaan bahan carbon fiber reinforced plastick pada bagian kap mesin dan juga pada atap mobil ini selain bobotnya berkurang penggunaan bahan cfrp pada kedua bagian ini juga memperbaiki center of gravity dari mobil ini selain mesin dan bahan cfrp bmw m3 cs juga mendapatkan adaptive m suspension m differential dan dual branch sport exhaust dengan empat lubang knalpot selain itu dari sisi eksterior bmw m3 cs mendapatkan sayap baru di sisi belakang menemani rear diffuser yang diambil dari bmw m4 gtsuntuk velg bmw m3 cs mendapatkan model khusus yang sporty dengan pilihan diameter 19 inci ataupun 20 inci velg tersebut akan dibalut dengan ban dari michelin pilot super sport masuk ke sisi dalam bmw m3 cs mendapatkan bahan kulit merino dengan dua warna pada kursinya selain itu ada beberapa aksen di interior yang dibalut oleh bahan alcantara untuk memanjakan telinga bmw telah memperlengkapi mobil ini dengan sistem audio dari harman kardon selain itu ada beberapa detail lain seperti special door sill plates dan sistem infotainment dengan gps yang hadir di mobil inibmw m3 cs sendiri akan dijual dengan unit yang terbatas kawan total hanya ada 1200 unit dari bmw m3 cs yang akan dijual secara global dengan alokasi 550 unit khusus untuk pasar di amerika serikat untuk harga tak ada kabar lebih lanjut mengenai banderol mobil ini bagaimana menurut kalian tertarik yuk sampaikan pendapat kalian kawan', 'bmw m3 cs diperkenalkan tenaga mencapai 453 daya kuda'),
(21, 'jika ferrari laferrari adalah nasi goreng maka ferrari fxx-k adalah nasi goreng spesial pakai telur dadar bisa lebih spesial lagi bisa dong ferrari sudah memberi evolusi lagi bagi fxx-k inilah ferrari fxx-k evo nasi goreng spesial pakai telur dadar yang bungkusnya diberi 2 karet kaget juga padahal menurut kami ferrari fxx-k saja sudah gila rupanya ferrari bisa membuat sesuatu yang lebih gila lagi di fxx-k evo initerlihat bahwa engineer ferrari berdarah-darah dan berpeluh deras kala harus membuat ferrari fxx-k evo ini tugasnya hanya satu  membuat mesin balap yang paling ekstrim yang tak terbayangkan tak terbayangkan dan juga tak berguna sebab mobil ini tidak road legal dan tidak bisa ikut seri balap manapun di dunia ini yah setidaknya ia bisa memamerkan perangkat aerodinamikanya yang ekstravaganferrari fxx-k evo menjanjikan peningkatan downforce yang signifikan yakni sekitar 23 persen lebih besar dari fxx-k biasa tak hanya itu gaya tekan ke bawahnya pun 75 persen lebih besar daripada laferrari biasa mobil ini sanggup menghasilkan downforce yang hampir sama dengan model balap gt ferrari dengan lebih dari daya cengkraman sebesar 900 kg yang muncul akibat tekanan angin di kecepatan tinggiuntuk mencapai tujuan ini engineer ferrari di maranello memasang sayap belakang baru yang bekerja sesuai dengan spoiler belakang adaptif ada sirip ekor vertikal juga bersama dengan generator vortex baru di cover mesin v12-nya dan di bagian bawah bodi mobil bumper depan dan belakang telah didesain ulang untuk mengendalikan aliran udara yang lebih baik dan suspensi telah disetel untuk mengakomodasi downforce ekstrapara engineer ferrari juga memasang setir baru yang lebih identik dengan mobil f1 mereka dan monitor digital baru untuk menampilkan tampilan belakang mobil sistem hybrid kers dan data-data telemetri perangkat tambahan ini akan tersedia untuk pelanggan ferrari yang paling elit baik sebagai paket tunggal fxx-k evo utuh atau sebagai pake upgrade dari fxx-k biasa jadi kalau sudah punya fxx-k dan mau naik level ke versi evo ya bisadivisi corse clienti telah memiliki sembilan acara yang dijadwalkan untuk program xx untuk musim depan yang akan berlangsung di trek di seluruh dunia antara bulan maret 2018 dan oktober 2019 perlu diingat kebijakan menyebalkan ferrari tetap ada yang berarti tidak sembarangan orang akan ditawarkan paket ini meski punya uang segunung apa opinimu sampaikan di kolom komentar', 'ferrari fxx-k evo  kuda sakti pemecah angin'),
(22, 'biarpun sudah ada pagani huayra pagani zonda sendiri sepertinya susah bikin pagani move on terbukti bahkan setelah huayra muncul sebagai pengganti zonda masih ada saja edisi-edisi khusus dari zonda pagani pernah bilang kalau zonda r dan tricolore adalah zonda terakhir tapi malah habis itu muncul zonda 750 habis zonda 750 muncul zonda hh habis zonda hh muncul zonda 760 seperti lalat zonda susah sekali untuk dibunuhnah kelihatannya zonda akan jadi lalat yang makin susah untuk dibunuh sebelumnya pagani zonda telah dibuat sebanyak 137 unit sejak 1999 hingga 2017 dan jika ada konsumen yang mau zondanya sehat seperti baru berbahagialah pagani belum lama ini meresmikan program pagani rinascimento yang memastikan setiap zonda yang telah beredar bisa mendapat menu restorasi total di pabrik pagani jika pemiliknya berminatsebenarnya pagani bukan baru pertama kali mengadakan program sejenis dua tahun yang lalu tim pagani di modena merestorasi total pagani prototipe 2 alias zonda yang hari ini lebih terkenal sebagai la nonna tunggu dulu meski nama la nonna terdengar eksotis dalam bahasa italia la nonna artinya nenek yah wajar sih sudah tua juga si prototipe 2 itu jarak tempuhnya pun tidak main-main yakni 620000 mil atau 992000 kilometer what thepagani zonda la nonna berkode c12 ini muncul pada tahun 1999 di tahun-tahun berikutnya mesin m120 6000 cc bawaan c12 yang berdaya 388 hp diganti dengan mesin 7000 cc v12 yang dibuat oleh amg buat pagani pagani terus melakukan upgrade mesinnya dengan berbagai komponen baru sampai seri zonda 760zonda la nonna direstorasi total untuk merayakan ulang tahun ke-60 horacio pagani pada tahun 2015 termasuk memodifikasinya dengan beberapa fitur dari pagani zonda cinque nah jadi para miliuner anti mainstream yang malas dengan ferrari atau lambo dan sudah punya zonda yang berumur di garasinya sepertinya ini saat yang tepat untuk meremajakan kembali zonda anda apa opinimu sampaikan di kolom komentar', 'pagani tawarkan restorasi total zonda di pabriknya'),
(23, 'beberapa tahun belakangan volkswagen termasuk pabrikan yang punya prestasi mentereng di wrc namun sayang mereka harus mundur di akhir musim wrc karena harus bertanggung jawab dengan kasus dieselgate yang mereka alami sementara vw minggat toyota berusaha mencuri perhatian di wrc menggunakan toyota yaris wrc yang dipacu oleh jari-matti latvala sementara hyundai terus beraksi dengan i20 wrchasilnya toyota yaris wrc menjadi sangat kencang dan kompeten di arena reli dan hyundai bisa leha-leha karena absennya volkswagen entah karena kasus dieselgate sudah bisa diurus dengan baik atau volkswagen terbakar karena dikompori aksi toyota di wrc volkswagen sudah memutuskan bahwa mereka siap beraksi lagi di arena reli dunia wrc nah ini baru mantap terus bagaimana mobilnya apa vw polo r wrc yang sangat dominan kemarin bakal turun lagioh tidak sebab vw ingin pakai mobil baru adalah vw polo gti r5 yang bakal jadi ujung tombak volkswagen di kancah wrc mobil ini basisnya vw polo gti namun mesin 4 silinder turbonya dirombak total hingga bisa memuntahkan 270 hp ke keempat rodanya via transmisi sekuensial 5 percepatan sayang belum ada foto resmi dari vw polo gti r5 ini yang ada hanya teaser berupa sketsa belakavw polo gti r5 dirancang dan dipersiapkan oleh tim yang sama dengan yang merancang polo r wrc tentu saja itu termasuk direktur teknikal vw motorsport francois-xavier demaison dan insinyur balapnya sebastien ogier gerard-jan de jonghdengan polo gti r5 kita berharap bisa menyalurkan kemampuan kami dari 4 gelar wrc ke konsumen balap dengan sukses sekaligus menawarkan mobil balap kelas atas untuk berbagai kelas reli dari kelas nasional ke wrc kata direktur vw motorsport sven smeetssaat mobil ini dirilis di semester kedua tahun 2018 vw polo gti r5 juga akan diturunkan ke ajang balap vw yang diadakan khusus buat konsumen mereka yang gandrung akan balapan dan berniat menjadi pembalap profesional yakni kejuaraan touring car golf gti tcrsebelum balapan pertama di tahun depan kami akan menguji polo gti r5 dengan serangkaian tes berat demi memastikan kesiapannya melahap berbagai jenis trek di dunia tutup smeets jadi ingin lihat aksi polo vs fiesta i20 dan yaris nih apa opinimu sampaikan di kolom komentar', 'kembali ke wrc volkswagen polo gti r5 jadi andalan'),
(24, 'toyota avanza transmover adalah varian baru dari toyota avanza menyebut grand new avanza itu kepanjangan sebagai respon atas aturan yang sempat melarang mobil lcgc untuk menjadi taksi online selain merilis avanza transmover toyota juga merilis toyota limo yang biasanya dipakai oleh taksi supaya bisa dibeli oleh konsumen perorangan spek toyota avanza transmover dan toyota limo adalah sama sama-sama kosongannamun meski sudah ada avanza transmover toh lcgc tetap menjadi mobil pilihan para supir taksi online karena murah khususnya lcgc berbentuk minibus 3 baris nah lalu apa kabar nasib transmover mungkin foto di atas tadi bisa menjawabnya yang menggambarkan bahwa toyota avanza taksi bluebird akan segera berkeliaran dengan menggunakan toyota avanza transmover sebagai basisnyasesuai penampakan toyota avanza taksi bluebird yang aslinya berwarna putih solid sudah diguyur cat biru muda yang jadi identitas perusahaan taksi berlogo burung ini lengkap pula dengan stiker di pintu dan tulisan taksi di atasnya sepertinya avanza taksi ini siap untuk membelah padatnya jalanan dengan plat kuning di depan dan belakangnyaoh ya berarti nanti honda mobilio tidak akan jadi armada reguler bluebird dari kelas mpv entry level sebab nantinya akan ditemani oleh avanza taksi ini sip berarti semua low mpv jepang di sini kecuali xpander sudah tak bisa mengelak dari citra taksi di indonesia seperti yang pernah kami sampaikan toyota melakukan beberapa penyunatan fitur yang cukup signifikan pada transmover seperti hilangnya foglamp dan head unittoyota avanza transmover punya kursi baru berbahan pvc seperti daihatsu granmax untuk memangkas harga door trim full plastik tidak ada acdouble blower dan juga tidak ada center console sebagaimana avanza tipe g untuk mesin tidak ada perbedaan berarti dari mesin 1300 cc 4 silinder berkode 1nr-ve dan sudah pasti tidak ada transmover dengan girboks matik bagaimana siap naik avanza taksi', 'toyota avanza transmover resmi jadi taksi bluebird'),
(25, 'sekarang sudah tahun masehi 2000-an jadi ini adalah millenium kedua di saat mobil konsep lain punya visi untuk tahun 2020 2030 atau 2040 lamborghini punya visi gila mereka merilis lamborghini terzo millenio concept untuk millenium ketiga alias tahun 3000-an pede sekali namun kalau melihat bentuknya jangan kira kalau konsep ini fanmade seperti lamborghini madura yang sempat heboh ini resmi dari lamborghini dan mitbetul sekali lamborghini terzo millenio concept ini adalah hasil kerja sama antara lamborghini dan massachusetts institute of technology untuk memantaskan diri sebagai mobil bagi millenium ketiga ada segudang teknologi yang disematkan di sini sebagai permulaan ia memakai 4 motor listrik buat masing-masing rodanya namun powernya dibantu oleh kehadiran kapasitor super dan alat penyimpan energi yang ditanam di panel bodinya iya bodinya menyimpan energilamborghini terzo millenio akan memakai nanotube berbahan carbon fiber dan baterai super tipis yang bisa dibentuk sesuka hati dan dijepit antara 2 panel bodi apa aman bodi mobil kan rentan baret atau retak nah di sinilah kolaborasi dengan mit muncul sebab carbon fiber hasil inovasi mereka diklaim punya teknologi yang membuat panel carbon fiber bawaannya bisa memperbaiki dirinya sendiri dan mulus kembali wah boleh nihmobil ini diklaim bisa tahu kalau bodinya sendiri mengalami cacat seperti retak atau penyok kecil jika ada hal semacam itu cairan kimia yang bertugas memperbaiki panel akan dilepas dan berjalan melalui saluran-saluran kecil nan halus supaya panel yang tadinya baret penyok retak atau semacamnya bisa mulus lagi wah kalau teknologi ini bisa turun ke mobil kelas lcgc usaha ketok magic dan body repair bisa menurun omsetnyatidak banyak detail yang dibeberkan lamborghini buat terzo millenio ini sebab karena teknologi yang diusung mungkin terlalu futuristik termasuk si panel bodi cerdas itu akan tetapi lamborghini meyakini bahwa beberapa teknologi di mobil ini sudah dikembangkan dan sebagian sudah siap diaplikasikan ke mobil mereka dan salah satunya adalah kers kinetic energy recovery system apa opinimu sampaikan di kolom komentar', 'lamborghini terzo millenio concept bodinya bisa perbaiki diri sendiri'),
(26, 'pada abad 20-an mirage adalah nama lain dari mitsubishi lancer yang tersedia dalam bentuk sedan coupe dan hatchback ada juga beberapa varian seperti mirage cyborg dan mirage asti tapi tidak ada mirage evolution itu dulu soalnya untuk abad 21 mitsubishi memutuskan kalau mirage harus jadi city car kecil buat menembus padatnya ibukota yah itu sebagaimana nama eclipse yang dulunya sport coupe sekarang malah jadi crossoversepertinya metamorfosa mirage akan berlanjut lagi dalam beberapa tahun ke depan melalui sesi wawancara dengan auto express diketahui mitsubishi sudah merapatkan barisan demi merombak mirage mereka menyampaikan bahwa mirage akan tumbuh membesar dan naik kelas di mana ia tak lagi berminat melawan mobil seperti kia picanto dan suzuki ignis melainkan naik ke kandangnya ford fiesta mazda 2 dan vw polo lah bukannya di kelas itu ada mitsubishi colt hatchbackah sudahlah kembali ke rencana mitsubishi yang konon akan memakai platform cmf milik renault-nissan buat menjadi basis mirage barumendesain dan merancang platform khusus itu mahal dan margin di kelas mobil kecil itu sedikit jadi apa kami berpikir untuk memakai platform milik renault dan nissan untuk segmen ini jawabannya adalah ya tukas vincent cobee wakil presiden korporat dan kepala perencanaan produk mitsubishi kepada sumber tersebutmitsubishi juga dikabarkan tengah mempelajari bagaimana kalau mirage pakai mesin turbo sebenarnya kalau urusan mesin turbo kami tak ragu dengan mitsubishi sendiri mengingat level engineering mereka soal perturboan merupakan salah satu yang paling banyak pengalaman namun mesin mitsubishi mirage turbo nantinya bukan dari mitsubishi sendiri melainkan mesin 3 silinder turbo dari renault twingo fyi mesin 3 silinder turbo milik twingo tenaganya 108 hpterakhir nanti mungkin nama mirage akan pensiun ini mungkin akan terjadi untuk menegaskan posisi kelas mitsubishi mirage yang baru belum ada yang resmi namun jika renault sudah memastikan akan ada clio baru di tahun 2018 maka mirage akan pakai platform clio baru nah soal nama apa jangan-jangan nanti mirage akan ganti nama jadi galant menurutmu nama apa yang mungkin dipilih mitsubishi sampaikan di kolom komentar', 'rencana mitsubishi mirage baru  ganti nama bodi membesar dan turbo'),
(27, 'biasanya kalau kita dihadapkan pada sebuah pilihan terkait warna kendaraan yang akan kita beli apa yang mendasari pemilihan warna tersebut apakah karena secara pribadi anda suka atau ikut  ikutan yang lain atau karena warna tersebut adalah hero color dari produk tersebut banyak sekali alasan saat kita memilih sebuah warna untuk mobil kita namun nyatanya hal ini juga berpengaruh saat kita akan menjual mobil itu kembaliya sama halnya dengan pasar mobil baru pasar mobil bekas juga mempertimbangkan warna sebagai salah satu latar belakang pembelian namun memang warna  warna tertentu mungkin akan cukup sulit diperoleh dan kalau tidak pun ada beberapa warna aneh yang kadang membuat kita tak sudi melirik mobil tersebut dan untuk menelusuri perkara ini sebuah studi dilakukan oleh sebuah perusahaan car search engine yaitu iseecars dan dari studi yang melibatkan sebanyak 21 juta mobil ini ditemukan sebuah hasil yang menunjukkan bahwa memang warna mobil mempengaruhi nilai sebuah mobil bekasjika di negara kita warna hitam silver dan putih nampaknya masih menjadi warna  warna idola dimana banyak sekali mobil dengan warna tersebut berlalu lalang di jalanan indonesia namun dari survey dan studi ini ternyata warna kuning-lah yang menjadi jawara dalam hal nilai jual ha maksudnya kalau kita membeli mobil dan menggunakannya sekian tahun maka jelas akan ada depresiasi harga kan nah warna kuning ternyata memiliki depresiasi harga paling rendah yaitu 27 sedangkan posisi kedua dan ketiga dihuni warna orange dan hijau dengan 306 dan 309lho lalu bagaimana dengan warna hitam putih dan silver warna hitam dan silver ada di jajaran belakang dengan angka 336 dan 34 sedangkan warna putih masih menempati posisi keempat dengan 326 posisi terakhir dihuni oleh warna  warna yang kurang biasa seperti beige ungu dan emas ketiganya memiliki depresiasi harga diatas 36 kok bisa kuning hijau orange bukannya ketiga warna itu jarang kita temui di jalan benar memang namun ingatlah warna  warna tersebut adalah warna yang menjadi kebanggan mobil  mobil bervolume rendah seperti sportcar dan supercarselain itu warna  warna tersebut juga hadir di beberapa jenis crossover dan suv kekinian sehingga walaupun tak lazim warna tersebut memang memiliki depresiasi harga yang relatif rendah karena mobil yang menggunakan warna tersebut unitnya tak terlalu banyak sehingga harganya relatif bertahan alias mobil hobi namun walaupun tiga warna tersebut depresiasinya tinggi namun untuk masalah cepat laku ketiganya memiliki waktu tunggu di showroom lebih lama daripada rata  rata justru mobil berwarna ungu-lah yang mencatatkan waktu tunggu tercepat dengan 332 hari diikuti warna emas abu  abu dan putihya bagi kalian yang memang suka berganti  ganti mobil sepertinya perkara warna perlu kalian pertimbangkan kalau kalian ingin menjual kembali mobil kalian tak akan ada masalah yang terlalu berlarut  larut kalian bisa mengecek tren yang ada di pasaran jika kalian ingin mengetahui warna apa yang memang akan menjadi kegemaran masyarakat di masa depan bagaimana menurut kalian kalau kalian suka warna apa yuk sampaikan pendapat kalian', 'inilah warna mobil terbaik jika dibandingkan dengan harga jual kembali'),
(28, 'ada suatu momen di kala honda bisa membuat mobil yang bisa menyamai level sebuah ferrari adalah honda nsx yang disebut sebagai mobil sport jepang yang mengubah dunia otomotif selain toyota 2000gt mazda rx-7 dan famili nissan skyline gt-r misi honda nsx di tahun 1990-an adalah membuktikan kepada dunia bahwa memiliki mobil sport yang asik seperti ferrari tidak harus dibayar dengan kualitas yang kasar reliability yang parah dan ketidaknyamananpembuktian dilakukan dengan mengerahkan semua ujung tombak yang dimiliki honda termasuk meminta ayrton senna untuk membantu menyetel honda nsx generasi pertama berkode na1 teknologi terbaik pun disematkan seperti pemakaian abs 4 channel bodi full aluminium dan lain sebagainya setelah produksi 15 tahun nsx berhenti dibuat namun untungnya ia sudah kembali lagi dengan bentuk yang berbeda dibandingkan nsx sebelumnyabenar-benar beda bentuk saja apa yang berani oleh ditawarkan oleh honda nsx nc1 sehingga ia dinilai pantas menyandang nama nsx simak dalam review berikut inieksteriorjika honda nsx lama didesain oleh pininfarina maka honda nsx baru didesain oleh seorang wanita yang belum lama lulus studi desain dan bekerja sebagai desainer honda maka dari itulah mengapa ada aura sensual dari nsx lama yang bahkan tidak bisa disamai nsx baru jangan salah bukan berarti desain pininfarina pasti bagus lihat saja hyundai matrix yang juga didesain pininfarina mungkin didesainnya memang sesuai dengan budget hyundai waktu itukembali ke honda nsx terlepas dari adanya solid wing face ala honda nsx baru ini kelihatan memancarkan segala garis-garis supercar eropa yang diaduk dalam satu adonan ada kesan seperti melihat audi r8 mclaren bahkan aston martin saat melihatnya desainnya tidak sespesial nsx na1 tapi ia tetap futuristik dan keren proporsinya yang rendah ceper dan lebar membantu kesan eksotis dan inilah keuntungan platform mesin tengah yang diusungnyabagian depan dihiasi dengan 12 buah projector led dan di bawahnya ada ventilasi udara untuk mendinginkan rem dan motor listriknya demikian juga dengan kap depannya ada ventilasi yang bertugas menghembuskan angin lagi keluar menurut honda semua elemen desain nsx ini punya andil untuk menjaga suhu ideal mesin seraya menghasilkan gaya tekan ke bawah yang besar dan mayoritas gaya tekannya ada di bagian belakanghonda nsx memakai ban standar continental namun bisa diganti menjadi pirelli jika mau merogoh kocek ekstra rem nsx yang ada di sini sudah berbahan carbon ceramic yang kinerjanya lebih bagus saat rem panas dibandingkan saat dingin di depan ia ditunjang oleh 1 kaliper besar sementara di belakang ada 2 kaliper kecil setup seperti ini juga dimiliki oleh supercar eropa lain macam lamborghini aventador dan mclaren 720sspion honda nsx didesain khusus untuk mengalirkan angin ke ventilasi samping tempat di mana intercooler bertengger dan siap untuk mendinginkan udara setelah itu udara akan keluar dari ventilasi yang ngumpet di atas lampu rem led-nya lampunya sendiri bentuknya mirip kepunyaan aston martin one-77 bagian kolong nsx dibuat rata dan buritannya dihiasi dengan diffuser yang berfungsi sungguhan plus 4 lubang knalpot yang dibingkai jadi 1 macam aventadorinteriorhonda nsx tidak memiliki kesan bespoke seperti supercar eropa sama seperti nissan gt-r kita masih bisa menemukan beberapa common parts dari mobil lain seperti tombol-tombol power window memori jok dan pengaturan jok elektriknya feeling saat memainkan paddle shift nsx pun terasa murah tidak ada bobot yang mantap dan suara kliknya tidak terdengar berkelas singkat kata rasa premium nsx masih belum sepantaran dengan merek eropa seperti r8 dan 911namun masih ada persamaan antara nsx lama dan nsx baru  kabinnya roomy buat ukuran supercar visibilitasnya pun bagus tidak sulit untuk melihat ke depan samping dan belakang dari mobil ini suatu hal sepele namun memang biasanya supercar tidak punya visibilitas yang bagus misalnya lamborghini veneno dan koenigsegg ccx posisi mengemudi nsx mantap ergonomis dan rasa sporty-nya dapat namun memang posisi duduknya tidaklah serendah supercar pada umumnyasetirnya tidak lingkaran seperti mobil biasa melainkan agak kotak seperti milik ferrari plus aksen carbon fiber sayangnya untuk mobil semahal ini pengaturan tilt dan telescopic nsx masih manual seperti bmw i8 di balik setir ini ada panel instrumen yang berupa layar besar dengan beberapa jenis tampilan tergantung dari 4 mode berkendara yang bisa dipilih  quiet sport sport dan track mode ini bisa diatur via kenop putar di dekat transmisidi mode quiet nsx akan menutup beberapa katup knalpotnya menjaga putaran mesin tidak terlalu tinggi dan memprioritaskan penggunaan motor listrik supaya suaranya tidak berisik dan tidak bikin tetangga marah berlanjut ke mode sport sport dan track nsx akan berusaha mengubah sifatnya menjadi supercar sejati seraya memastikan mesin v6 twin turbo dan mesin listriknya bersatu padu memberikan performa terbaik yang bisa ia berikanhonda nsx nc1 ini tidak punya head unit yang bespoke juga terlihat mirip dengan kepunyaan civic turbo versi amerika tidak banyak juga tempat buat penyimpanan barang di sini glovebox kantong pintu dan center console box tidak usah dipertanyakan pasti punya namun tidak ada cup holder paten sebab yang ada hanyalah cup holder portable seperti mx-5 padahal kalau mau bisa lho mendesain cup holder seperti kepunyaan porsche 718 boxster bagus dan tak makan tempatkalau mau menyimpan barang jangan buka bonnet honda nsx bagian depan di situ sudah penuh sesak dengan 2 motor listrik dan segala barang-barang lain yang menunjang kinerja mobil bagasinya ada di belakang dengan kapasitas yang cukup fair untuk beberapa tas punggungteknologibab khusus karena ada beberapa teknologi di mobil ini yang bakal jadi pertaruhan honda soal citra nsx baru yang bakal menentukan apakah ia bakal menjadi supercar revolusioner seperti nsx lama atau hanya supercar biasa yang pakai nama nsx honda membawa teknologi drive-by-wire di alat-alat berat ke dunia supercar yakni di sektor pedal rem pedal remnya tidak bekerja secara mekanis melainkan elektrik tidak ada selang rem yang ada hanya kabelkonon ini untuk memberi benefit pada sistem regenerative braking nsx yang bisa mengisi ulang kembali daya baterainya saat deselerasi atau pengereman entah apa yang salah dengan mobil hybrid lain yang remnya konvensional namun juga punya sistem regenerative brakingpower steering elektronik rem elektronik pedal gas elektronik hm kedengarannya terasa seperti saat main gt sport forza atau asseto corsa pakai setir game buatan logitech atau thrustmasterkemajuan lain yang ditawarkan nsx adalah sistem torque vectoring yang dianut 2 motor listrik di depannya sebelumnya biar kami jelaskan kalau 2 motor listrik di depan punya tugas untuk memutar roda depan masing-masing secara independen motor kiri buat roda kiri motor kanan buat roda kanan kembali ke soal torque vectoring memang apa spesialnya punya nsx toh mazda 3 baru juga punya sistem sejenisbedanya lebih ke cara kerja kebanyakan mobil yang mengadopsi torque vectoring mengandalkan rem dan differential untuk membagi torsi antara roda kiri-kanan sembari mengerem di satu sisi roda untuk meningkatkan kemampuan menikung alias cornering kalau honda nsx ia mengandalkan 2 motor listrik di depannya untuk membagi torsi dan kecepatan putaran antara roda kiri dan kanan lah terus apa bedanyabedanya adalah kala differential dan rem hanya bisa mengatur input torsi positif gerak maju nsx bisa mengatur input torsi positif dan negatif gerak maju dan gerak mundur itu baru teori di atas kertas sebab pembuktian seberapa jauh efek sistem ini terhadap handling mobil bukanlah di atas kertas melainkan di atas aspal selain di atas kertas dan di atas aspal sistem ini juga harus memberikan rasa yang natural saat dikendarai pembuktian yang sangat berat sihseperti audi r8 honda nsx punya magnetorheological damper buat keempat suspensinya apa ini mengatur keras-empuknya suspensi iya tapi kalau begitu doang tidak seru sebab honda berusaha meniru sistemnya audi damper ini bisa berganti setelan hingga berkali-kali dalam hitungan detik untuk menyesuaikan karakternya dengan permukaan jalan yang ia lalui dan ini turut andil dalam mengubah karakter mobil di keempat mode yang beda dari quiet hingga trackdari sisi aerodinamika honda nsx memprioritaskan sebagian besar downforce ke belakang karena sebagian besar tenaganya diserahkan ke roda belakang ada satu motor listrik di belakang yang dijepit di antara mesin dan girboks kopling ganda 9 percepatan bawaannya di mana tugasnya adalah memberi dorongan kala mesin bensinnya belum bekerja optimal seperti saat turbo lag atau ganti gigi ini adalah teknologi yang sama dengan laferrari p1 918 dan i8diketahui honda membeli mobil sport lain seperti porsche 911 gt3 991 mclaren mp4-12c dan sepasang ferrari 458 saat merancang nsx secara kebetulan porsche tahu kalau salah satu 911 yang mereka jual dibeli honda untuk dianalisa setirnya jadi mereka menyisipkan surat cinta kala porsche milik honda selesai diservis isinya adalahgood luck honda from porsche see you on the other sidemesintidak seperti honda nsx lama yang pakai mesin v6 naturally aspirated honda nsx baru pakai mesin 3500 cc v6 twin turbo yang dibantu 3 motor listrik 1 di belakang dan 2 di depan posisi mesin ini longitudinal tapi awalnya honda pernah menguji prototipe nsx di nurburgring dengan posisi mesin transversal seperti nsx na1 dan na2 sayang hasilnya tidak bagus karena pendinginan nsx baru tidak semudah nsx lama sehingga mobilnya terbakar nsx lama mesinnya transversal lhountuk itu mereka mulai lagi dan menempatkan posisi mesin secara longitudinal dan ini dirasa sudah pas urusan mesin honda merancang mesin v6 ini khusus untuk nsx dan bukan untuk hondaacura lain desainnya sendiri sudah beda sebab jika mesin v6 punya derajat v di angka 60 atau 90 derajat punya nsx ada di angka 75 derajat selain honda isuzu juga pernah bikin mesin v dengan sudut 75 derajatmengeluarkan tenaga 573 hp honda mengklaim nsx bisa lari dari 0-100 dalam 29 detik dan top speed sekitar 307 kmjam itu klaimnya sementara nsx membukukan waktu 0-100 dalam 3 hingga 32 detik dalam beberapa percobaan di luar negeri wah padahal nissan gt-r bisa 28 detik tanpa bantuan motor listrik seperti nsx untuk girboks dia pakai tipe kopling ganda 9 percepatan di mana gigi 1 dipakai untuk start dari diam gigi 9 untuk cruising dan gigi 2 hingga 8 punya rasio rapatkesimpulanhonda nsx lama sudah mematok standar yang tinggi jika ada mobil yang mau jadi penerusnya apa nsx baru ini bisa well karena nsx lama juga mendobrak pasar supercar dengan teknologi maka nsx baru ini lumayan sanggup mengikuti lebih tepatnya nsx bisa membawa teknologi hypercar hybrid yang harganya puluhan miliar ke ranah supercar yang harganya tidak sampai puluhan miliar bmw i8 apa kabar well level performa i8 dan nsx beda logo honda kalah gengsi dibanding logo bmw dan orientasi sistem hybrid keduanya beda  i8 untuk efisiensi nsx untuk performateknologi torque vectoring dengan 2 motor listrik brake-by-wire dan lain-lain bisa memantaskan nsx untuk dibilang canggih namun pendekatan antara nsx baru dan nsx lama dalam memakai teknologi bisa dibilang sangat beda begini nsx lama menggunakan segala teknologi untuk membuat mobil sungguhan yang mencuri perhatian dunia sementara nsx baru menggunakan teknologi supaya mobil canggih ini terasa seperti mobil bukan laptop atau video game nsx baru adalah soal software komputer dan electrical engineering bukan mechanical engineering seperti nsx lamaitu biar nanti pembuktian di atas jalanan saja yang akan mengungkap hasilnya soal desain nsx ini cakep meski auranya beda dengan nsx lama demikian pula dengan interiornya untuk urusan revolusi tinggal masalah waktu apakah nsx bakal jadi patokan bagi supercar eropa atau negara lain ingat nsx lama bisa mencuri perhatian gordon murray yang merupakan master sang supercar legendaris mclaren f1 yah setidaknya nsx baru sudah mendapat perhatian jay lenomerilis 2 jilid konsep mesin terbakar di nurburging dan segala naik-turun saat pengujian semoga bisa membawa nsx ini menjadi penerus nsx yang pantas jika belum sanggup membalap pesona nsx lama mobil ini paling tidak harus bisa mempertahankan nama nsx tetap di ataspertarungan juga berat sebab selain harus melawan audi r8 porsche 911 turbo ferrari 488 gtb dan mclaren 570gt yang lebih kencang nsx juga harus melawan rival sebangsa dan setanah airnya seperti nissan gt-r yang menakutkan plus ancaman dari toyota supra kian mendekat meski kita belum tahu mobilnya seperti apa apa opinimu sampaikan di kolom komentar', 'first impression review honda nsx nc1 2017');
