(29, 'menjelang tutup tahun 2017 sepak terjang pabrikan dalam memperkenalkan model baru tidaklah kendor suzuki misalnya yang tertangkap basah sedang mempersiapkan segala sesuatunya supaya bisa memperkenalkan suzuki sx4 s-cross facelift 2018 baru kami sudah menyampaikan semua yang bisa digali termasuk soal kenaikan harga yang selisih 7 jutaan dibanding sx4 s-cross sekarangnamun capek juga kalau tidak melihat mobilnya langsung kebetulan di sebuah dealer suzuki ada sesosok suzuki sx4 s-cross facelift 2018 yang dipajang tanpa pembatas agak kotor sedikit namun kami tak melewatkan kesempatan ini untuk bisa melihat lebih dekat apa yang bakal ditawarkan oleh sx4 s-cross baru dibandingkan yang lama mari telusuri bersama dalam artikel review suzuki sx4 s-cross facelift 2018 inieksteriordari pertama kali muncul suzuki sx4 s-cross tidak pernah memukau kami dari segi penampilannya tidak cakep cenderung aneh dan tidak proporsional malah sx4 lama lebih berkarakter daripada yang baru ini itu lho yang didesain oleh italdesign giugiaro dan di-rebadge fiat sebagai fiat sedici versi facelift ini sebenarnya sudah muncul lama di luar negeri hanya saja kemarin kita dijatah yang tipe sebelum facelift baru setelah setahun beredar yang facelift ini siap melenggangsuzuki sx4 s-cross facelift punya lampu depan yang tatanannya lebih padat berisi terima kasih kepada warna dasar lampu depan yang gelap tentu sudah hid tapi dengan adanya fitur auto leveling dan auto on-off buat lampu proyektornya sudah lumayan oke buat sebuah suzuki led drl pun standar dan bumper baru sx4 s-cross punya desain yang lebih gagah dengan adanya front skid plate dan bezel foglamp baru lebih berkesan ke arah crossover bukan hatchbackgril depan berubah total dan kami bisa paham siapa yang jadi inspirasi suzuki  bmw bedanya kalau bmw pakai gril double kidney suzuki pakai gril single kidney coba saja kalau gril ini diganti dengan gril double kidney pasti suzuki sx4 s-cross ini jadi baby bmw x1 deh segala revisi tampang ini tetap tidak menjadikan sx4 s-cross cakep ia tetap aneh sepertinya bakal susah bagi mobil ini jadi perhatian di jalan rayapelek suzuki sx4 s-cross punya desain 10-spoke baru dengan finishing two tone bannya pakai ban jk tyres berukuran 21560 r16 profil 60 masih sama seperti yang lama tapi bannya lebih lebar dibanding yang lama sx4 s-cross lama pakai ban 20560 r16 sx4 s-cross ini tetap mempertahankan rem cakram di keempat rodanya tentu saja itu sudah termasuk abs dan ebd sebagai perlengkapan keselamatan standardibandingkan versi sebelum facelift suzuki sx4 s-cross baru lebih lebar 20 mm lebih tinggi 5 mm dan radius putarnya melebar dari 53 meter jadi 55 meter fitur keyless entry masih dipertahankan terbukti via adanya tompel maaf maksudnya tombol smart entry di handle pintu driver dan penumpang depan fitur bagus lain yang masih ada adalah auto rain sensor spion elektrik dengan mekanisme pelipatan elektrik dan sepasang roof railpada bagian belakang yang berubah dari suzuki sx4 s-cross facelift adalah lampu belakangnya desainnya beda namun tetap tidak cakep namun bagus juga kala tahu kalau lampu remnya sudah led empat titik sensor parkir di belakang sudah siap untuk membantu kala parkir mundur meski tak ada kamera parkir seperti biasa konsumen tetap dapat roof spoiler rear skid plate berwarna silver dan wiper belakang sebagai standarinteriorbuka pintu suzuki sx4 s-cross ini dan well nyaris tak ada beda signifikan antara yang lama dan yang baru ini kalaupun ada perbedaan yang benar-benar ingin dicari itu adalah jok berlapis kulit baru satin finish pada bingkai head unit garnish chrome buat ac garnish di pintu dan konsol tengah sisanya semuanya plek banget antara yang lama dengan yang baru duduk di kursi pengemudi posisi mengemudinya ergonomis dan visibilitasnya baikberkat adanya pengatur sliding reclining dan height adjuster tak susah mencari posisi menyetir yang enak di sini apalagi kalau ingat bahwa setirnya bisa diatur maju-mundur dan naik-turun di setir ini tersedia tombol-tombol untuk fungsi cruise control paddle shift pengaturan audio dan telepon via bluetooth setirnya tidak begitu empuk digenggam andai bahannya sedikit lebih empuk maka akan lebih nyamanseperti yang sudah disampaikan tadi jok suzuki sx4 s-cross facelift kini kelihatan lebih mewah berkat lapisan kulit empuk dan nyaman pula kala diduduki di sisi kanan driver ada tombol untuk start-stop engine sensor parkir dan lampu kabut kantung di pintunya sendiri cukup oke bisa untuk menampung botol minum berukuran 600 ml dan beberapa benda kecil lain seperti buku komik atau bungkus cemilanbahan interiornya dominan plastik namun bahannya tidak kasar dan built quality-nya terbilang jempolan dengan minimnya celah yang tak rapat antar panel bagian interior yang bergoyang parah atau berbunyi aneh panel instrumen mempertahankan motif hitam-biru dengan layar mid besar yang informatif dan full color kita juga bisa melihat adanya 2 airbag dan 4 speaker di kabin crossover berlogo s inihead unit suzuki sx4 s-cross punya ukuran layar 7 inci dengan teknologi layar sentuh fasilitas standar head unit ini sudah termasuk koneksi bluetooth untuk smartphone 2 buah port usb 1 port aux plus 1 port hdmi untuk melakukan fungsi mirroring dengan gadget anda tidak bisa menemukan port tersebut buka glovebox penumpang yang lumayan lega itu maka bakal anda jumpai kabel-kabel usb aux dan hdmitepat di bawah head unit-nya suzuki sx4 s-cross facelift memperlihatkan ac digital dengan 2 kenop putar di mana satu untuk mengatur suhu hangat atau dingin sementara yang satu lagi untuk mengatur kecepatan kipas ada mode auto climate control buat yang tak mau repot tapi tentu saja tidak dual zonedefogger depan-belakang bisa difungsikan dengan tombol termasuk tombol buat mengatur sirkulasi udara di dalam mobilkepraktisan suzuki sx4 s-cross mungkin bukan yang paling top di kelasnya tapi tetap saja mobil ini bisa diandalkan kala harus menyimpan beberapa barang bawaan glovebox standarnya lega kantung pintunya praktis ada kantung kecil di sisi kanan driver kompartemen dekat persneling masih muat buat beberapa receh dan kartu parkir penutup center console box miliknya kini berlapis kulit dan bisa jadi armrest kapasitasnya sendiri terbilang standarruang kabinnya pun bisa diandalkan duduk di baris kedua ruang yang tersedia untuk orang dengan tinggi 178 cm masih memadai sisa headroom masih ada tapi legroom yang bagus menjadi poin plus di mobil ini sayang kantung pintu belakang tidak selega di depan karena hanya muat 1 botol biasa untungnya ia punya armrest plus cup holder dan back seat pocket di kedua jok heran kenapa ada pabrikan yang pelit dengan memberikan 1 back seat pocket di kala pabrikan lain bisa memberikan 2 oh ya sandaran jok bisa direbahkan sebanyak 1 step jika perlubagasi suzuki sx4 s-cross punya kapasitas 430 liter di mana itu berarti lebih dari cukup kalau untuk membawa belanjaan bulanan adanya partisi bisa menjamin privasi tapi sayang tidak ada ruang penyimpanan partisi di mobil ini kala kita tak butuh partisi prosesi pelipatan jok pun mudah tinggal tarik tuas dan dorong joknya voila ruang bagasi jadi lebih besar meski hasil pelipatannya tidak rata lantai melainkan agak menanjak seperti mitsubishi xpanderada sentuhan pintar berupa stopper yang bisa mencegah penutup lantai bagasi jatuh kala kita ingin mengakses ban serep atau tool kit seperti di mobil-mobil vw ban serepnya masih memakai pelek kaleng dengan ukuran full size oh ya tompel di pintu bagasinya itu merupakan electric button untuk membuka pintu bagasi jadi bukan pakai sistem mekanik konvensional ingat tombol elektrik ya bukan motorized tailgate opening maksudnyamesinkami sendiri sudah cukup familiar dengan apa yang ada di balik kap mesin suzuki sx4 s-cross facelift mesin berkode m15a dari suzuki adalah mesin yang sudah dikenal lama itu kalau tak mau dibilang tua speknya adalah 1500 cc 4 silinder dengan pengaturan katup variabel vvt tenaga maksimumnya 109 ps di 6000 rpm dan torsinya 138 nm di 4400 rpm cukup fair untuk mesin 1500 cc biasa dan ia dipadu dengan girboks manual 5 percepatan atau otomatis 6 percepatanterlepas dari kotornya mobil yang kami jumpai finishing ruang mesin suzuki sx4 s-cross tidak malu-maluin pengecatannya rata dan tidak meluber tidak ada pula las-lasan atau sambungan yang tidak rapi oh ya jangan lupa kalau suzuki sx4 s-cross ini memakai format fwd alias penggerak roda depan dan tidak ada perubahan teknis yang berarti di mesin girboks suspensi ataupun bahan peredam paling ya itu tadi bannya lebih lebar 10 mmkesimpulansuzuki sx4 s-cross tetap tidak cakep segala revisi yang dilakukan suzuki di sektor penampilan tetap tidak membuat mobil ini sedap dipandang dari sisi manapun juga bahkan suzuki swift dan ciaz saja masih lebih manis anda pakai mobil ini maka anda akan mudah sekali membaur di tengah-tengah lalu lintas dan tidak ter-notice oleh pengguna jalan lain namun sama seperti baleno jangan mengharapkan penampilannya harapkan sektor lainsektor lain yang bisa dijual oleh suzuki sx4 s-cross facelift adalah built quality yang bagus kabin yang lega dan praktis bagasi yang akomodatif untuk barang bawaan target konsumennya dan value for money yang bagus kala kita meneliti fitur apa saja yang didapat dengan harga 26885 juta otomatis dan 256 juta manual ya kenaikan harga 7 juta dibanding sx4 s-cross lama masih terbilang masuk akal dengan segala ubahan eksterior dan jok kulitnyaapa opinimu mengenai suzuki sx4 s-cross facelift ini sampaikan di kolom komentar', 'first impression review suzuki sx4 s-cross facelift 2018 indonesia'),
(30, 'seperti biasanya pasar otomotif china memang menjadi salah satu pasar yang sangat menarik untuk dibahas selain keberagaman produk yang ada beberapa kejadian di pasar ini memang cukup membuat orang member decak kagum atau malah menggeram karena kesal dan biasanya orang kesal karena pabrikan china menjiplak mobil lain dan malah dilindungi oleh pemerintahsalah satu dari pabrikan yang kita kenal pernah menjiplak mobil  mobil lain adalah pabrikan zotye pabrikan yang bekerja sama dengan ford ini sendiri tertangkap tangan pernah menjiplak porsche macan dan mercedes benz gla-class dan selama ini sebenarnya kami juga agak bingung mengapa pabrikan seperti zotye yang sudah bekerja sama dengan pabrikan sekaliber ford masih saja kukuh dengan jiplak sana jiplak sini mengapa tak memproduksi mobil dengan desain sendiri ya setidaknya terinspirasi saja dari mobil lain bukan menjiplak dan asal comotdan nampaknya zotye mulai menyadari hal ini dan menelurkan sebuah mobil baru yang memiliki nama zotye t500 secara desain kami acungkan jempol pada zotye t500 karena pada akhirnya zotye membuka jalan mereka sendiri untuk mengembangkan sebuah mobil tanpa menjiplak mentah ya memang ada beberapa bagian yang mirip  mirip dengan mobil dari pabrikan lain khususnya skoda kali ini namun setidaknya kini mereka mulai mengembangkan sendiri desain mobil mereka mobil ini sendiri terlihat cukup gagah walaupun secara tampilan kaki  kakinya terlihat kurang besarzotye t500 akan diposisikan di antara zotye t300 dan zotye t600 untuk harga sendiri nampaknya zotye akan membanderol zotye t500 di antara 70000 hingga 110000 yuan atau jika dirupiahkan menyentuh angka 142 jutaan hingga 224 jutaan rupiah untuk urusan mesin nampaknya zotye t500 akan menggunakan mesin yang sama seperti yang digunakan dua saudaranya yaitu unit mesin 1500cc tubro dengan tenaga maksimal 156 dk dengan dua pilihan transmisi lima percepatan manual dan juga enam percepatan otomatis mobil berbadan besar ini juga tak akan dilengkapi dengan sistem gerak roda belakang melainkan roda depansenada dengan sisi eksteriornya yang cukup enak dipandang sisi eksteriornya pun sama dengan setir flat bottom layar sentuh 88 incidi dashboard ala mobil eropa dan bentuk dashboard yang terkesan modern dan simpel selain itu bahan alcantara membalut kursinya tombol  tombol daroi ac sendiri juga terlihat rapi dan enak dilihat selain itu acnya sudah dilengkapi dengan pm25 clean-air filter yang akan memberikan udara yang bersih untuk fitur keamanan zotye t500 mendapatkan body stability system traction control automatic braking adaptive cruise control lane departure warning dan night vision system tapi di trim tertingginya saja menarik untuk kami iyajadi dengan sejumlah hal yang ditawarkan plus dengan desain yang bisa dibilang sudah tak menjiplak mentah tentunya zotye t500 menjadi salah satu produk yang menarik tapi di china zotye t500 sendiri belum jelas kapan akan dijual ke pasaran namun melihat modelnya yang sudah siap jual mungkin tak lama lagi bagaimana menurut kalian yuk sampaikan pendapat kalian', 'zotye t500 suv  akhirnya zotye produksi mobil original mereka'),
(31, 'beberapa waktu lalu kami pernah mengangkat sebuah informasi mengenai rencana dari pihak suzuki indonesia untuk memberikan beberapa varian baru pada jagoannya di kelas city car suzuki ignis kala itu kami mendapatkan bocoran bahwa suzuki ignis akan mendapatkan versi luxury dan versi comfortseperti yang kita tahu harga dari suzuki ignis memang cukup terjangkau jika dibandingkan dengan produk  produk sekelasnya setidaknya mobil ini menawarkan fitur  fitur yang cukup lengkap walau bukan yang paling asyik dikendarai selain itu tongkrongannya yang terlihat out of the box juga membuat banyak orang terpikat ya walaupun sisi belakangnya memang menjadi sumber perdebatan yang berkepanjanganoke sekarang varian luxury dan comfort dari suzuki ignis ini sendiri telah dilepas ke pasaran yang mungkin masih membuat kalian kepo adalah berapa harga dari mobil ini pertama untuk varian luxury suzuki membanderol mobil ini dengan harga 1515 juta rupiah untuk varian dengan transmisi manual sedangkan untuk varian ags alias asal gas saja dan tak perlu menginjak kopling harus merogoh kocek anda sedalam 1615 juta rupiahselanjutnya untuk varian comfort yang notabene sedikit lebih murah dari varian luxury harus ditebus dengan harga 1475 juta rupiah untuk model tiga pedal dan perlu menambah 10 juta alias menjadi 1575 juta rupiah untuk mengeliminasi satu pedal harga  harag ini sendiri sudah tertera di laman resmi suzuki indonesia dan kesemuanya adalah harga otr jakarta daerah lain jelas akan ada kenaikan karena perlunya biaya distribusi unit ke daerah tersebutlalu kok nggak ada seremonial untuk menyambut dua model ini ya kok adem ayam saja mirip seperti versi minor change suzuki karimun wagon r ya menurut suzuki sendiri penambahan varian ini adalah program sales sendiri sehingga seremonial untuk menyambut kedua varian baru ini tak diperlukan kalau kalian kepo dengan apa saja ubahan yang ada di suzuki ignis luxury dan comfort kalian bisa cek di artikel ini oke jadi dengan penambahan harga dan fitur bagaimana menurut kalian varian baru dari suzuki ignis ini yuk sampaikan pendapat kalian kawan', 'inilah harga dari suzuki ignis gl luxury  gl comfort'),
(32, 'kalau kita bicara subaru sepertinya memang agak kurang relevan jika di indonesia ya karena memang merk ini nasibnya tak jelas dan belum ada kabar kapan merk ini akan kembali berjualan di indonesia dan sebuah kabar terbaru muncul dari jajaran produk subaru bukan mengenai produk baru ataupun facelift namun mengenai penghentian produksiya mobil yang kali ini akan dihentikan produksinya adalah subaru exiga crossover 7 pihak subaru sendiri pada tanggal 1 november 2017 kemarin mengumumkan bahwa produksi dari subaru exiga crossover 7 akan segera disudahi dan untuk pemesanan dari mobil ini sendiri akan dibatasi hingga bulan desember 2017 mendatang lebih spesifiknya pada tanggal 18 desember 2017 untuk memenuhi pemesanan yang dibuka hingga akhir tahun ini pihak subaru menyebutkan bahwa subaru exiga crossover 7 baru akan dihentikan produksinya pada bulan maret 2018 mendatangkabar buruknya tak akan ada suksesor dari subaru exiga crossover 7 mobil yang diperkenakan dua tahun lalu atau lebih tepatnya pada bulan april 2015 ini sendiri adalah sebuah subaru exiga yang diberikan dandanan ala  ala crossover plus dengan tiga baris tempat duduk sayangnya subaru exiga sendiri memang sudah termasuk uzur karena usianya yang sudah menginjak hampir sedekade sejak pertama kali dikenalkan di tahun 2008 silam dan melihat cukup banyaknya varian yang bisa saling memakan pasar yang sama seperti subaru levorg dan subaru outback nampaknya mengampakkan subaru exiga cukup masuk akalsebenarnya jika meruntut pada beberapa mobil yang akan diproduksi oleh pihak subaru ada sebuah mobil dengan tiga baris tempat duduk yang bisa menggantikan posisi dari subaru exiga crossover 7 mobil ini adalah subaru ascent yang akan menyapa publik di tahun 2019 mendatang namun di sela  sela gelaran tokyo motor show 2017 salah satu petinggi subaru yaitu yoshinobu yoshinaga mengatakan bahwa unit subaru ascent tidak akan dibawa oleh pihaknya ke pasar jepang sehingga bisa dikatakan subaru exiga crossover 7 akan menjadi varian dengan tiga baris tempat duduk terakhir yang akan dijual oleh subaru untuk saat inijadi tahun ini akan menjadi tahun yang agaknya cukup suram bagi mobil dengan 7 penumpang di jepang karena subaru exiga crossover 7 menyusul mazda biante yang juga kami kabarkan pada hari ini bahwa produksinya sudah dihentikan bulan lalu bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'subaru exiga crossover 7 berhenti diproduksi pada maret 2018'),
(33, 'sebenarnya para konsumen mpv di segmen yang dihuni oleh nissan serena mitusbishi delica dan toyota voxy harusnya berterima kasih pada mazda biante mengapa begitu karena jika kala itu mazda biante tak mendobrak pasar maka mungkin nissan masih saja menjual serena c24 disiniya karena ancaman dari mazda biante nissan lalu melakukan upgrade pada jagoannya menjadi nissan serena c26 pun begitu dengan toyota yang memproduksi nav1 yang gagal bersinar dan digantikan oleh toyota voxy kali ini namun sayangnya sang pendobrak di segmen ini nampaknya harus menjadi model yang juga menyusul toyota nav1 untuk dikampakkan dari daftar harga karena ternyata mazda biante sudah tak diproduksi lagi saat iniya kabar ini sendiri kami dari laman blog livedoorjp yang memberikan kabar bahwa ternyata sejak akhir bulan september 2017 lalu mazda biante telah dihentikan produksinya di jepangmazda biante sendiri telah menjalani 9 tahun masa produksi sejak pertama kali dijual di bulan mei tahun 2008 silam selama ini ada sebanyak 83311 unit mazda biante yang sudah dilepas ke pasaran nasib dari mazda biante memang kurang mengkilap penjualannya yang mencapai 13000 unit di tahun pertama penjualannya dan tahun  tahun berikutnya yang berada di kisaran 12000-an unit menurun drastis hingga pada bulan terakhirnya diproduksi mobil ini hanya terproduksi 775 unit sajadan dengan pensiunnya mazda biante maka penggantinya pun segera merapat bahkan sudah ada yap penggantinya tak lain dan tak bukan adalah mazda cx-8 alias mazda cx-5 yang dipanjangkan dan dberi ekor bak mazda cx-9 dan hal ini mempertegas bahwa nantinya pasar dari mazda biante akan dialihkan ke pasar suv dengan konfigurasi 6 dan 7 tempat duduk yang artinya pasar biante di indonesia pun mungkin digantikan oleh mazda cx-8 sesuai dengan bocoran kami beberapa waktu lalu yang menyebutkan bahwa mazda cx-8 akan segera masuk ke indonesia pada penghujung 2018namun sekali lagi masih dari bocoran yang sama nampaknya pabrik mazda masih dalam tahap peralihan untuk memproduksi mazda cx-8 karena pada awal 2018 mazda akan fokus untuk memenuhi pasar domestik jepang saja untuk unit dari mazda cx-8 jadi akankah mazda cx-8 menggantikan biante pasar otomotif memang keras sob dan tentunya dinamis bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'mazda cx-8 akan menggantikan biante'),
(34, 'sebuah mobil baru lagi diperkenalkan di dataran china namun jika sebelumnya kami membahas landwin x7 facelift yang menjiplak model dari range rover evoque maka saat ini kita akan membahas sebuah lsuv yang merknya ada di pasaran indonesia yaitu baojun 530 suvya seperti yang kita tahu baojun adalah saudara seinduk dari wuling yang tergabung daam saic-gm-wuling alias sgmw bahkan produk baojun juga akan segera masuk ke indonesia dan di rebadge menjadi wuling yaitu baojun 730 yang akan menjadi wuling cortez dan kali ini baojun 530 suv diperkenalkan di china sebuah suv yang akan diposisikan diatas baojun 510 yang sudah terlebih dahulu hadir kami mengatakan di judul bahwa mobil ini cocok untuk indonesia dan hal ini ada alasannya yuk sambil kita kupas mobil inipertama tren suv yang enjamur secara global juga menghinggapi indonesia dan jelas baojun 530 suv bisa mengambil peluang tersebut kedua secara dimensi baojun 530 suv memiliki panjang 4655 mm lebar 1835 mm dan tinggi 1760 mm dengan jarak sumbu roda 2750 mm secara dimensi mobil ini berada di angka yang cocok untuk pasar lsuv di indonesia dan ketiga wuling sendiri sudah sukses hadir dengan cap xiaomi-nya mobil di indonesia sehingga tentunya menarik jika nantinya wuling melakukan rebadge mobil ini di tanah airbaojun 530 suv sendiri memang akan melaksanakan debutnya di depan publik china pada ghuangzhou auto show 2017 pada bulan november ini sedangkan untuk penjualan suv ini baru akan dipasarkan di china pada awal tahun 2018 mendatang lalu apa saja yang dimiliki baojun 530 suv pertama untuk mesin baojun 530 suv mengandalkan mesin 1800cc dengan tenaga maksimal 135 hp dan unit mesin turbo berkubikas 1500cc yang memiliki tenaga maksimal 150 hp mesinnya mirip dengan wuling cortez aka baojun 730 ya lalu secara desain baojun 530 suv tampil meyakinkan dengan gaya desainnyasepasang lampu sipit yang sepertinya adalah drl atau lampu senja menemani lampu utama yang kecil namun menggunakan proyektor di bumpernya dan diikuti foglamp kotak di sisi bawahnya logo baojun yang besar juga sesuai dengan grille-nya yang besar dari samping perawakan mobil ini cukup oke dengan kaki  kaki yang keka dan tarikan garis jendela yang tegas dan dilengkapi pula dengan roof rail sisi belakangnya mengingatkan kita pada suv  suv dari audi namun terlihat lumayan untuk sebuah suv asal china secara umum sisi belakangnya menarik untuk dilihat termasuk dua lubang knalpot di sisi bawah meskipun entah hanya hiasan atau sungguhanuntuk fitur sendiri belum ada informasi yang lebih lengkap namun mobil berharga 90000 yuan atau setara 184 jutaan rupiah ini sendiri nampaknya membawa fitur yang lumayan bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'baojun 530 suv  lsuv 180 jutaan yang cocok untuk indonesia'),
(35, 'lamborghini sudah berkomitmen untuk menjaga mesin naturally aspirated milik aventador dan huracan tetap berpaham naturally aspirated terlepas dari lamborghini urus yang kemungkinan pakai mesin v8 turbo 2 model inti lamborghini ini enggan memakai turbo karena menilai mesin na lebih berkarakter sungguh melegakan di saat pabrikan mobil sekarang terlalu bergantung kepada turbo sebagai solusi instan untuk tenaga ekstrahanya saja kalau sudah dihadapkan kepada sebuah titik tertentu bahkan pabrikan yang keras kepala macam pabrikan italia pun harus mikir-mikir lagi kalau mau produknya bertahan soal huracan misalnya di mana stefano domenicali selaku ceo lamborghini sudah mengatakan bahwa suksesor huracan akan diperkuat dengan teknologi hybrid yah setidaknya ia tidak bilang kalau huracan pakai turbo jadi basic mesinnya bisa saja nahuracan yang berikutnya  mobil itu akan butuh perubahan ke sistem hybrid teknologi hybrid adalah jawabannya bukan konversi menjadi bertenaga listrik penuh katanya ini mirip dengan apa yang pernah disampaikan ferrari di mana intinya adalahhybrid sih oke tapi full elektrik sih tidak entah kebetulan atau tidak dua rival italia ini juga sama-sama percaya untuk meninggalkan transmisi manual biasa sepenuhnya bah bisa sehati juga biarpun foundernya bermusuhanmenarik untuk melihat mesin apa yang bakal dipakai lamborghini untuk menjadi sumber tenaga huracan hybrid nantinya kalau pun mereka tidak pakai mesin baru kami tidak masalah dengan mesin yang dipakai huracan sekarang bagaimana tidak mesin 5200 cc v10 bertenaga 600 hp lebih ini kencang dan punya simfoni suara yang merdu bahkan huracan dan audi r8 adalah supercar terakhir yang bermesin v10generasi penerus lamborghini huracan akan dimunculkan pada tahun 2022 itu adalah rentang waktu yang lama dan sepertinya sudah cukup memberikan waktu bagi lamborghini untuk mengembangkan jenis baterai dan motor listrik apa yang mau dipakai termasuk caranya mengatur supaya huracan bisa berjalan pakai tenaga listrik saja atau tidak apa opinimu sampaikan di kolom komentar', 'suksesor lamborghini huracan bakal usung sistem hybrid'),
(36, 'memiliki suv seperti patrol dan pathfinder nissan sebenarnya tidak punya pemain yang benar-benar head to head 100 dengan suv ladder frame yang jadi pilihan okb di indonesia macam toyota fortuner atau mitsubishi pajero sport benarkah salah sebab mereka punya ada mobil bernama nissan xterra dan nama itu sendiri sudah lumayan lama wara-wiri berbasis nissan navara ia pakai sasis ladder frame macam fortuner dan pajero sportnah bocoran gambar dari headlightmag ini akan menunjukkan bagaimana sosok nissan xterra baru akan tampil mobil yang juga bernama nissan paladin ini rupanya segera mendapat generasi baru dan tentu saja basisnya adalah double cabin nissan navara np300 rencananya nissan xterra 2018 akan muncul di china duluan barulah setelah itu lanjut melakukan debut lagi di thailand pada tahun 2018lampu depan nissan xterra lebih berlekuk dibanding navara demikian pula v-motion grille ala nissan yang batang chrome-nya lebih tegas bumper xterra beda dengan navara sekilas malah terlihat lebih konservatif sisanya beberapa parts lain seperti kap mesin pintu depan dan spion besarnya masih navara banget sama seperti fortuner dan pajero sport ia didesain untuk muat 7 penumpangpintu belakang nissan xterra diklaim akan lebih besar dari navara supaya akses keluar masuknya gampang terlepas soal jangkungnya mobil ini yang bakal merepotkan bagi orang berpostur cebol secara kelas jelas ia akan duduk lebih tinggi dibandingkan nissan x-trail tapi entah mesin apa yang diusung nissan xterra baru ada yang bilang akan tersedia pilihan mesin bensin yang mungkin tak spesial di kelas ini sebab rata-rata pemain kelas ini bermesin dieselnah kalau mau yang diesel ada probabilitas bagi nissan xterra untuk memasang mesin 2300 cc 4 silinder turbo diesel dengan tenaga 190 hp dan torsi 450 nm jelas itu lebih besar daripada milik fortuner dan pajero sport dari segi kemampuan namun mepet dengan hyundai santa fe crdi urusan penggerak bakal tersedia versi rwd dan 4wd bagaimana menurutmu sekilas si nissan xterra ini cocok tidak melawan fortuner dan pajero sport sampaikan di kolom komentar', 'nissan xterra bocor calon rival fortuner dan pajero sport'),
(37, 'sudah lama kita tak membahas produk  produk dari negeri tirai bambu ya kesibukan dari ajang tokyo motor show 2017 memang sangat sayang untuk dilewatkan namun kali ini sebuah berita menarik kembali hadir dari dataran china dimana sosok paling tak disukai oleh jaguar land rover yaitu landwind x7 hadir versi facelift-nyaya mobil yang sempat menggemparkan jagad otomotif global karena menjiplak mentah range rover evoque ini sendiri baru  baru ini mendapatkan penyegaran dan kali ini landwind x7 hadir dengan beberapa ubahan yang minor dan hanya menyentuh aspek eksterior saja namun walaupun ada beberapa detail yang berubah pada mobil ini nyatanya secara utuh mobil ini masih saja mirip dengan range rover evoque aliansi jaguar land rover sendiri sudah kapok dan tak mau memperpanjang kekesalan mereka atas mobil ini dengan menyembunyikan model  model konsep merekaoke mari kita lihat lebih lanjut ke landwind x7 ini pertama dan yang palingkentara ubahan dari mobil ini adalah pada sisi depan dan belakang mobil ini sisi depan mobil ini memperlihatkan bahwa kini lampu depan dari landwind x7 sudah berubah modelnya tak drastis ada led drl sejumlah 8 buah led di sana dan penempatan lampu dalam housing yang baru kedua masih dari sisi depan kini bumper dari landwind x7 berubah dengan tarikan garis yang kaku dan dilengkapi dengan aksen silver yang memanjang grille mobil ini juga turut berubah jika sebelumnya hanya ada satu bilah krom maka sekarang krom-nya berkembang biak menjadi duaselanjutnya bergeser ke sisi belakang mobil ini ternyata mengubah sisi belakangnya walaupun sekali lagi tak drastis kali ini jika dilihat  lihat model belakang dari landwind x7 terbaru menjadi mirip dengan model belakang dari mercedes-benz glc coupe lampu belakangnya kini memiliki tambahan di bagasi dan disambungkan dengan lis krom dari sisi kiri ke kanan dan seperti di sisi depan sisi bumper belakang mobil ini juga turut disegarkan dan diberikan aksen silver yang memanjang dan juga dua lubang knalpot di sisi bawahnyauntuk urusan mesin landwind x7 facelift masuh mengandalkan unit mesin 1500cc turbo yang memiliki tenaga maksimal 160 dk dan torsi maksimal di angka 250 nm mesin tersebut disandingkan dengan transmisi otomatis dengan delapan percepatan bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'landwind x7 facelift hadir dengan tampilan yang sedikit berbeda'),
(38, 'dalam dunia modifikasi mobil mengganti mesin bukanlah hal yang tabu kala performa terbaik adalah target utama untuk modifikasi harian kita sering menemui banyaknya lancer biasa dimodif menjadi lancer evolution komplit dengan penggantian mesin jadi 4g63t eks evo asli di dunia manufaktur tak jarang produsen mobil meminjam mesin mobil lain untuk jadi jantung mobil buatannyacontohnya adalah caterham bac dan zenos yang pakai mesin buatan ford lotus yang pakai mesin toyota dan ariel yang pakai mesin honda soal yang terakhir honda belum lama bilang kalau mereka akan menjual mesin milik honda civic type r fk8 secara terpisah kalau ada yang minat mesin 2000 cc 4 silinder vtec turbo berkode k20c1 ini dijual seharga 6520 dollar as atau sekitar 88 juta rupiah itu di luar biaya pengiriman lho yamesin ini punya tenaga 306 hp dan torsi 400 nm honda bilang mesin ini pas untuk pembalap pemula yang perlu mesin bertenaga untuk dipakai balapan karena banyak juga yang modif honda dengan cara mengganti mesinnya dengan meisn b-series f-series dan k-series masuk akal juga honda mengambil langkah iniselain pengumuman penjualan mesin honda mengungkapkan rencana untuk merilis baja ridgeline concept truck dirancang khusus untuk merayakan ulang tahun ke-50 dari ajang baja 1000 truk ini memiliki mesin honda performance development hpd hr35tt berspek 3500 cc v6 twin turbo corak warna metal merah spesial truk ini akan bersaing di baja 1000 akhir tahun ini dan dikomandoi oleh johnny campbellnah jadi buat pemilik civic turbo hatchback yang mau convert mobilnya ke honda civic type r maukah anda memasang mesin ini ke civic anda tapi memang sih sebagus-bagusnya hasil modifikasi bengkel belum tentu sebagus buatan pabrikan alternatif lain jika ingin membangun sebuah sleeper mesin ini bisa jadi pilihan bayangkan jika mesin 300 hp ini dipasang ke mazda mr90 misalnya seru pasti apa opinimu sampaikan di kolom komentar', 'mau beli mesin honda civic type r 88 jutaan saja'),
(39, 'seperti yang kita tahu aston martin telah berkembang menjadi salah satu pabrikan mobil terpandang di dunia apalagi sejak mobil dari pabrikan inggris ini mejeng di film  film james bond dan salah satu produk yang terkenal dari pabrikan ini adalah seri aston martin vanquish yang kini merupakan generasi yang kedua yang dipasarkan secara globalnamun nampaknya generasi ini telah terlihat uzur di mata pabrikan ini karena sudah diproduksi sejak 5 tahun lalu alias sejak 2012 dan kali ini pihak aston martin mengumumkan bahwa umur dari aston martin vanquish generasi ini akan segera berakhir untuk menandai veri pamungkas dari coupe dua pintu ini maka pihak pabrikan pun merilis aston martin vanquish s ultimate secara terbatas edisi final alias edisi pamungkas dari aston martin vanquish ini sendiri jumlahnya tak banyak terbatas hanya untuk 175 orang yang beruntung bisa meminangnyadan yang menarik pada seri aston martin vanquish s ultimate ini seperti layaknya mobil  mobil dengan banderol mahal mobil ini bisa dikustomisasi sedemikian rupa pembeli bisa memilih untuk membeli aston martin vanquish s ultimate dalam rupa coupe biasa ataupun dalam versi volante alias roadster selain itu ada tiga pilihan warna eksterior yang bisa dipilih dan dipadukan dengan beberapa paket trim interior dan dari gambar yang kami lampirkan model yang tertera menggunakan warna ultimate black yang dipadukan dengan beberapa aksen berwarna copper bronzeaksen  aksen yang dilabur warna tersebut adalah pada front air intake side sills dan pada rear diffuser dan selain adanya aksen  aksen dengan warna copper bronze hadir pula beberapa bagian yang menggunakan bahan karbon wajar kan mobil kentjang dan jika kalian kurang suka dengan perpaduan warna ini maka ada pilihan lain yaitu versi berwarna xenon gray yang dipadukan dengan aksen cobalt blue variasi warna ini terlihat lebih menyala berkat penggunaan kaliper rem berwarna kuning dengan velg berwarna hitam 5-spokes dan interior yang dilabur dengan warna kuning sebagai aksen serta jok berwarna phantom grey yang berbahan kulit dan diberi jahitan berwarna birudan jika keduanya masih belum memuaskan kalian maka ada pilihan lain yang dilabur warna putih dengan grafis berwarna bronze dan interiornya dibalut bahan kulit berwarna chestnut tan dan beberapa aksen berwarna hitam obsidian kabar baiknya jika paket  paket tersebut terasa kurang match untuk konsumen maka sang konsumen bisa memilih perpaduannya satu sama lain dengan bebas sedang untuk mesin aston martin vanquish s ultimate akan mengandalkan unit mesin 6000cc v12 naturally aspirated yang memiliki ledakan tenaga 595 hp transmisi delapan percepatan touchtronic iii dipadukan dengan mesin tersebut di mobil inaston martin vanquish s ultimate sendiri akan dijual mulai harga 211995 poundsterling atau jika dirupiahkan menjadi 38 miliar rupiah untuk versi beratap keras dan banderol 223995 poundsterling alias 4 miliar lebih sedikit untuk versi volante bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'aston martin vanquish s ultimate  versi pamungkas cuma 175 unit'),
(40, 'bmw kembali mengeluarkan sebuah edisi khusus untuk mobilnya dan seperti sebelum sebelumnya edisi khusus ini adalah penanda dari sebuah event khusus yaitu peringatan 30 tahun dari bmw m3 di amerika serikat lho bukannya edisi ini pernah dijual tahun lalu tenang pihak bmw nggak lupa kok jika edisi tahun lalu itu memperingati usia bmw m3 yang menginjak 30 tahun secara global edisi ini memperingati 30 tahun usia bmw m3 di dataran amerika serikatmobil ini sendiri saat ini belum dijual secara bebas karena unit display dari mobil ini sendiri baru akan diperkenalkan di sema show 2017 yang akan dilangsungkan di las vegas amerika serikat lalu setelah itu baru bmw m3 edisi khusus ini akan dilepas ke pasar lalu berapa jumlahnya kan edisi khusus pasti akan terbatas perkara jumlah pihak bmw belum memberikan informasi rincinya namun jika melihat bmw m3 edisi 30 tahun global tahun lalu yang berjumlah 150 buah mungkin tak akan terlalu jauh beda jumlahnya dibandingkan dengan versi inioke kita bahas lebih lanjut mengenai mobil ini apa saja yang berbeda ya ada beberapa komponen yang berubah di edisi khusus ini mobil ini sendiri dikembangkan oleh bmw group designwork dari basis bmw m3 competition package yang memiliki tenaga maksimal di angka 450 dk alias 19 dk lebih kencang dari bmw m3 biasa tenaga tersebut didapatkan dari mesin twin turbo berkubikasi 3000cc dengan konfigurasi enam silinder segaris sayangnya mobil ini tak menggunakan transmisi dct melainkan dengan transmisi manual enam percepatan lho bukannya makin asyik untuk petrolhead iya memang namun dari catatan waktu versi manual mobil ini mencatatkan 0-100kmjam dalam waktu 4 detik namun versi dct bisa mencapai 38 detiklanjut bmw m3 edisi khusus ini juga mendapatkan warna khusus yaitu warna frozen red ii metallic yang dipadukan dengan velg berwarna emas mirip apa iron man selain itu atap dari mobil ini juga khusus karena dibuat dari bahan cfrp alias carbon fibre reinforced plastic yang akan ditenami dengan sayap belakang berbahan carbon fibre dan knalpot berbahan ringan produksi m performance yang menggunakan silencer berbahan titanium tentunya dengan sejumlah ubahan ini suspensi mobil ini pun diubah ke suspensi m performancemasuk ke sisi dalam disinilah ubahan yang juga paling berasa karena interiornya kini menggabungkan warna putih merah dan juga biru di dalamnya jadi ingat apa captain america atau versi livery motor sayap mengepak sebenarnya motif ini sendiri terinspirasi dari bendera amerika serikat kawan patriotik kan ingat mobil ini edisi khusus di amerika serikat bahan yang digunakan sendiri adalah bahan kulit merino sedangkan untuk bagia armrest dan gear lever menggunakan bahan alcantara ada beberapa emboss 30th anniversary juga di interiornyatentunya mobil ini menjadi cukup ikonik dengan beberapa perubahan ini dan nantinya juga bisa jadi menjadi bahan koleksi para kolektor di usa sana bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'bmw m3 edisi 30 tahun di amerika terlihat patriotik'),
(41, 'masih ada beberapa mobil konsep lain yang menarik dari gelaran tokyo motor show 2017 dan salah satunya adalah produk dari mazda kemarin kami sudah sempat mengangkat mazda kai concept yang diperkirakan akan meneruskan sepak terjang dari mazda 3 di masa depan kini kita akan bahas mengenai mazda vision coupe sebuah sedan sport coupe dengan 4 pintuya mobil  mobil konsep dari pabrikan yang disebut  sebut sebagai bmw-nya jepang ini memang sangat memanjakan mata para penggemarnya selain mazda kai concept yang cakep mazda vision coupe concept juga tak kalah cakep mengambil bentuk sebagai sebuah sedan coupe mazda vision coupe concept sukses hadir dengan tampilan yang stylish untuk sebuah sedan empat pintu ya empat pintu ya bukan dua muka depan dari mazda vision coupe concept ini terlihat keren dengan kap mesin panjang grille ala kodo style yang berukuran besar dengan lampu sipit khas mazdaselain itu laburan warna abu  abu di mazda vision coupe concept ini juga menambah kesan agresif yang justru mengingatkan kita pada mobil  mobil lansiran aston martin bicara mengenai kap mesinnya yang panjang sejauh ini tak ada informasi mengenai mesin yang diusung di bawah kap mesinnya namun dengan proporsi seperti itu nampaknya mazda vision coupe concept menjanjikan peforma yang mumpuni kami menebaknya bukan sekedar karena melihat proporsi dimensinya namun juga melihat kaki  kaki mobil ini yang diberikan velg besar dengan rem cakram lansiran brembo peformanceselain itu sisi belakang dari mobil ini juga tak kalah menarik karena ada empat buah lubang knalpot detail  detail lain menggabungkan aura sporty dan elegan seperti atap kaca panoramic handle pintu yang tersembunyi dan juga beberapa aksen metalik di sekujur mobil ini masuk ke sisi dalam mazda vision coupe concept mendapatkan sejumlah balutan bahan kulit dan trim kayu yang elegan dan nampaknya nyaman di pegang dan masih sama dengan mazda kai concept kabin dan dashboard mobil ini masih minimalis which is good layar  layar di mobil ini diposisikan secara horisontal di dashboard-nyamazda vision coupe concept juga dikatakan oleh pihak pabrikan sebagai salah satu produk yang akan mendefinisikan next generation dari desain  desain mobil mazda menarik ya tentu kita tunggu saja perkembangan informasinya kawan bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'tokyo motor show 2017  mazda vision coupe concept sport sedan yang sexy'),
(42, 'masih dari gelaran tokyo motor show 2017 nissan tak hanya hadir dengan jajaran mobil  mobil nismo mereka di gelaran ini namun juga dengan beberapa mobil konsep mereka dan salah satu mobil konsep yang menarik untuk dibahas adalah nissan imx conceptnissan imx concept menarik untuk dibahas karena mobil ini mengusung beberapa fitur kekinian yang memang sedang hot di dunia otomotif pertama mobil ini adalah mobil elektrik murni dan yang kedua mobil ini sudah dilengkapi dengan sistem autonomous driving secara full dan mobil ini sendiri juga baru pertama kali hadir di tokyo motor show 2017 ini ingat kan kalau teaser-nya sempat kami informasikan sebelumnya nissan imx concept hadir dengan beberapa konsep menarik seperti kabin lega center of gravity yang rendah dan juga handling yang tajam menurut nissanmobil ini dipersenjatai dengan dua motor listrik dimana satu motor listrik akan menggerakkan roda belakang dan satu lagi akan menggerakkan roda depan jadi secara kasar mobil ini menggunakan sistem gerak empat roda dengan satu motor listrik untuk tiap dua roda dan motor listrik ini memiliki tenaga yang menarik karena jika ditotal memiliki tenaga 429 hp dan torsi badak 700 nm kapasitas baterai dari mobil ini pun juga sudah cukup mumpuni untuk saat ini dengan jarak tempuh mencapai 600 km untuk sekali pengisian daya jauh lebih jauh daripada nissan leaf yang dijual saat iniselanjutnya nissan imx concept juga akan mengusung sistem nissan propilot terbaru yang mendukung full-autonomous driving yang artinya jika pengemudi mengaktifkan sistem ini maka setri yang awalnya dikendalikan oleh pengemudi akan masuk ke dashboard dan kursi akan diposisikan menjadi rileks dan pengemudi bisa santai sembari menikmati disetirkan oleh sistem komputer dan jika mode ini dinon-aktifkan maka setir akan muncul kembali dan kursi akan diposisikan ke posisi awal ada dua konsep yang menginspirasi nissan imx concept ini yaitu ma yang dalam bahasa jepang menunjukkan sense of space  time lalu wa yang menunjukkan harmony lihat saja desain mobil ini yang simpel dan juga minimalis dengan visibilitas yang luasjadi ini adalah salah satu mobil konsep dari nissan yang sangat menarik dan tentunya realisasi dari nissan imx concept ini akan bisa menjadi pilihan yang layak dipertimbangkan di masa depan bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'tokyo motor show 2017  nissan imx concept mobil fully-autonomous nissan'),
(43, 'setiap kali ada gelaran besar seperti tokyo motor show senang rasanya karena pasti akan selalu ada model  model konsep terbaru yang akan menjadi purwarupa produk masa depan dari sebuah mobil dan salah satu pabrikan yang handal dalam membuat versi konsep adalah mazda dan kali ini mazda membawa sebuah model konsep terbaru mereka mazda kai conceptsecara tampilan terlihat bahwa mazda kai concept akan menjadi sebuah hatchback di masa depan dan dari proporsi dimensinya mazda kai concept akan menjadi penerus dari mazda 3 yang ada saat ini mobil ini sendiri dikabarkan akan diproduksi massal menjadi mazda 3 pada tahun 2019 mendatang kalau menurut kalian apa yang kalian suka dari sebuah mazda kai concept kalau kami jelas pada eksteriornya yang terlihat cantik masih mengandalkan gaya kodo design sisi manapun dari mazda kai concept ini memancarkan aura yang sporty yang memang harus hadir di segmen initarikan  tarikan garis yang tegas dan dinamis ala mazda jaman now juga hadir di mazda kai concept ini dengan kaki  kaki yag kekar dan ground clearance yang rendah mobil ini memang enak dipandang secara dimensi mazda kai concept menjadi lebih panjang daripada mazda 3 generasi sekarang panjang dari mazda kai concept sendiri molor menjadi 50 mm yang artinya ruang di dalam kabin mobil ini akan lebih lega dari pada generasi mazda 3 saat ini pun begitu dengan handling-nya yang diperkirakan lebih baik mobil ini juga akan dibangun menggunakan skyactiv vehicle architecture terbaru dari mazda yang akan menonjolkan beberapa keunggulan barukeunggulan pertama adalah desain yang ditawarkan oleh skyactiv vehicle architecture ini akan lebih nyaman dan juga bisa mengurangi rasa capek dalam berkendara bagaimana caranya kami pun belum tahu keunggulan kedua adalah akan hadirnya konektivitas yang canggih antara pengguna dan mobil di dalam mazda kai concept ini untuk urusan mesin jelas mobil ini akan mengadopsi skyactiv-x yang memiliki inovasi terbaru yaitu spark controlled compression ignition spcci teknologi ini akan lebih efisien 20 hingga 30 persen dibandingkan mesin mazda sebelumnyamasuk ke sisi dalam dari mazda kai concept jelas interiornya akan khas mazda yang terlihat simpel dan sangat driver oriented dashboard mobil ini sangat sederhana which is good karena memperlihatkan kedewasaan desain dari mazda perpaduan warna gelap pada interiornya dengan warna merah serta aksen silver memberikan kesan yang cantik dan sporty sesuai dengan desain eksteriornya mobil ini sendiri akan berhadapan dengan vw golf dan honda civic di masa depan dan jelas kedua rivalnya ini harus bersiap akan kehadiran mobil cantik ini bagaimana menurut kalian', 'tokyo motor show 2017  mazda kai concept mazda 3 di masa depan'),
(44, 'sesuai dengan beberapa bocoran yang muncul di awal bulan ini bahwa akan ada beberapa produk nissan yang akan diberikan sentuhan oleh nismo produk  produk tersebut kemudian muncul di tokyo motor show 2017 dan masih mengabarkan dari jepang inilah nissan leaf terbaru yang kini diberikan tampilan ala nismo mobil ini sendiri masih sebatas konsep kawan jadi belum akan dijual untuk saat ini namun sebenarnya konsep nismo pada sebuah mobil ramah lingkungan seperti nissan leaf terbaru ini bukanlah yang pertama kali karena beberapa tahun lalu atau tepatnya pada 2011 lalu mobil yang sama juga sempat mendapatkan sentuhan ala nismo pula namun berbeda dengan model yang ada saat ini nissan kala itu nampaknya masih belum bisa mendandani nissan leaf nismo dengan keren karena nissan leaf nismo waktu itu cukup jauh dari kesan mobil yang sportynamun waktu sudah berganti kini nissan leaf terbaru yang sudah punya tampang yang cukup keren akan lebih mudah di dandani ala nismo dan voila inilah hasilnya nissan leaf nismo ini hadir pertama kali di ajang tms ini dan mungkin hanya satu kata yang bisa menggambarkan penampakan dari nissan leaf nismo aggresif ya gaya agresif ini bisa diwujudkan pada nissan leaf nismo berkat permainan warna dan komponen yang dilekatkan pada nissan leaf nismo bumper depan dan belakang serta side skirt terlihat sporty permainan warna merah hitam yang dipadukan pada warna putih mobil ini pun terasa cocokselain itu diffuser yang besar yang diberi aksen merah serta velg besar dari nismo dan atap berlabur warna hitam dengan shark fin antenna juga terlihat pas pada mobl ini seakan  akan kami tak sedang melihat sebuah mobil ev ya walaupun begitu secara mesin listrik yang diusung tak ada perbedaan namun ada perbedaan di sisi software yang disebut spesial perangkat lunak di mobil ini telah diutak atik lebih dalam sehingga bisa memberikan akselerasi instan pada setiap tingkat kecepatan selain itu suspensi pada mobil ini juga diganti menjadi versi sport suspension yang juga didukung oleh setir baru yang lebih sportydengan sejumlah penggantian tersebut nampaknya mobil ini akan menjadi nissan leaf paling kencang sejauh ini dan rasa  rasanya juga menjadi nissan leaf yang paling fun untuk dikendarai belum ada kabar pasti kapan mobil ini akan menyapa pasar namun dengan sejumlah tawaran tentu menarik menantikan kehadirannya bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'tokyo motor show 2017  nissan leaf nismo concept makin sporty');
INSERT INTO `artikel` (`id_artikel`, `isi_artikel`, `judul_artikel`) VALUES
(45, 'beberapa waktu lalu kalian sudah melihat foto  foto dari mobil ini yang kami sampaikan ya waktu itu gambaran secara resmi dari toyota gr hv sports memang sudah diunggah ke publik namun masih belum ada pengumuman mengenai detail dari kendaraan ini oleh karena itu mari kita ulas mobil ini check this outyang pertama kalian pikirkan mengenai toyota gr hv sports ini apa mobil batman hahaha ya penampilan dari mobil konsep ini memang agak nyeleneh untuk sebuah toyota namun pada dasarnya kita sudah bisa menebak bahwa mobil ini mengambil basis dari sebuah toyota 86 hal ini terlihat dari perawakanya namun lampu depan dan belakang dari toyota gr hv sports tak menyiratkan bentuk sebuah toyota 86 apalagi atapnya yang menganut model atap targa namun ada sebuah latar belakang menark dari toyota gr hv sports dimana ada teknologi dari seri balap yang diterapkan disiniya mesin yang dibawa oleh toyota gr hv sports adalah mesin hybrid namun mesin hybrid ini bukan mesin sembarangan karena mesin yang diberi nama ths-r alias toyota hybrid system-racing ini adalah mesin yang sama yang digunakan oleh toyota ts050 hybrid yang berlaga di ajang balap le mans wow sebuah kenyataan yang menarik bukan mesin dari mobil balap yang ukurannya besar itu dimasukkan ke dalam toyota gr hv sports namun perkara kubikasi dan spesifikasi mesin lainnya belum dibeberkan oleh pihak toyota yang jelas pasti disesuaikan dan lebih kecilselain perkara mesinnya perkara transmisi juga jadi hal yang menarik dari toyota gr hv sports ini dimana transmisi yang tertanam dalam toyota gr hv sports ini cukup unik transmisi yang dipasangkan di mobil ini adalah transmisi enam percepatan otomatis yang dipasangkan dengan h-pattern gear selector berkat kombinasi ini transmisi yang aslinya adalah transmisi otomatis bisa dioperasikan dengan cara yang sama seperti mengoperasikan transmisi manual yaitu ganti gigi menggunakan gear lever tapi tanpa pedal kopling baterai dari mobil ini pun diletakkan di posisi yang strategis yaitu di belakang kursi pengemudi sehingga center of gravity mobil ini bisa baguslalu mungkin ada yang bertanya kenapa lampu depan dari toyota gr hv sports kok gitu banget jawabannya sederhana model lampu led yang besar ini terinspirasi dari mobil yang mendonorkan mesinnya ke toyota gr hv sports yaitu ts050 selain lampu inspirasi dari ts050 juga mempengaruhi bentuk dari fender yang lebar dan juga model sisi belakangnya dan di sisi dalam transmisi dari toyota gr hv sports diletakkan di dashboard dengan model tombol sedangkan jika ingin mengaktifkan mode manual maka ada tombol di shift knob yang bisa dinyalakan mungkin toyota ingin menunjukkan bahwa seperti inilah mobil sport mereka di masa depan dua pedal namun oper gigi masih rasa manualbagaimana menurut kalian toyota gr hv sports ini menarik-kah yuk sampaikan pendapat kalian kawan', 'tokyo motor show 2017  toyota gr hv sports 86 hybrid dengan atap targa'),
(46, 'masih melaporkan dari gelaran tokyo motor show 2017 kita sekarang akan bergeser ke salah satu booth pabrikan yang anti-mainstream yaitu subaru subaru di gelaran ini juga membawa model konsep terbaru yang mereka miliki yang tak kalah dari booth  booth disebelahnya mereka membawa subaru viziv performance conceptya mobil ini adalah lanjutan dari seri  seri subaru viziv yang pernah diperkenalkan oleh subaru di kesempatan  kesempatan sebelumnya subaru viziv performance concept sendiri mendapatkan tajuk sebagai the next generation sports sedan hmmm kok mirip merk sebelah ya pakai next-generation segala namun nampaknya memang hal ini pantas disandang oleh subaru viziv performance concept karena penampilannya yang nampak seperti sebuah subaru wrx dari masa depanyuk kita lihat sisi per sisi dari subaru viziv performance concept ini dari sisi depan kita melihat bahwa mobil ini memiliki bumper depan yang sporty yang dilengkapi beberapa pemanis yang terbuat dari bahan carbon fiber selain itu masih dari sisi depan kap mesin dari subaru viziv performance concept ini juga diberikan ram air hood yang membuatnya sekilas nampak berotot lampu utama dari subaru viziv performance concept juga jelas futuristis dengan garis lampu led yang tegasberlanjut ke bagian lainnya kita bisa lihat bahwa fender darsubaru viziv performance concept memiliki ventilasi di sisi samping dengan bahan carbon fiber subaru viziv performance concept juga mendapatkan velg 20 inci yang terlihat garag dengan laburan warna gelap bergeser ke sisi belakang sebuah diffuser yang agresif dan juga empat lubang knalpot dipasangkan yang membuat subaru viziv performance concept juga terlihat garang dari sisi belakang tak lupa aura futuristis juga hadir dari lamp belakang led yang memanjang dari kiri ke kanan atap dari subaru viziv performance concept dilabur warna hitam yang terlihat cocok secara keseluruhansubaru viziv performance concept memiliki imensi yang lumayan panjang dengan panjang totoal 46 meter lebar 19 meter dan juga tinggi 14 meter belum ada spesifikasi teknis tentang subaru viziv performance concept namun pabrikan ini memberikan informasi bahwa mobil ini akan menggunakan mesin boxer yang bepeforma tinggi yang dilengkali dengan symmetrical awd beberapa sistem canggih yang sedang dan sudah dikembangkan oleh subaru juga turut diberikan di movil ini seperti sistem navigasi yang akurat eyesight system dan advance driver-assistance system yang baru akan diperkenalkan di 2020jadi subaru viziv performance concept ini nampaknya sudah cukup memberikan gambaran kepada kita bagaimana sebuah subaru wrx di masa depan bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'tokyo motor show 2017  subaru viziv performance concept sebuah wrx futuristis'),
(47, 'seri f dari lexus selama ini telah menjadi salah satu nilai jual yang menjanjikan khususnya bagi mereka yang menyukai peforma yang tinggi dari sebuah mobil ya seri f dari lexus sendiri adalah seri kencang dari produk  produk lexus dan seri f sendiri dimulai sejak seri lexus is f yang diluncurkan pada detroit motor show 2007 silamsepuluh tahun sudah lexus memiliki dan mengembangkan seri f pada produk  produknya dan di tahun yang kesepuluh ini lexus memberikan edisi khusus untuk jajaran produk seri f mereka melalui lexus rc f dan lexus gs f kedua produk kencang dari lexus ini sendiri dibekali dengan paket peforma yang isinya adalah sepaket suspensi sport khusus yang akan menghasilkan handling yang lebih baik dan juga muffler berbahan titanium yang memiliki bobot yang ringanselain itu lexus rc f dan lexus gs f juga mendapatkan beberapa bagian yang menggunakan bahan carbon fiber reinforced plastic yang dilabur dengan warna matte grey dan untuk memperkental aura sporty dari lexus rc f maka mobil ini diberikan beberapa bagian yang berbahan karbon seperti pada atapnya pada kap mesin front splitter side dkirt bumper belakang dan juga pada rear diffuser penambahan beberapa komponen karbon ini kami anggap sukses membuat tampilan dari lexus rc f edisi khusus ini menjadi lebih agresif dibandingkan dengan versi standar dari lexus rc fselain bahan  bahan karbon eksterior dari mobil ini sendiri juga dipermanis dengan velg yang berwarna hitam dan juga kaliper rem yang berwarna biru nyolok mata juga ya oke masuk ke sisi dalam mobil  mobil edisi khusus ini akan dilengkapi dengan balutan jok kulit berwarna biru yang juga membalut lingkar kemudinya selain itu pada tuas persneling dan juga konsol tengah juga mendapatkan lapisan kulit dengan warna yang senada warna biru dari bahan kulit ini sendiri juga terasa cocok dengan beberapa jahitan berwarna biru dan juga beberapa bahan carbon fiber yang berwarna sama pulalexus rc f dan lexus gs f sendiri belum akan dijual pada waktu dekat ini walaupun sudah diumumkan kemunculannya lexus rc f dan lexus gs f akan menyapa pasar jepang pada tahun 2018 mendatang tepatnya pada musim semi tahun depan tentunya kehadiran edisi khusus lexus rc f dan lexus gs f ini sendiri akan menjadi incaran para kolektor bagaimana menurut kalian yuk sampaikan pendapat kalian', 'edisi khusus lexus rc f dan gs f peringati 10 tahun sudah seri f lexus'),
(48, 'kalian masih ingat beberapa waktu yang lalu kami sempat mengangkat sebuah informasi bahwa porsche telah meluncurkan program berlangganan ya porsche telah membuka peluang untuk kalian yang belum cukup tabungannya untuk menebus sebuah unit mobil porsche namun sangat ingin menggunakan unitnya mudah saja tinggal langganansebenarnya kepemilikan dengan sistem berlangganan ini sendiri bukanlah hal yang baru kita sudah banyak melihat praktek serupa di beberapa bidang usaha lain seperti berlangganan netflix lalu berlangganan di spotify dan masih banyak lagi lainnya dan program berlangganan untuk mobil sebenarnya menjadi salah satu hal yang menarik walaupun pada dasarnya memiliki sebuah mobil itu lebih afdol dibandingkan hanya berlangganan yang bisa dikatakan hanya menyewa saja namun hal inilah yang berkembang di masyarakat jaman nowdan nampaknya pabrikan lain selain porsche juga tak diam saja melihat pabrikan macam porsche menerapkan program seperti ini dan di sela  sela tokyo motor show 2017 yang sedang berlangsung salah satu kru redaksi kami yaitu ridwan hanif yang juga adalah sultan menyempatkan untuk bertanya kepada salah satu petinggi dari toyota motor corporation didier leroy yang kala itu juga hadir dan memberikan sesi tanya jawab kepada awak media di gelaran tokyo motor show 2017menurut mr leroy pihak toyota saat masih fokus dengan pos  pos bisnis yang sedang dijalankan saat ini dan tak bisa melaksanakan semua kemungkinan yang ada bersamaan seperti contohnya masalah program berlangganan mobil pihaknya memilih untuk memaksimalkan peluang bisnis yang sedang dijalankan namun bukan berarti pihak toyota menutup peluang untuk melirik program berlangganan mobil mr leroy meyakinkan para awak media bahwa hal tersebut akan dipertimbangkan dan jika memang memiliki peluang bisnis yang bagus dan meyakinkan maka bisa saja toyota melaksanakan program serupatentunya menarik jika kedepannya pabrikan jepang seperti toyota pun mencoba melaksanakan program seperti ini contohnya berlangganan alphard crown century atau malah berlangganan hiace mungkin agak sedikit aneh tapi menarik bagaimana menurut kalian yuk sampaikan pendapat kalian', 'tokyo motor show 2017  jika menjanjikan toyota tertarik dengan sistem langganan mobil'),
(49, 'seperti yang kita tahu gelaran macam tokyo motor show memang selalu menyajikan mobil  mobil konsep terbaru kita sudah membahas mobil  mobil konsep pada hari ini seperti honda sport ev concept mitsubishi e-evolution concept dan toyota crown concept dan kali ini kita akan membahas langsung tiga kendaraan konsep dari toyota yang tergabung dalam toyota concept-iya ada tiga buah kendaraan dalam jajaran toyota concept-i pertama ada toyota concept-i sendiri lalu toyota concept-i ride dan toyota concept-i walk dalam seri toyota concept-i ada beberapa hal yang ditawarkan oleh toyota yaitu learn protect dan inspire tiga hal ini adalah nilai utama dan nilai jual yang diberikan oleh pihak toyota pada ketiga produk ini secara umum untuk fungsi learn akan membuat produk  produk dari toyota concept-i bisa mengerti manusia alias peka dengan respon manusia cocok untuk wanita eh toyota concept-i akan bisa membaca emosi dan mengestimasikan preferensi untuk menanggapi hasil bacaan emosi tersebutlalu fungsi kedua yaitu protect disini akan membuat toyota concept-i bisa menjaga keamanan penggunanya bagaimana caranya toyota concept-i menjaga keamanan penggunanya yaitu dengan memanfaatkan automated driving technology yang disandingkan dengan fungsi learn yang pada tujuan akhirnya bisa mengerti intensi dan kondisi pengguna secara real time yang akan dibandingkan dengan kondisi standar keamanan yang ketiga adalah inspire yang akan dikombinasikan dengan learn dan agent technology yang bisa mengantisipasifeeling dari pengguna dan menawarkan pengalaman pengemudi yang barusemua konsep ini memang sangat teknis dan abstrak susah untuk digambarkan namun terima saja karena semuanya terwujud berkat adanya ai alias artificial intelligent yang akan mengkomputasikan segala hasil sensor dan diolah sehingga menjadi berguna oke mari kita mulai dengan mobilnya saja yang pertama adalah toyota concept-i yang memiliki dimensi panjang 45 meter dengan lebar 18 meter dan tinggi 14 meter toyota concept-i bisa dimuati 4 orang dengan mesin bertenaga listrik murni toyota concept-i sendiri bisa berjalan sejauh 300 km untuk setiap kali pengisian daya penuhberikutnya adalah toyota concept-i ride yang lebih kompak dengan dimensi 25 meter lebar 13 meter dan tinggi 15 meter mobil konsep ini hanya bisa dimuati dua orang dengan jarak tempuh per sekali pengisian daya mencapai 100 hingga 150 km saja dan terakhir adalah toyota concept-i walk yang merupakan moda transportasi paling ringkas dari seri toyota concept-i toyota concept-i walk bisa digunakan di jalanan dengan mudah dengan jarak tempuh mencapai 10 hingga 20 km toyota concept-i walk menggunakan tiga roda dan bisa berjalan secara otomatis untuk memudahkan penggunaannyaproduk  produk konsep dari seri toyota concept-i sendiri memang masih terasa sangat masa depan dan masih terlalu susah untuk diterima masyarakat namun perlahan gambaran seperti toyota concept-i inilah yang nampaknya akan menjadi masa depan kita bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'toyota motor show 2017  toyota concept-i moda transportasi masa depan toyota'),
(50, 'apakah kalian masih ingat dengan honda urban ev concept mobil konsep ini masih terngiang di pikiran kami karena modelnya yang unik dan jujur penggabungan konsep retro dan modern di mobil ini terasa pas yang bisa membangkitkan nostalgia namun masih bertabur dengan nilai futuristis dan tak lama setelah memperkenalkan honda urban ev concept kini di tokyo motor sho 2017 honda kembali memperkenalkan mobil konsep lain yaitu honda sport ev conceptsebenarnya tak banyak yang bisa kita gali dari honda sport ev concept ini karena pihak honda masih belum membeberkan data  data terkait mobil ini secara lengkap namun yang jelas mobil ini masih mengikuti jejak dari saudaranya yaitu honda urban ev concept yang menganut desain retro modern hanya saja jika honda urban ev concept menganut model hatchback maka honda sport ev concept menganut model sedan dengan dua pintu dan dua kursi sajamari kita lihat mobil ini dari sisi per sisi aura yang serupa dengan honda urban ev concept masih hadir di mobil ini dengan lampu depan yang didesan berbentuk bulat dengan dua strip lampu lain di tengah  tengah lingkaran konsep lampu ini bisa jadi saling berbagi pakai dengan saudaranya lalu hal yang unik kedua adalah logo honda di grille depan yang diberikan iluminasi warna putih kebiruan mobil ini sendiri menggunakan kap mesin yang cukup panjang untuk ukuran bodynya dengan sisi belakang yang pendek dari gambar juga terlihat bahwa kursi dari honda sport ev concept ini cukup dekat dengan sisi belakangnyadan pilar a dari mobil ini sendiri sangat tipis sehingga bagi kalian yang tak cermat akan mengira mobil ini memiliki kaca yang menyambung tanpa pilar a dan jika kalian jeli tak ada kaca spion di mobil ini karena posisi dari kaca spion digantikan oleh kamera bergeser ke sisi belakang mobil ini menggunakan lampu belakang yang serupa dengan milik honda urban ev concept velg yang digunakan oleh honda sport ev concept ini sendiri berbeda dibandingkan dengan honda urban ev concept desain velg honda sport ev concept lebih terlihat sporty dengan palang lima dibandingkan milik saudaranya yang lebih berkesan retrodari sedikit informasi yang dibagikan honda melalui website resminya terlihat bahwa ada teknologi baru yang ditanamkan oleh pihak honda di honda sport ev concept selain mesin bertenaga listrik yang ditanamkan di mobil ini ada pula kecerdasan buatan yang ditanamkan di sistem mobil yang menurut honda akan membuat pengendara bisa menyatu dengan mobilnya ai ini sendiri dinamai honda automated network assistant yang berfungsi dalam hal komunikasi antara mobil dan pengendara tentunya menarik untuk menantikan kelanjutan dari honda sport ev concept ini di kemudian hari bersama saudaranya honda urban ev concept tentunya bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'tokyo motor show 2017  honda perkenalkan honda sport ev concept'),
(51, 'setelah daihatsu toyota dan mitsubishi maka honda juga tak mau ketinggalan dengan produk  produk andalannya di gelaran tokyo motor show 2017 ini honda membawa beberapa produk baru dan produk konsep mereka yang mayoritas mengusung teknologi mesin yang bertenaga listrik dan salah satu yang menarik adalah hadirnya honda cr-v hybrid terbaru yang kini menggunakan teknologi hybrid terbaru dari hondavarian honda cr-v hybrid ini sendiri merupakan penggenapan dari kabar yang sempat kami angkat beritanya beberapa waktu yang lalu bahwa honda akan menggeser posisi honda cr-v diesel dengan varian hybrid dan realisasi ini akhurnya hadir di tokyo motor show 2017 ini dengangan beberapa hal baru yang ditanamkan di dalamnya honda cr-v hybrid hadir dengan teknologi mesin hybrid honda yang terbaru yaitu i-mmd yang menggeserkan peran mesin hybrid lawas i-dcd mesin ini sendiri memiliki dua motor listrik yang menunjang pergerakannyahonda cr-v hybrid hadir dengan dua pilihan penggerak yaitu versi penggerak roda depan dan versi 4wd keduanya mengusung mesin sport hybrid i-mmd selain mesin honda cr-v hybrid juga dilengkapi dengan beberapa kelengkapan keamanan yang terpaket dalam honda sensing paket honda sensing ini akan meliputi fitur macam adaptive cruise control acc collission mitigation braking system cmbs road departure mitigation rdm lane departure warning ldw dan lane keeping assist system dan selain itu wheelbase dari honda cr-v hybrid diinformasikan juga berubah walau belum jelas berapa perubahannyauntuk honda cr-v hybrid di jepang akan dilengkapi dengan 7-seater yang serupa dengan honda cr-v turbo yang ada di indonesia mobil ini sendiri masih belum terpantau di website honda jepang sehingga belum jelas berapa banderol yang ditetapkan oleh honda untuk mobil ini secara tampilan sendiri tak ada perbedaan yang berarti jika dibandingkan dengan honda cr-v turbo di indonesia kecuali pada emblem hybrid yang diberikan di honda cr-v hybrid inimobil ini sendiri memang menjadi salah satu produk yang menarik dimana peforma dan efisiensi bahan bakar akan menjadi nilai plus diluar eksteriornya yang cukup cakep apakah mobil ini nantinya akan masuk ke indonesia dikala skema lcev sudah rampung kita tak tahu semoga saja iya bagaimana menurut kalian honda cr-v hybrid ini yuk sampaikan pendapat kalian kawan', 'tokyo motor show 2017  honda cr-v hybrid hadir dengan dua motor listrik'),
(52, 'setelah beberapa mobil konsep toyota di tokyo motor show 2017 kita bahas ada satu lagi mobil konsep yang tak kalah menarik untuk dibahas yaitu adalah toyota fcr yang merupakan singkatan dari toyota fine-comfort-ride toyota fcr sendiri hadir dengan konsep utama sebagai sebuah premium saloon masa depan yang menawarkan sejumlah keunggulan termasuk kelegaan ruang dan kemewaha serta tentunya kecanggihan fiturtoyota fcr hadir dengan sebuah konsep sebagai stress-release dengan menawarkan kenyamanan di dalam kabinnya dan tak hanya nyaman toyota fcr juga menawarkan mesin yang ramah lingkungan karena menggunakan fuel cell sebagai sumber energi utamanya dan arti kata nyaman disini bukan hanya perkara kursi yang empuk saja namun juga kehalusan dan ketenangan yang ada di toyota fcr berkat tidak adanya suara mesin dan suara knalpot dari mobil ini secara desain toyota mengklaim bahwa permata menjadi inspiras desain dari toyota fcr ini dimana siuet sebuah permata bisa dilihat dari bentuk body mobil ini dari sisi atasdan yang menarik adalah mobil ini memiliki jarak sumbu roda yang panjang namun perhatikan overhang di sisi depan dan belakang dari mobil ini sangat minimal dengan model seperti ini jelas bagian kabin dari toyota fcr akan sangat lega dan bisa dimaksimalkan fungsinya toyota fcr menggunakan platform terbaru dari toyota yaitu fcv masuk ke dalam kita bisa melihat bahwa toyota fcr dilengkapi dengan kursi yang nampaknya nyaman dan futuristis hal ini menjadi nilai jual utama mobil ini di masa depan karena jika diperhatikan mobil ini lebih seperti ruang tamu daripada sebuah mobil dengan empat kursi yang bisa diatur dengan bebas sambil bersantaibicara teknologi toyota fcr memiliki kemampuan pengisian daya selama 3-5 menit saja dan dari waktu yang singkat tersebut toyota fcr mampu berjalan secara maksimal dengan jarak tempuh hingga 1000 km menarik dan untuk urusan tenaga yang dihasilkan oleh fuel cell ini dengan metode single refueling adalah sekitar 120 kwh tenaga sebesar itu setara dengan tenaga yang diperlukan untuk menyalakan ac di rumah selama lima hari berturut  turut tanpa dimatikan beberapa fitur lain seperti internet dan layar yang besar bisa digunakan di mobil ini selama berkendaradengan teknologi fuel cell yang kompak kecil dan juga aplikasi in wheel motor toyota fcr memang menjadi sebuah konsep yang menarik untuk diwujudkan di masa depan mungkin beberapa ada yang bertanya kalau semua penumpang bisa santai sambil berjalan lalu siapa yang menyetir thanks to autonomous driving system tentunya bagaimana menurut kalian mobil ini yuk sampaikan pendapat kalian kawan', 'tokyo motor show 2017  toyota fine-comfort-ride premium saloon masa depan'),
(53, 'setelah puas melihat mobil  mobil yang nampaknya hanya akan dipasarkan di jepang kita sekarang bergeser ke sebuah mobil yang beberapa waktu lalu sempat menyita perhatian masyarakat indonesia yaitu daihatsu dn trec kehadiran daihatsu dn trec di tokyo motor show 2017 ini menemani jajaran mobil konsep lain dari daihatsu seperti yang pernak kami bahas beberapa waktu yang lalulalu kenapa daihatsu dn trec menyita perhatian kita orang  orang indonesia jelas karena perawakannya sebagai sebuah suv kompak yang mengingatkan kita dengan daihatsu terios yang santer dikabarkan akan berganti model dalam waktu dekat beberapa pihak menebak  nebak jika nantinya daihatsu dn trec akan menjadi basis dari daihatsu terios dan toyota rush terbaru seperti halnya daihatsu be-go dan dugaan semakin kuat jika kita ingat bahwa daihatsu be-go memiliki dimensi yang pendek namun menjadi panjang saat masuk ke indonesia sebagai daihatsu terios  toyota rushakankah daihatsu dn trec yang diperpanjang dimensinya menjadi the next toyota rush  daihatsu terios who knows segalanya masih mungkin kawan oke mari kita bahas mobil ini lebih lanjut dalam penjelasannya daihatsu dn trec dikatakan oleh pihak pabrikan sebagai a compact stylish suv suitable for both daily use  hobbies sebuah tagline yang menyatakan bahwa mobil ini akan menyasar dua pasar penggunaan sehari  hari dan pasar hobi konsep utama dari daihatsu dn trec sendiri adalah active fun dan tough mobil ini akan diperlengkapi dengan dua pilihan mesin yaitu mesin 1000cc turbo dan mesin 1200cc hybridwalaupun kubikasinya kecil namun berkat turbo dan hybrid yang disandangnya nampaknya daihatsu dn trec tak akan kalah dengan varian lsuv ataupun compact suv bermesin 1500cc naturally aspirated secara penampilan daihatsu dn trec memang terlihat gagah walau dimensinya kompak kaki  kaki dari daihatsu dn trec juga terlihat kekar dengan fender yang menyambung dari depan ke belakang dengan laburan warna hitam lampu depan dari daihatsu dn trec juga sudah menggunakan led dengan drl di bumper depannya grille dari daihatsu dn trec juga minimalis dengan bilah krom yang menyambung hingga ke lampu utamabergeser ke samping tongkrongan dari daihatsu dn trec ini mengingatkan kita pada ford ecosport dan vw tiguan garis jendelanya sendiri tegas dan tanpa lekukan yang aneh  aneh secara umum daihatsu dn trec sudah digambarkan sebagai sebuah suv kompak yang tangguh namun masih oke untuk dipakai di dalam kota kami tak sabar untuk memantau apakah nantinya mobil inilah yang akan menjadi basis dari duo lsuv astra untuk pasar indonesia bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'tokyo motor show 2017  daihatsu dn trec terios jepang bermesin 1000cc turbo  1200cc hybrid'),
(54, 'masih dari booth toyota di gelaran tokyo motor show 2017 ada sebuah mobil yang juga menarik untuk dibahas di gelaran ini yaitu adalah toyota century 2018 jika kalian rajin membaca web ini maka kalian pasti tak akan asing dengan mobil ini karena beberapa waktu yang lalu kami pun sempat membahas mobil ini dan kali ini kami punya kesempatan untuk melihat unit langsungnya dari dekat inilah toyota century 2018toyota century sendiri memang menjadi sebuah model yang lekat dengan urusan kemewahan sejak pertama kali diluncurkan pada tahun 1955 ha memang sudah ada toyota century di 1955 tenang  tenang bukan toyota century memang cikal bakal dari toyota century adalah toyota crown yang sudah kita bahas model terbarunya di artikel yang lain setelah era toyota crown vg10 barulah hadir toyota century pada 1967 yang desainnya tak berubah selama tiga dekade kalah toyota avanza generasi kedua dari toyota century baru hadir di 1997 dan menjelma menjadi mobil para horang kayah di jepangkembali ke toyota century 2018 mobil ini seperti yang kami bilang memang lekat dengan kemewahan macam rr dari jepang dan oleh karena itu sudah jelas bahwa bagian  bagian dari toyota century 2018 dibuat bukan dengan deretan mesin demi mesin namun handcraft one by one alias dikerjakan tangan satu per satu komponennya bahkan tak hanya dari proses pembuatannya untuk proses pewarnaan dari body mobil ini pun juga melalui sejumlah tahapan yang rumit yang memiliki 7 lapis coat and bakes namun seperti yang sempat kami bahas mobil ini tak hanya mewah namun juga mendapatkan update terkini dengan mesin hybridsudah tak ada mesin 5000 cc v12 berkode 1gz-fe milik century generasi kedua yang diperkenalkan tahun 1997 silam dan digantikan oleh mesin 5000 cc v8 berkode 2ur-fse yang disokong teknologi hybrid toyota hybrid system ii plus baterai nimh untuk memberi tenaga bagi motor listriknya interior dari mobil ini pun sudah tak perlu dikomentari lagi sudah pasti mewah dan juga lega beberapa detail dari mobil ini yang menunjukkan kemewahan adalah pada kayu  kayu yang dipasang di interior mobil ini yang memang dibuat dari kayu asli kedua untuk kursi dari mobil ini dilapisi oleh kain wol yang berkuaitas tinggiberikutnya adalah kursi belakang dari mobil ini bukan hanya mewah namun bisa memulihkan anda dari pegel  pegel setelah bermain golf ya kursi mobil ini dilengkapi dengan fitur pemijat yang akan menemani layar yang besar di sisi tengah dari mobil ini yang bisa mengontrol banyak fitur yang ditanamkan di mobil ini masih ada pula rak yang bisa diisi dengan majalah favorit anda atau sekedar buku bacaan sebuah jam analog yang terlihat mewah juga hadir di dashboard dari mobil ini ya mobil ini memang adalah simbol dari kemewahan dari sebuah sedan di jepang saat ini bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'tokyo motor show 2017  toyota century 2018 simbol mobil mewah jepang'),
(55, 'belum usai kita bermain  main di tokyo motor show 2017 bergeser ke booth lexus ada sebuah mobil konsep baru seperti yang dijanjikan oleh pihak pabrikan pada bulan lalu ya bulan lalu lexus memberi bocoran bahwa akan ada mobil konsep baru yang akan dibawa ke tms 2017 dan beberapa menebak bahwa mobil ini adalah mobil konsep bertemakan crossover ataupun suv namun ternyata semuanya salahkarena di booth lexus yang hadir adalah lexus ls concept hmmm seri ls lagi bukannya seri ls terbaru baru saja diperkenalkan di ajang ini pula lalu untuk apa memajang seri ls konsep lagi ya jawabannya jelas karena ini adalah masa depan dari seri  seri ls beberapa tahun kedepan untuk model lexus ls terbaru yang juga sempat mampir di giias 2017 lalu diperkirakan akan tetap menjadi andalan dari lexus hingga tahun 2020 mendatnag kemudian kedepannya nampaknya versi produksi dari lexus ls concept ini yang akan diandalkanlalu apa yang spesial dari lexus ls concept ada cukup banyak hal baru yang ditanamkan oleh lexus di mobil konsep ini pertama dan yang paling kentara jelas adalah bentuk ekteriornya yang lebih modern dibandingkan dengan versi yang ada saat ini baik lampu depan dan belakang yang futuristis serta bahasa desain di grille depan-nya yang khas lexus pun juga terlihat futuristis selain itu tarikan garis tegas seperti di sisi bumper depan yang menyambung ke fender serta atap belakang yang landai juga turut menyumbang penyegaran pada mobil ini buritan mobil ini juga nampak lebih semi-coupe yang mengingatkan kita pada porsche panameralalu untuk teknologi yang tak nampak mata ada automated-driving technology yang dibenamkan lexus di lexus ls concept ini teknologi macam apa itu secara kasar teknologi ini memiliki tujuan utama untuk membuat mobil menjadi lebih nyaman aman dan efisien saat dikendarai dengan salah satu fitur highway teammate fitur ini memungkinkan mobil berjalan sendiri di jalan bebas hambatan pada tahun 2020 mendatang jadi saat memasuki jalan bebas hambatan mobil ini akan melaju tanpa supir hingga titik keluar dari jalan bebas hambatan beberapa fungsi yang dimiliki akan membuat mobil bisa memproses beberapa kondisi jalan seperti berganti jalur dan membalap kendaraan laindan yang menarik seperti smartphone  smartphone masa kini yang bisa melakukan update software secara online software di lexus ls concept ini pun bisa melakukan hal yang sama selain itu lexus akan membenamkan ai alias kecerdasan buatan untuk memproses basis data berbentuk big data yang berisi data terkait kondisi jalan di sekitar mobil ini dengan kecerdasan buatan ini maka data terkait akn bisa diolah untuk menentukan pengambilan keputusan dari automated-driving technology miliknya sistem ini juga mirip dengan milik toyota crown concept yang juga hadir di tms 2017 ini dan tak hanya di jalan bebas hambatan di jalanan umum lexus memiliki fitur urban teammate yang berlaku di jalanan biasapengembangan mobil ini pun terus dilakukan hingga akhirnya nanti rampung dan diperkenalkan di 2020 mendatang jadi bagaimana menurut kalian lexus ls concept ini yuk sampaikan pendapat kalian kawan', 'tokyo motor show 2017  lexus ls concept dilengkapi automated-driving technology'),
(56, 'masih dari gelaran tokyo motor show 2017 kita sekarang melihat lebih lanjut dari jajaran mobil konsep toyota dan sekarang adalah giliran dari toyota crown concept ya mobil ini bisa dikatakan sebagai mobil yang mewah namun juga tak meninggalkan kesan sporty bahkan seperti saat kami sempat membahasnya beberapa minggu lalu versi toyota crown concept ini tak seperti versi konsep karena bentuknya yang sudah mendekati realitatoyota crown concept ini sendiri akan menjadi cikal bakal toyota crown generasi ke lima belas selama ini toyota crown memang menjadi salah satu produk ikonik dari toyota dimana salah satunya menjadi armada taksi di jepang sana sedikit sejarah toyota crown sendiri pertama kali diperkenalkan pada tahun 1955 yang menyandang gelar the first purely japanese sedan pada masa jayanya dulu setelah itu generasi demi generasi diproduksi dan pada generasi ke sepuluh toyota crown meninggalkan rangka tradisionalnya dan beralih menggunakan rangka monokok lalu pada generasi ke 11 muncullah versi hybrid pertama untuk toyota crownkembali ke toyota crown concept secara penampilan tak ada yang salah dengan toyota crown concept mobil ini masih menunjukkan kesan premium yang lekat dengannya namun dengan bumbu aura sporty yang juga ada namun nilai jual utama dari toyota crown concept bukan hanya dari desain namun lebih jauh ke sisi dalamnya ya pertama toyota berfokus ke driving performance dari mobil ini dan kedua toyota menaruh perhatian lebih ke urusan konektivitas yang ada di dalam toyota crown concept untuk sisi driving performance toyota mengunggulkan platform tnga yang digunakan sebagai basis dari toyota crown concept inidengan penggunaan tnga nilai jual dari sisi driving performance toyota crown concept adalah pada handling yang responsif dan juga kestabilan dalam berkendara dan yang menarik toyota crown concept adalah mobil toyota yang dalam pengembangannya mampir ke sirkuit nurburgring menarik nampaknya memang toyota crown concept menyasar pasar eropa dengan sejumlah keunggulannya tersebut lalu untuk nilai jual kedua adalah perkara konektivitas pada mobil namun perkara konektivitas ini bukan bicara masalah head unit yang canggih saja namun lebih kepada proses pengolahan data dari sensor  sensor yang adatoyota crown concept memiliki fitur untuk berkomunikasi dengan mobil lain dan juga dengan infrastruktur yang ada di sekitar mobil ini teknologi bernama its connect ini sendiri memungkinkan mobil untuk menerima data dari keadaan sekitar dan diolah dengan teknologi big data menarik jadi toyota crown concept akan memiliki data communication module sebagai fitur standarnya yang tujuan utamanya akan membuat mobil ini aman dalam berkendara di dalam kota karena bisa membaca situasi di sekitarnya nice kok bisa ya dengan data tersebut toyota crown concept bisa membaca posisi jalan yang macet bahkan bisa mendukung fungsi e-care terkait kondisi mobilmemang masih agak berat untuk memahami perkara teknologi ini terlebih bagi kalian yang masih belum akrab dengan teknologi kekinian yang mendukung internet of things macam ini namun sedikit bocoran itulah yang akan diterapkan di dunia pada masa depan bahkan beberapa penerapan teknologi seperti big data pun sudah diterapkan kini dan dengan fitur  fitur macam itu tentunya toyota crown concept akan hadir dengan konsep masa depan yang menarik bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'tokyo motor show 2017  toyota crown concept kini dilengkapi konektivitas antar mobil'),
(57, 'akhirnya proyek penerus nama evolution yang sudah lama digadang-gadang oleh mitsubishi muncul juga mungkin kalian ingat ketika mitsubishi memutuskan untuk fokus pada model-model suv dan menghentikan model-model sedan legendarisnya seperti lancer evolution dan sebuah kejutan hadir sebulan yang lalu dimana mitsubishi mengunggah sebuah teaser berupa gambar dari sebuah mobil bernama mitsubishi e-evolution concept pada ajang tokyo motor show 2017 di tokyo akhirnya tabir itu terbuka ketika mereka memperkenalkan mitsubishi e-evolution concept yang memang berwujud seperti coupe suv yang sudah lebih dulu dipopulerkan oleh bmw dengan x6-nya mitsubishi e-evolution concept sendiri seperti kita tahu merupakan sebuah mobil full elektrik ev yang mengambil wujud coupe suv dengan mesin 20 liter mivec yang berfungsi sebagai generator untuk menggerakan seluruh rodanya melalui 2 motor listrik di masing-masing poros rodaselain itu e-evolution concept dilengkapi dengan teknologi baru yang disebut sebagai ai driving assist yang akan membantu pengemudi kendaraan ini dalam mengendalikan kendaraannya tentunya teknologi ini akan berguna jika nantinya mitsubishi e-evolution concept direalisasikan menjadi versi produksi massal untuk membantu mengontrol mobil yang memiliki sistem gerak 4wd dengan tenaga full listrik ini kabar baik lainnya adalah kami akan mencoba teknologi ai driving assist ini di pusat rd mitsubishi di okazaki pada minggu ini jadi nantikan liputan kami selanjutnyakembali ke mitsubishi e-evolution concept secara umum terlebih dahulu mobil berkelir putih yang ada di booth mitsubishi ini hadir dengan perawakan yang keren wajah depan dari mitsubishi e-evolution concept ini sendiri menganut bahasa desain khas mitsubishi kekinian yaitu dynamyc shield yang dipadukan dengan lampu led sipit di bagian atas yang mengingatkan kita dengan saudaranya mitsubishi xpander kaki  kaki dari mitsubishi e-evolution concept juga cukup besar dengan diameter velg yang memenuhi seluruh ruang kaki dari mobil ini seakan  akan kita melihat sebuah mobil hot wheels dari sampingdan layaknya sebuah mobil konsep interior dari mitsubishi e-evolution concept sudah jelas futuristis dengan layar yang besar di sisi tengah dan roda kemudi yang bentuknya mirip dengan kemudi sebuah pesawat terbang ada panel instrumen di belakang kemudi yang juga menggunakan layar digital dan sisi konsol tengahnya dipenuhi dengan tombol  tombol yang menyiratkan aura futuristis dan hi tech tentunya kami tak sabar untuk menantikan versi produksi dari mitsubishi e-evolution concept ini karena secar konsep mobil ini bisa dibilang cukup keren bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'tokyo motor show 2017  mitsubishi e-evolution concept akhirnya mendarat'),
(58, 'masih dari gelaran tokyo motor show 2017 yang saat ini sedang berlangsung ada sebuah mobil lain dari pihak toyota yang cukup menarik perhatian kami kalian masih ingat dengan toyota tj cruiser ya mobil ini memang membuat orang langsung ingin melihatnya karena modelnya yang one of a kind alias bener  bener nyeleneh namun ternyata bentuknya ini terinspirasi dari sebuah benda yang akrab di kehidupan kita sehari  hariya toyota tj cruiser memang memiliki bentuk yang boxy yang membuat kita bertanya  tanya kira  kira apa yang mendasari toyota membuat mobil ini ternyata huruf t dari toyota tj cruiser merupakan clue-nya desain dari toyota tj cruiser terinspirasi dari toolbox alias kotak peralatan yang sering kita bawa  bawa jika ingin mereparasi sesuatu toyota tj cruiser sendiri diklaim oleh toyota merupakan hasil harmonisasi dari kelegaan ruang kabin ala cargo van dengan daya jelajah dan juga kekuatan desain dari sebuah suvlalu jika huruf t memiliki arti kotak peralatan lalu huruf j berarti apa huruf j di mobil ini berarti joy yang berarti sukacita sukacita disini lebih diarahkan kepada konsep sukacita seseorang karena bisa menjelajah berbagai tempat dengan toyota tj cruiser ini secara tampilan walaupun boxy namun toyota tj cruiser juga hadir dengan sejumlah keunggulan sebuah suv lihat saja fender yang besar dan tebal itu lalu kaki  kaki yang kekar dan juga suspensi yang diambil dari suv toyota yang ukurannya lebih besar yang menarik adalah fakta tentang bahan yang digunakan oleh toyota di bagian kap mesin atap dan fender dari toyota tj cruiser iniketiga bagian dari toyota tj cruiser tersebut dibuat dari bahan karet khusus yang dibuat landai sehingga jika kita mau meletakkan barang  barang diatas ketiga bagia tersebut kita tak perlu kuatir jika barang tersebut akan jatuh lalu masuk ke interiornya interior dari toyota tj cruiser juga bisa dibilang lega karena bentuk boxy-nya bangku depan dan belakang bisa di reclining hingga benar  benar rata lantai jadi jika butuh ruang kabin yang cukup besar untuk barang jelas toyota tj cruiser mampu memenuhinya kemudian perkara akses ke mobil toyota tj cruiser dibekali dengan pintu geser di samping dan pintu bagasi dengan bukaan yang lebartoyota tj cruiser sendiri dikembangkan dengan basis tnga dan akan menggunakan mesin 2000cc dengan bantuan mesin hybrid toyota tj cruiser menggunakan sistem gerak roda depan dan di kemudian akan dikembangkan pula versi 4wd dari mobil ini secara keseluruhan toyota tj cruiser memiliki panjang 43 meter dengan lebar 17 meter dan tinggi 16 meter mobil ini akan dijual global nantinya jika versi produksinya sudah diluncurkan tak seperti toyota jpn taxi yang sebelumnya kami bahas bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'tokyo motor show 2017  toyota tj cruiser inspirasi dari sebuah toolbox'),
(59, 'akhirnya gelaran tokyo motor show 2017 bergulir juga sebagai salah satu gelaran otomotif bergengsi yang disoroti di dunia tentu saja ada cukup banyak produk  produk baru dan produk  produk konsep yang hadir di gelaran ini secara khusus tim autonetmagz mendapatkan kesempatan untuk hadir di tokyo motor show dan meliput gelaran ini dan produk pertama yang menarik untuk dilihat adalah sosok dari toyota jpn taxitoyota jpn taxi sebenarnya bukan produk baru karena pada tahun 2013 lalu mobil ini sempat muncul di gelaran serupa namun pada saat itu mobil ini masih dalam fase pengembangan tapi berbeda dengan saat ini karena sekarang mobil ini sudah siap terjun dan merasakan aspal di negeri sakura sana toyota jpn taxi akan menjadi mobil yang eksklusif untuk pasar jepang alias jdm japanese domestic market keberadaan toyota jpn taxi akan menggantikan toyota crown yang selama ini menjadi armada taksi utama di negara tersebut secara penampilan umum toyota jpn taxi cukup ikonik seperti layaknya taksi di london inggris maupun di new york amerika serikatselain itu toyota jpn taxi tidak seperti layaknya taksi lain yang mengambil basis dari sebuah sedan toyota jpn taxi memiliki atap yang tinggi dengan pintu samping model geser hmm tinggi ruang kabinnya mirip-mirip daihatsu grand max namun karena hal tersebut kabin bisa sangat fungsional dan mudah untuk akses keluar masuk konsep mobil ini menggunakan lantai yang rendah dan juga atap tinggi membuatnya sangat roomy beberapa fitur diberikan seperti kisi ac power outlet dan juga gps yang membuat penumpang nyaman di dalam toyota jpn taxi dan bagasi mobil ini pun tentu saja muat banyak klaim pabrikan bisa menempatkan empat tas golf di bagasi mobil ini tanpa mengorbankan kursi penumpang nicelalu jika diamati logo toyota di mobil ini berwarna biru ya sudah jelas bahwa itu pertanda bahwa toyota jpn taxi ini menganut mesin hybrid toyota jpn taxi menggunakan mesin 1500cc lpg-hybrid yag memiliki peforma mumpuni dengan keiritan bahan bakar yang sesuai ya lpg disini memang berarti harafiah sebagai bahan bakar gas yang tabungnya diposisikan di belakang dari mobil selain itu hybrid battery juga ditanamkan di sisi bawah kursi pengemudi untuk membantu mesin beroperasi toyota jpn taxi sendiri akan melayani tokyo olympics dan paralympics yang akan digelar di tahun 2020 mendatangtentunya dengan segala kelebihannya toyota jpn taxi hadir dengan paket komplit sebagaimana apa saja yang diperlukan dari sebuah taksi ya sayangnya kita di indonesia harus puas dengan jajaran armada taksi yang kebanyakan adalah toyota limo toyota etios sedan dan beberapa lmpv serta jika taksi online yang bisa jadi kita mendapatkan mobil lcgc jadi jika kalian kepo bagaimana rasannya naik toyota jpn taxi liburan dulu sob ke jepang bagaimana menurut kalian stay tune di autonetmagz untuk berita  berita tokyo motor show 2017 yang lainnya', 'tokyo motor show 2017  toyota jpn taxi taksi hybrid khusus untuk jepang'),
(60, 'nampaknya sudah lama kita tak membahas mobil asal china dimana sebenarnya negara ini memiliki sumber daya yang mumpuni untuk membuat produk  produk yang menarik bahkan bagus namun memang sayangnya masih banyak pabrikan lokal yang mau potong kompas alias mencari jalan pintas untuk segera mengembangkan mobil yang bagus dan keren dengan cara menjiplak mobil lain secara desain dan kali ini terjadi lagi dimana ada mobil d-cab yang mirip dengan ford f-150 raptor yaitu projen pick upoke sebelum lebih lanjut membahas mobil ini kita kenali dulu merk apa itu projen projen adalah anak perusahaan dari lifan pernah dengan lifan mungkin bagi yang suka motor pernah membaca artikel kami tentang motor kecil dari lifan yang mengambil rupa sebuah ducati scrambler ya lifan adalah pemain lama di segmen motor sejam 1992 dan sejak 2005 mulai memproduksi motor projen sendiri baru diperkenalkan pada 2015 lalu sebagai sub-brand yang memproduksi kendaraan niaga seperti truk dan d-cabsebelum meniru ford f-150 raptor projen juga pernah meniru chevrolet colorado pre-facelift yang diberi kode projen lfj1035pcf1 pickup mobil ini serupa dengan jiefang ca1031 dan doda k9 yang menjiplak tampang dari chevrolet colorado dan tak berhenti sampai disana kini projen kembali tertangkap kamera memproduksi sebuah mobil d-cab lagi namun kali ini mengambil rupa bak ford f-150 raptor belum jelas apa nama mobil ini sehingga untuk sementara kita sebut saja bunga eh maksudnya projen pick up apa saja yang ditiru hampir semuanya kawan lihat saja grille segi delapan besarnya yang serupa dengan milik ford lalu bumper depannya bahkan spionnyamungkin yang sedikit berbeda ada pada lampu yang bentuk drl-nya lurus ke bawah tak seperti ford f-150 raptor yang masih memiliki lengkungan bahkan warna orange dari projen pick up ini juga mirip dengan warna orange dari ford luar biasa gaya penulisan nama projen di grille sendiri juga serupa dengan ford mungkin jika malu dengan emblem projen konsumen nanti bisa membeli emblem ford yang besar dan diletakkan disana sejauh ini mobil ini dikabarkan memiliki kode nama projen xxx dan akan mengusung mesin diesel dengan kubikasi 2500 cc yang bisa memproduksi tenaga 150 hpmobil ini sendiri dikabarkan akan dijual dengan harga 90000 yuan atau sekitar 180 jutaan rupiah bandingkan dengan ford f-150 raptor yang harganya mencapai 499000 yuan atau sekitar 1 miliar rupiah jauh bukan ya walaupun menjadi solusi yang ekonomis disana namun sekali lagi kebiasaan menjiplak sepertinya memang harus mulai dikurangi untuk pasar china toh sekali lagi mereka sudah mampu kecuali kalau belum bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'projen pick up  ford f-150 raptor kw super asal china'),
(61, 'tidak semua orang khatam dengan porsche 911 apalagi kalau disuruh menghafalkan variannya saat melihat sebuah 911 di jalan kita bakal menerka-nerka apakah itu tipe carrera carrera s gts gt3 turbo atau turbo s itu baru varian sebab kita bisa lebih pusing lagi kalau disuruh menebak kode generasinya entah itu 901 930 964 993 996 997 991 atau yang sekarang 9912 lumayan pusing kalau dilihat-lihatlalu apa yang ada di kepala porsche saat merilis 911 carrera t well kalau dari sisi porsche mereka ingin mengenang carrera t yang pernah mereka buat dulu pada tahun 1968 terlepas apakah konsumen bakal makin bingung mau pilih 911 yang mana karena variannya makin banyak setelah kehadiran 911 carrera t ini di buritannya terpasang mesin 3000 cc flat 6 twin turbo yang sama dengan 911 carrera dan carrera sdengan tenaga 370 hp dan torsi 460 nm 911 carrera t sama sekali tidak lamban dengan girboks manual ia bisa lari dari 0-100 dalam 43 detik hingga kecepatam maksimum 2912 kmjam kalau pakai girboks pdk akselerasi 0-100-nya jadi lebih cepat yakni 4 detik namun top speed turun jadi 288 kmjam porsche 911 carrera t sudah dapat locking differential bertipe mekanikal dan suspensi sport dengan pasm tapi 4 wheel steering adalah opsionaldibandingkan dengan keluarga 911 lainnya ada porsche 911 carrera t punya ciri-ciri berupa emblem carrera t grafis eksterior warna hitam trim jok custom dan handle pintu yang lebih spartan kalau di 911 carrera dan carrera s handle pintu bagian dalamnya pakai metal 911 carrera t cuma pakai strap biasa yang bahannya mirip dengan bahan sabuk pengaman tidak hanya itu bahan peredam suaranya juga lebih minim di carrera tkonsekuensi logisnya memang berkurangnya kualitas keheningan kabin namun berat 911 carrera t bisa tereduksi sedikit hingga menyentuh bobot 1571 kg oh ya huruf t dari 911 carrera t bukan berarti turbo ya melainkan touring jelas dong kan sudah ada 911 turbo namun agak kontradiktif kala namanya touring namun mobilnya mereduksi sedikit hal yang menunjang kenyamanan meski performanya bisa dipuji apa opinimu sampaikan di kolom komentar', 'porsche 911 carrera t  ini buat apa lagi'),
(62, 'apakah kalian masih terkagum  kagum dengan mitsubishi xpander ya memang mobil ini bukanlah mobil yang sempurna beberapa kelemahan masih melekat pada mobil ini namun tak bisa dipungkiri mitsubishi xpander telah membawa pasar lmpv ke next generation-nya dan tentunya kehadirannya akan membuat para pesaing akan membuat produk yang lebih advance daripada mitsubishi xpanderdan salah satu kompatriot dari mitsubishi yaitu renault juga nampaknya berminat untuk terjun di kelas yang serupa dengan mitsubishi xpander ya kelas lmpv memang menjanjikan cukup banyak penjualan walaupun kini mulai terkikis oleh keberadaan lsuv namun tentunya renault bukannya tak memikirkan hal ini minat renault pada pasar ini sendiri terlihat dari paparan pihak pabrikan asal perancis ini dalam rencana lima tahunan mereka yang bertajuk drive the future di dalam rencana lima tahunan mereka tersebut ada sebuah gambar yang menunjukkan sebuah mobil dengan jenis mpv yang ditutup dengan covertentunya gambar ini mengundang tanda tanya  terlebih untuk mereka yang menyukai merk ini namun memang nampaknya renault masih sekedar rencana terkait masalah ini karena gambar tersebut nampaknya merupakan renault lodgy yang ditutup cover namun kondisi sekarang sudah berbeda karena renault dan nissan kini sudah menggandeng mitsubishi dalam aliansi mereka dan kita tahu bahwa nissan juga cepat atau lambat akan menggunakan platform milik mitsubishi xpander untuk memperbaharui nissan grand livina mereka yang sudah berumurlalu apakah renault akan menggunakan basis dari mitsubishi xpander bisa iya dan bisa tidak sebenarnya tawaran menggunakan basis dari mitsubishi xpander cukup menarik dimana renault bisa memanfaatkan basis produksi mitsubishi xpander di indonesia namun sepertinya renaut masih pikir  pikir perkara ini bisa jadi lmpv baru nanti adalah generasi terbaru dari renault lodgy lalu selain basis dari mitsubishi xpander renault juga bisa menggunakan basis dari renault kwid yang dikembangkan ulang dengan dimensi yang direvisi tentunya meskipun direvisi tetap saja tak akan sebesar basis dari mitsubishi xpanderterlepas basis apa yang akan digunakan oleh pihak renault untuk lmpv-nya nanti pasar ini masih akan menjanjikan terlebih untuk pasar asia dan tentunya renault tak mau membiarkannya dan menonton dua kompatriotnya terjun di pasar ini renault sendiri sukses memberikan kejutan di tahun 2017 ini dengan menghadirkan renault koleos dan renault kwid di indonesia kita amati saja bagaimana kelanjutannya nanti bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'renault serius kembangkan lmpv basis dari mitsubishi xpander');
INSERT INTO `artikel` (`id_artikel`, `isi_artikel`, `judul_artikel`) VALUES
(63, 'kalian masih ingat kan dengan permasalahan yang mendera tesla beberapa waktu terakhir pertama mereka mengalami hambatan produksi yang mengakibatkan tesla model 3 hanya terdistribusi dengan jumlah unit yang amat sedikit jika dibandingkan dengan target kedua karena masalah ini ada cukup banyak pekerja dari tesla yang harus dirumahkan alias dipecatya masalah mereka ini sebenarnya bukan hal yang asing lagi di bidang industri otomotif dan pihak tesla sendiri menyatakan bahwa sumber masalah ada di peforma dari pabrik perakitan dan pabrik baterai mereka yang tak bisa cepat menyesuaikan dengan target yang diusung oleh pihak perusahaan salah satu cara paling mudah untuk mengatasi hal ini adalah dengan melakukan produksi secara parallel yaitu dengan membangun pabrik lain untuk menyokong produksi di pabrik perakitan yang sudah adanamun tentunya hal ini memerlukan biaya yang lebih karena dua pabrik akan memerlukan dua kali lipat pekerja lalu bagaimana solusinya cari negara dengan upah pekerja yang tak terlalu tinggi dan tesla pun akhirnya memilih china sebagai destinasi mereka selanjutnya ya dikutip dari wall street journal tesla telah melakukan persetujuan dengan pihak pemerintah di shanghai untuk membangun sebuah pabrik perakitan baru disana dan hal ini pun menjadi sebuah keuntungan baru bagi tesla karena membangun pabrik di area free trade zonedan yang menarik lagi tesla akan menjadi pabrikan pertama di china yang akan memiliki pabrik secara penuh kepemilikan pabrik secara penuh disini merujuk bahwa tesla tak akan melakukan joint venture dengan pabrikan lokal china manapun menarik mengapa menarik karena pada umumnya pabrikan asing yang membuat pabrik di china selalu menggandeng pabrikan lokal seperti vw toyota dan merk  merk lainnya namun dampaknya tesla harus membayar pajak 25 untuk tarif import yang diberlakukan karena keputusan mereka inipemilihan china sebagai destinasi pabrik dari tesla bukannya tanpa alasan selain sudah menjelma menjadi negara industri otomotif yang besar china juga menjadi pasar yang prospektif untuk mobil listrik produk jualan utama tesla selain itu pemerintah china sendiri memiliki target untuk mengembangkan populasi mobil listrik hingga 7 juta unit di tahun 2025 pemerintah china juga memberikan instruksi bagi merk lokal untuk mulai memproduksi mobil listrik per 2019 mendatang tentunya kehadiran pabrik baru tesla di china nantinya diharapkan mampu membantu masalah produksi yang ada dan juga memperlebar sayap mereka di benua asia khususnya china bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'tesla akan bangun pabrik baru di china'),
(64, 'mercedes-benz memang menjadi salah satu merk yang bisa dikatakan paling ahli jika berurusan dengan peforma mesin dan juga variasi produk hal ini mereka tunjukkan dalam diri mercedes-benz amg g65 yang memiliki mesin yang sangat bertenaga untuk ukuran suv walaupun desainnya sangat boxy namanya juga mercedes-benz namun tak dapat dipungkiri mobil ini memang menggugah bagi kalian yang menyukai mobil gagah namun juga peduli masalah peformanamun sayangnya seri mercedes-benz amg g65 yang menjadi varian g-class paling bertenaga ini akan disudahi produksinya dan untuk menghormati seri mercedes-benz amg g65 maka pihak pabrikan asal jerman ini menelurkan seri pamungkas dengan nama mercedes-amg g65 final edition mercedes-amg g65 final edition tak hanya menjadi seri khusus namun juga menjadi seri terbatas yang hanya akan dijual sebanyak 65 unit saja sayangnya kesemua unit dari mercedes-amg g65 final edition akan menggunakan setir kiri yang membuatnya tak akan mampir ke negara kitalalu apa saja yang akan hadir di mercedes-amg g65 final edition yang jelas adalah mesin super besar yaitu mesin berkonfigurasi v12 dengan kubikasi 6000cc yang memiliki tenaga super 630 ps dan torsi badak sebesar 1000 nm gelandewagen resmi yang paling bertenaga ini sendiri juga akan mendapatkan iinterior yang lebih mewah dengan material kulit nappa yang berkualitas tinggi selain itu jahitan berwarna coklat muda akan hadir menemani beberapa aksen dengan bahan serat karbon yang menampilkan aura sporty berbalut kemewahan dan aura sporty masih akan diperkuat dengan setir lansiran dari amg performanceberalih ke bagian eksterior yang angsung kentara adalah velg dengan laburan warna coklat yang senada dengan jahitan di interior velg ini sendiri memiliki desain yang sporty dengan lebar diameternya 21 inci beberapa detail lain pada eksteriornya juga mendapatkan sentuhan warna coklat seperti pada penutuo konde ban cadangannya cover spion dan juga pada grille dan bumper depan dan mobil kencang nampaknya memang kurang lengkap jika tak memiliki sticker begitu menurut grady reviewer autonetmagz paling kencang untungnya kehadiran sticker amg di sisi samping kanan kiri mobil ini terlihat rapi dan cantikurusan peforma mungkin adalah nilai jual utama dari mercedes-amg g65 final edition ini mobil bongsor ini bisa berlari dari keadaan diam hingga 100 kmjam hanya dalam 53 detik super kentjang untuk ukuran mobil sebesar dan sekotak mercedes-amg g65 final edition fakta tersebut didukung oleh mesin yang dibantu transmisi amg speedshift 7g-tronic miliknya klaim mercedes-benz menyatakan bahwa mercedes-amg g65 final edition bisa berlari hingga kecepaan 230 kmjam mobil ini sendiri akan dihargai sebesar 45 hingga 5 milyar rupiah harga yang cocok untuk kolektorbagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'mercedes-amg g65 final edition diperkenalkan terbatas 65 unit'),
(65, 'beberapa bulan yang lalu mazda pernah membuat acara besar-besaran dengan menampilkan hingga 6 mobil sekaligus dalam sebuah acara besar keenam mobil itu adalah mazda 2 facelift mazda cx-3 mazda 5 mazda mx-5 mazda 6 estate dan mazda 3 hatchback meski banyak yang dibawa yang resmi dijual saat itu baru mazda 2 facelift dan cx-3 sementara yang lain baru muncul untuk bilang hai sebentar sajanah barulah di sebuah acara yang digelar di epiwalk kuningan eurokars motor indonesia yang sekarang jad apm mazda meresmikan kehadiran dan penjualan mobil-mobil yang numpang lewat kemarin beberapa ada yang diubah spesifikasinya namun beberapa tetap sama kita mulai dari mazda 3 dulu di mana mobil ini dijual dalam format hatchback 5 pintu tanpa ada tipe sedan ini berarti ia beda dengan civic yang ada hatchback dan sedan tapi sama dengan golfinterior masih mengandalkan desain mazda yang keren dan terkesan driver-oriented sudah termasuk fasilitas mobil jaman now seperti autonomous braking lane departure warning i-stop dan masih banyak lagi jika kompetitor sekelasnya seperti civic dan golf pede dengan mesin turbo mazda masih percaya mesin 2000 cc 4 silinder normally asporated yang dioptimalkan dengan filosofi skyactiv merekamengenai girboks pun mazda melengkapi varietas jenis girboks di kelas ini mau cvt ada di civic mau kopling ganda ada di golf dan kalau mau torque converter ada di mazda harga kami terkejut bahwa harga mazda 3 cukup menggiurkan yakni 4168 jutaan memang lebih mahal daripada civic hatchback tipe s tapi tetap lebih murah daripada civic hatchback tipe e terutama jika menimbang seberapa banyak beda fitur antara honda dan mazda saat tahu harganya kami bergumamtumben nggak mahal biasanya mazda mahal mau bukti lihat saja harga cx-3berikutnya ada jenis yang hilang lama dan berusaha dihidupkan lagi yakni wagon atau estate mazda 6 estate hadir untuk mengingatkan kita akan mazda vantrend kami akan sangat senang jika ada merek jepang yang jual wagon sebab wagon yang dijual resmi di sini hanya ada dari merek jerman audi dan mercedes kesenangan kian bertambah kala tahu bahwa harga mazda 6 estate yang ada di indonesia malah lebih murah daripada yang sedanjika mazda 6 sedan dijual seharga 6342 juta rupiah mazda 6 estate lebih murah dengan harga 5388 juta rupiah mungkin karena skema pajaknya terhitung sebagai minibus berikutnya ada mazda 5 mpv pintu geser yang sebenarnya usianya sudah tak muda dari segi harga mazda 5 dijual seharga 3768 juta namun tetap lebih mahal dari toyota sienta karena dimensinya sendiri lebih besar sedikit mesinnya pun lebih besarperbedaan spek pun ada di mazda 5 beberapa bulan lalu waktu ia numpang lewat joknya masih fabric sementara sekarang sudah diganti jok kulit sampailah kita kepada sang ikon mazda mx-5 ada beda spek lagi sebab jika kemarin mx-5 yang tampil adalah versi atap kanvas maka sekarang yang tampil dan dijual resmi adalah versi rf yang beratap pelat lipat masuk akal atap kanvas memang agak rentan terhadap pisau dari orang-orang kriminalmazda mx-5 rf berkode nd ini tetap kecil jadi orang yang mengidap obesitas belum tentu bisa nyaman di sini ia juga tak praktis mengingat bagasinya kecil dan tidak banyak tempat buat menaruh barang mesin yang ditawarkan adalah mesin 2000 cc 4 silinder skyactiv dengan tenaga 155 ps lebih kecil dari mazda 3 yang 165 ps transmisi yang disediakan hanya otomatis 6 percepatan saja tidak ada manualmazda menjual mx-5 rf dengan harga 780 jutaan cukup mahal padahal mx-5 di luar sana laris karena ia murah tapi dibandingkan bmw z4 dan mercedes benz slc di sini mx-5 tetap murah sih andaikan mazda turut menjual varian bermesin 1500 cc dan bertransmisi manual kami yakin bakal ada pilihan yang lebih kompetitif mana mazda yang menarik minatmu sampaikan di kolom komentar', 'mazda indonesia resmikan kehadiran 4 mobil sekaligus'),
(66, 'suzuki ignis adalah salah satu primadona baru di kelas city car meski rasa berkendaranya tidak seberapa dibandingkan city car lain namun penampilannya yang retro-funky sanggup membuai konsumen mobil ini menarik dari penampilan luar dan dalamnya meski bagian belakangnya tetap tidak klik dengan selera semua orang dari semua variannya tipe gx adalah yang paling komplit dan kecetidak begitu banyak yang melirik suzuki ignis gl dan sepertinya animo akan ignis yang sudah mulai menurun sejak setahun silam harus dinaikkan lagi tensinya dari bocoran yang kami dapat suzuki indonesia tengah mempersiapkan varian baru bernama suzuki ignis comfort dan suzuki ignis luxury basisnya adalah suzuki ignis gl maka dari itu ia tidak punya lampu projector di bagian depannyabedanya dibanding suzuki ignis gl yang ada sekarang suzuki ignis comfort dan ignis luxury sudah punya foglamp sementara tipe gl biasa tidak ada minus hiasan chrome seperti yang ada di tipe gx tapi foglamp sendiri lebih penting daripada chrome selain lampu kabut itu pembaruan lain seperti sepasang sensor parkir belakang plus roof spoiler juga sudah dipasang buat kedua tipe di pintu bagasi akan ada stiker luxury atau comfort sebagai penanda varian stiker bukan emblemsementara kalau melihat perbedaan di bagian dalam kemungkinan terbatas pada material jok dan head unit khusus suzuki ignis luxury jok sudah dilapis bahan kulit itu buat yang luxury jadi mungkin tipe comfort bahan joknya masih standar head unit pun terlihat berganti dari radio tape biasa ke tipe touch screen yang normalnya dijual suzuki sebagai opsional sayang belum diketahui tipe mana yang dapat head unit standar inibagaimana dengan harga well harga suzuki ignis luxury dan comfort sebenarnya masih samar tapi jika harga suzuki ignis gl adalah 1395 juta manual dan 1495 juta amt dalam kondisi otr jakarta mungkin sederet perubahan seperti yang sudah disebutkan tadi bakal mengangkat harganya sekitar 5-7 juta rupiah asal tidak overlapping dengan suzuki ignis gx sih oke-oke saja apa opinimu sampaikan di kolom komentar', 'suzuki ignis siapkan tipe comfort dan luxury ini bedanya'),
(67, 'jika kita bicara kelas compact suv atau kalau sekarang agak rancu dengan model crossover atau cuv karena basis produksi mobil semacam ini biasanya diambil dari model hatchback banyak pabrikan yang bermain di kelas ini katakanlah sang raja cuv honda hrv lalu sang pelopor suzuki sx4 dan nissan juke berikutnya ada juga chevrolet trax namun dari kesemuanya yang mungkin secara perawakan agak nanggung adalah suzuki sx4 scrossnamun sebenarnya suzuki bisa jika mau melawan cuv yang lainnya caranya mudah tinggal masukkan saja suzuki vitara brezza yang punya segmen yang sama dengan para pesaingnya namun hal tersebut sempat menjadi kendala di indonesia padahal pada giias 2016 lalu suzuki indomobil sales sempat memajang suzuki vitara brezza di gaikindo indonesia international auto show giias 2016 apa kendalanya perkara mesinya mesin yang digunakan oleh suzuki vitara brezza adalah unit diesel 1300cc dan hanya varian mesin tersebut yang dimiliki oleh suzuki vitara brezza lho bukannya itu mesin suzuki ertiga diesel benar sekali tapi ingat waktu itu suzuki ertiga diesel belum diluncurkan dan nampaknya pt sis ingin melihat dahulu respon pasar dengan memasukkan suzuki ertiga diesel yang mengusung mesin serupa milik suzuki vitara brezza dan kabar baiknya respon pasar terhadap suzuki ertiga peminum solar ini pun cukup baik dan memuluskan langkah pt sis yang ingin memasukkan suzuki vitara brezza ke tanah airsecara tenaga service sendiri juga sudah cukup mumpuni karena mesin serupa dengan milik suzuki ertiga diesel hanya saja tanpa mild hybrid ala suzuki alias shvs kabar ini sendiri kami kutip dari laman otomotif kompas yang mendapatkan konfirmasi dari salah satu sumber yang mengatakan bahwa suzuki vitara brezza akan mengaspal tahun depan dan dengan kehadiran suzuki vitara brezza maka suzuki indonesia akan mampu menghadirkan pesaing setara untuk honda hrv dan nissan juke serta chevrolet trax walau bermesin diesel 1300 cckabar mengenai kehadiran suzuki vitara brezza juga mengingatkan kami akan kemungkinan munculnya transmisi otomatis dari suzuki ertiga diesel pada tahun depan jadi kemungkinan jika nantinya varian otomatis dari suzuki ertiga diesel meluncur ada kemungkinan jika nantinya suzuki vitara brezza juga akan menggunakan transmisi otomatis yang serupa bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'sukses bawa ertiga diesel sis disinyalir siapkan suzuki vitara brezza'),
(68, 'mitsubishi xpander yang menghebohkan dunia persilatan lmpv di indonesia ini memang selalu menarik untuk dibahas berhubung unit test drive dari mitsubishi belum tersedia kami berkesempatan untuk berkencan dengan mitsubishi xpander tipe sport dan ultimate milik member xpander mitsubishi owner club xmoc yang baru saja didirikansekilas pandangdesain mitsubishi xpander ini dari depan memang memikat hati siapa saja yang melihatnya desainnya yang ekstrim modern dan eye catching ini memberi gebrakan di segmen lmpv yang selama ini dihuni avanza mobilio dan ertigaantara mitsubishi xpander sport dan ultimate tidak ada perbedaan berarti dari segi eksterior kecuali emblem dan cover spion chrome di tipe ultimate yang sebenarnya tidak penting-penting amat mitsubishi juga menyediakan paket upgrade bodykit untuk anda yang tidak ingin terlihat suv look pada mitsubishi xpander inidi xpander tipe ultimate yang kami bahas ini terlihat lebih gagah karena menggunakan ban dan pelek milik mitsubishi outlander sport karena itu setelah melihat varian sport dengan velg standar 16 inchi jadi terlihat cungkring dan kurang proporsional kelengkapan eskterior mobil ini cukup lengkap mulai dari lampu senja di depan led di bagian belakang kamera mundur di tipe ultimate namun tidak ada sensor parkir pada semua tipeyang menurut kami jadi pr bagi mitsubishi ada pada bumper depannya yang kurang presisi dar segi pemasangan dan cat bumper yang tidak match kelihatan sekali belangnya ketika dilihat dengan mata telanjang ditambah di bumper depan tipe sport yang kami review bumper depannya terlepas seperti mobil yang sudah pernah ditabrak dan dibetulkan oleh asuransi menurut pemiliknya hal tersebut sudah dilaporkan dan akan mendapatkan penanganan dari mitsubishi wajar sih pabrik baru pekerja baru dan produk baru batch produksi berikutnya kami yakin akan lebih rapihkomplain lain dari pemilik xpander ada pada lampu depannya yang kurang terang headlamp tanpa teknologi hid dan projector ini memang kurang terang dibandingkan dengan mobil sekelasnya dan untuk mengganti lampu tersebut agak repot karena posisi lampu berada di bumper bawah bukan di samping grilleinterior legamasuk ke dalam interior mitsubishi xpander memang bukan selera semua orang interiornya di dominasi bahan plastic yang cukup berkualitas solid dan rapih namun terlalu banyak jahitan palsu dan absennya bahan fabric pada door trimkami sangat suka mobil ini memiliki banyak tempat penyimpanan yang sangat praktis posisi duduknya bagus pertama dikelasnya dengan tilt dan telescopic steering pilar a-nya besar namun tidak terlalu mengganggu tata letak tombol mudah dijangkau dan yang paling mengganggu ada pada rem tangan yang ukurannya terlalu besar mengurangi estetikaspeedometernya mirip dengan milik pajero sport dan outlander sport hanya saja ada animasi saat menyalakan mobil yang membuatnya modern antara tipe ultimate dan sport terdapat perbedaan warna interior dan panel aksen kayu tipe sport tampil lebih mewah dengan warna hitam dan panel silver sedangkan tipe ultimate berwarna beige cerah yang memberikan kesan lega ditambah aksen panel kayu yang lebih baik dibandingkan dengan milik pajero sport pendapat pribadi kami kami lebih suka dengan tipe sport yang berwarna hitamsoal kelengkapan mitsubishi xpander memang paling lengkap di kelasnya mulai dari masuk dan menyalakan mesin dengan fitur keyless dan push start stop engine vehicle stability control hill start assist abs ebd dan dua buah airbags menjadi standar di semua tipesoal akomodasi mitsubishi xpander ini memang juaranya ukurannya yang hamper 45 meter ini memberikan kabin yang luas bagi seluruh bagian penumpang dan pintarnya mobil ini punya metode pelipatan kursi belakang yang bias rata lantai seperti halnya ertiga namun tidak perlu mengurangi kapasitas bagasi belakang niceantara sport dan ultimate tidak ada perbedaan berarti dari segi features interior kecuali tombol audio setir tanpa tombol mengangkat telepon dan head unit tanpa touch screen dan bluetooth tapi lebih baik ambil head unit aftermarket karena head unit tipe ultimate layarnya kurang jelas di siang harimitsubishi xpander ambles diisi 7 penumpangsebelum kita jalan kami sengaja mengetes mobil ini jika diisi oleh 7 penumpang jika mpv dengan karakter suspensi empuk biasanya ambles jika diisi muatan penuh ternyata di xpander ini tidak hanya saja ketika diisi 7 penumpang sekaligus tenaga mesinnya langsung terasa lemot di tanjakan pun ketika diisi 3 orang mobil ini rasanya agak kurang bertenaga meskipun masih kuat mungkin akan terasa lebih lemot lagi jika diisi 7penumpang tapi kami yakin masih kuat tidak perlu khawatirlets driveseperti yang sudah kami coba sebelumnya di giias 2017 silam mitsubishi xpander ini memang punya karakter suspensi yang lembut dan kekedapan kabin yang baik mengemudikan mitsubishi xpander ini rasanya seperti dejavu ketika mengendarai nissan grand livina apalagi karakter mesinya yang dicekek di putaran bawah dan bertenaga di putaran 4000 rpm keatas jadi jika anda memiliki nissan grand livina anggap saja ini grand livina yang lebih tinggi lebih luas dan punya double blower hahahasteeringnya enteng no feel feedbacknya lambat tapi cukup akurat ya lmpv dengan ground clearance seperti ini jangan terlalu berharap banyak soal handling sih ditambah mobil ini punya body roll yang sangat terasa meskipun tidak separah rush-terios untung hadirnya stability control membuat kami lebih pede meskipun mobil ini terasa limbungradius putar mobil ini menurut kami cukup di angka 52 meter rasanya sedikit lebih baik dibandingkan dengan grand livina ataupun toyota rush namun tetap jauh jika dibandingkan dengan avanza yang menjadi raja di angka 47 meteryang menarik di mobil ini ada pada peredaman kabinnya yang sangat baik di kecepatan tinggi dan rendah sangat kedap untuk mobil di kelasnya bahkan ketika digunakan di hujan deras atap mobil tidak berisik seperti lmpv kebanyakanokay kemudian bagaimana performanya mobil ini dibekali mesin 4a91 yang biasa kita temukan di mitsubishi colt tapi bukan colt t120ss apalagi colt diesel melainkan colt hatchback yang sudah disuntik mati karena kalah bersaing dengan honda jazz dan ford fiesta tenaganya cuma 104 ps dan torsinya 141 nm putaran bawah mobil ini terasa kurang tapi putaran atasnya terasa lumayan power delivery-nya cukup smooth dan suara mesin bisa teredam dengan baik akselerasi', 'test drive mitsubishi xpander  yakin terbaik dikelasnya'),
(69, 'menjelang tokyo motor show mendatang mazda dipastikan akan membawa 2 mobil konsep di mana salah satunya disinyalir sebagai sekuel dari mazda rx-vision selain mobil konsep mazda pun siap membawa mesin baru bertajuk skyactiv-x wait embel-embel x itu apa maksudnya ternyata ini adalah mesin bensin generasi baru dari mazda bagaimanakah teknologi dari mesin inimesin skyactiv terkenal akan teknologi normally aspirated berkompresi tinggim namun sanggup meminum bensin yang beroktan tidak terlalu tinggi untuk yang satu ini selain kompresi yang tinggi mereka menempatkan titik tumpu pada busi yap busi akan memegang peranan penting pada mesin generasi baru inimereka menyebut teknologi ini sebagai compression ignition masih belum jelas bagaimana sistem ini bekerja secara detail jika businya mati kira  kira pincang maksimal atau bagaimana ya nah ada 1 hal lagi jika diperhatikan pada bagian mesin terdapat sebuah struktur seperti motor listrik yang secara singkat bisa dibilang mesin ini mengusung mild-hybridmild-hybrid ini ditunjang dengan keberadaan baterai kecil pada struktur bodinya hmm jadi mengingatkan kepada ertiga diesel dan svhs-nya kira  kira pada mazda akan menambah berapa hp ya oh iya meski kece sayangnya serangkaian teknologi baru dari mazda ini baru bisa dinikmati pada tahun 2019kami sih berharap mesin ini memiliki performa yang dahsyat dengan efisiensi yang baik jika berhasil mazda akan membuat gebrakan bagus dan mungkin bisa ditiru pabrikan lain sayang 2019 masih lama kami sih inginnya mesin baru ini muncul di mobil  mobil facelift dari mazda menurut kalian bagaimana', 'mesin mazda skyactiv-x dobrakan baru mesin bensin non turbo'),
(70, 'ada yang ingat apa kabar suzuki ciaz di indonesia sejak meluncur di giias 2015 animo yang dipanen oleh ciaz tidak sebanyak sx4 atau baleno padahal ciaz sama sekali tidak buruk ciaz masih punya potensi untuk digarap terbukti bahwa suzuki alivio pro nama suzuki ciaz di china sudah diperbarui kecil-kecilan via sebuah facelift di china grilnya masih berlapis chrome dengan desain single frame yang besar ala mobil-mobil audi 5 tahun lalusementara grilnya ke-audi-audi-an desain bumpernya mengingatkan akan bentuk bumper toyota crown conceptyang bakal tampil akhir oktober nanti di tokyo motor show 2017 pelek tetap 16 inci namun desain multispoke berkelir two-tone barunya lebih menyolok dan manis lampu depan masih projector dan foglamp tetap hadir namun bagian pantatnya yang mirip honda city tak mengalami ubahan berarti selain bumper baru yang diberi aksen hitam bak diffuserurusan interior perubahan yang paling kentara adalah head unit anyar yang tampilannya sedikit banyak mirip kepunyaan ertiga dreza bedanya yang ini sudah disokong oleh baidu aka google-nya china sisanya ia cenderung mirip dengan ciaz sebelum facelift namun kelengkapan standarnya sudah oke sunroof cruise control auto climate control ac belakang keyless entry  keyless start kamera mundur headlamp auto spion elektrik semua itu sudah jadi standarapa yang turut jadi standar juga adalah mesin 1600 cc 4 silinder bensin vvt yang sebenarnya khusus buat si alivio pro ini beda dengan ciaz india dan indonesia yang pakai mesin 1400 cc milik swift baleno dan ertiga mesin 1600 cc dari alivio pro menghasilkan 122 hp dan 158 nm dan ia tetap mengandalkan format fwd pilihan girboksnya ada manual 5 percepatan atau otomatis 6 percepatanberani beda juga kala honda city dan toyota vios sudah hijrah ke cvt selain buat china suzuki alivio pro dipastikan hadir di india dengan kosmetik yang mirip namun bakal dipasangi mesin 1500 cc 4 silinder turbo diesel ddis indonesia jangan harap deh sepertinya merek jepang manapun di sini tidak bisa mengharapkan penjualan sedan kecil jika bukan untuk jadi taksi terlebih suzuki sedang sibuk memperkenalkan baleno apa opinimu sampaikan di kolom komentar', 'suzuki ciaz facelift rilis di china makin oke punya'),
(71, 'kalian masih ingat kan sekitar setahun yang lalu ada sebuah mobil yang menjiplak terang  terangan produk dari range rover evoque masih ingat namanya ya adalah landwind x7 yang merupakan produk dari jiangling motor sebuah ironi di dunia otomotif china sesungguhnya karena sebenarnya jiangling motor sudah bekerja sama dengan pabrikan besar macam ford dan isuzu terus masih jiplak malu dongnamun karena kejadian tersebut kini pihak land rover lebih waspada terhadap produk  produk yang akan dan sudah diluncurkan bagaimana tidak jelas biaya pengembangan untuk sebuah mobil baru itu tak murah bahkan bisa dikatakan sangat mahal dan setelah menghabiskan dana dan kerja keras untuk mengembangkan produk baru ujung  ujungnya dijiplak oleh pihak yang tak bertanggung jawab dengan mudahnya tentu land rover tak mau jatuh di lubang yang sama untuk produk  produk mereka di kemudian haridan sebenarnya hal ini sudah terbukti saat land rover memperkenalkan range rover velar tak ada model konsep yang diumbar oleh pabrikan ini selama masa pengembangan dari range rover velar dan nampaknya hal ini pun akan diberlakukan di mobil  mobil mereka lainnya termasuk pada land rover defender yang diperkirakan hadir tahun 2018 namun sampai hari ini kita tak tahu seperti apa bentuk konsepnya setidaknya selain land rover dc100 yang sempat hadir enam tahun silam yang bisa dikatakan sebagai dasar calon penerus generasi defender di masa depanpimpinan dari divisi desain land rover yaitu gerry mcgovern mengatakan bahwa pihak land rover sendiri memang nervous terhadap kejadian yang menimpanya beberapa waktu silam terkait penjiplakan pihak land rover pun dibuat galau dengan keputusan yang harus mereka ambil apakah haru menuntut walaupun mereka tahu bahwa mereka akan kalah secara ganjil di china namun jika menuntut dan akhirnya kalah ada resiko lain yang harus mereka tanggung yaitu penghakiman dari publik china yang menyalahkan pihak land rover karena mencari masalah dengan pabrikan lokal hmmm serba ribet yaterlepas dari kasus penjiplakan tentunya tak hadirnya model konsep dari pabrikan besar seperti land rover sangat disayangkan karena memang mobil  mobil konsep selalu memberikan asa tentang masa depan walaupun pada akhirnya versi produksi tak akan serupa dengan model konsepnya namun catatan khusus untuk pabrikan china tentunya haruslah mulai menghentikan praktek tersebut karena pada dasarnya mereka sudah sanggup membuat mobil sendiri dengan desain dan teknologi sendiri seperti byd songmax baojun 530 hingga wuling hongguang s3 so ngapain menjiplak bagaimana menurut kalian yuk sampaikan pendapat kalian kawan', 'takut dijiplak oleh china land rover main aman dengan produknya'),
(72, 'otodriver belum lama ini merasakan sensasi mengendari pick up double cabin dengan emblem merek amerika serikat chevrolet colorado namun bukan sekedar mencobanya di jalan raya akan tetapi kami juga blusukan di medan off-roadbicara secara tampilan eksterior memang antara suv-nya yaitu trailblazer dan colorado masih memiliki kemiripan namun yang membedakan adalah sejak kabin baris kedua hingga ke belakang ini karena colorado merupakan mengusung platform sebuah pick up sejatigeneral motor indonesia menghadirkan dua varian yang dapat dites yaitu colorado lt dan colorado high country memang dari segi tampilan sebenarnya tipe lt terlihat jauh lebih sederhana tanpa berbagai macam aksesorisberbeda dengan tipe high country yang hadir dengan berbagai macam aksesoris seperti delapan titik sensor parkir lampu depan dilengkapi drl led pelek berukuran 18 inci foot step cargo cover untuk bak belakang skid plate bumper depan serta adanya bumper belakangtidak mau berlama-lama kami langsung ambil kesempatan mencoba tipe lt karena apm ini tengah fokus untuk menjual mobil gagah ini sebagai armada fleet pertambangan maka tile lt yang dikedepankan masuk ke dalam kabinnya mobil ini terasa cukup sederhana namun memiliki tingkat fungsionalitas yang baikdengan interior berbalut fabric berwarna kombinasi abu-abu terang dan gelap harusnya jok jadi lebih mudah dibersihkan pengaturan jok pun dapat diatur dengan mudah sehingga posisi duduk bisa sesuai keinginan pengemudiposisi duduk terasa layaknya sebuah sedan namun dengan postur colorado yang tinggi membuat pengemudi dapat mengontrol sisi depan dan samping dengan mudah namun untuk bagian ujung bak belakang agak sulit terpantau mengingat dimensi mobil ini cukup panjangbagaimana performa mesinnya colorado di indonesia hadir dengan dua pilihan mesin yaitu mesin diesel 2800 cc common rail dengan variable geometry turbocharger vgt sehingga menghasilkan tenaga 200 ps dengan torsi 500 nm untuk tipe lt yang kami tes ini menggendong mesin diesel 2500 cc duramax empat silinder fixed geometry turbo-diesel bertenaga 163 ps dengan torsi 380 nmdalam sesi media test drive ini otodriver tidak melakukan pengetesan akselarasi dan impresi saat digunakan di jalan raya akan tetapi chevrolet menyuguhkan trek off-road agar bisa mengetahui kemampuan colorado di lumpur basah serta licin maka mode four-wheel drive dengan rasio low gear pun segera kami aktifkanuntuk mengaktifan fitur tersebut juga sangat mudah hanya dari dari sebuah switch yang berada di belakang tuas transmisi pengoperasiannya bisa sangat mudah karena sistem yang dianut adalah shift-on-the-fly sehingga memindahkan dari mode 2h ke 4h bisa dilakukan hingga kecepatan 120 kmjamnamun untuk mengaktifkan low gear mobil harus dalam keadaan berhenti total dan transmisi dalam posisi netral barulah pengemudi dapat memutar switch ke posisi 4l dan menunggu sekitar 15 detik sampai lampu indikator di instrument cluster menyalatenaga besar yang dihasilkan mesin diesel colorado ini membuatnya terasa mudah untuk melibas segala medan off-road torsi yang besar di putaran rendah membuatnya memiliki kemampuan crawling yang sangat istimewa tanjakan maupun turunan dengan sudut kemiringan yang cukup besar pun mudah dilaluiuntuk suspensinya colorado patut diacungi jempol karena kemampuan jarak main travel suspensinya selalu memaksimalkan tapak ban ke tanah untuk memberikan traksi terbaik tapi soal kenyamanan ternyata karakter antara colorado high country dan lt memiliki rasa yang berbedacolorado high country bisa dibilang memberikan kenyamanan seperti sebuah suv seperti trailblazer namun memang tidak selembut trailblazer ini karena penggunaan per daun untuk suspensi belakang suspensi yang identik dengan mobil komersial ini sengaja dipilih chevrolet karena memang disasar peruntukannya untuk mengangkut beban berat di bagian baknamun untuk tipe lt suspensinya terasa lebih keras dibandingkan high country memang sepertinya hal ini dilakukan oleh chevrolet karena tipe lt difokuskan untuk fleet pertambangan yang tidak terlalu membutuhkan kenyamanan namun harus kuat dan mampu diisi dengan bobot yang lebih lebih ekstrim kesimpulanchevrolet colorado menjadi pilihan baru untuk konsumen yang mencari pikap dobel kabin untuk tipe high country menjadi yang dobel kabin yang paling bertenaga di jajaran dobel kabin yang ada di indonesia selain itu mobil ini tampil menjadi yang paling baru serta memiliki kemampuan off-road yang baik dan juga memberikan kenyamanan layaknya suv seutuhnya namun sayangnya colorado high country juga memiliki banderol yang paling mahal di kelasnya kelebihanmesin bertenagafitur melimpahkekuranganharga tergolong mahal high countrysuspensi terasa keras tipe lt spesifikasiharga  rp 517 juta tipe high country dan rp 405 juta tipe ltkapasitas mesin  2800 cc common rail dengan variable geometry turbocharger tipe high country dan 2500 cc duramax empat silinder fixed geometry turbo-diesel tipe lttenaga maksimum  200 ps dan 163 pstorsi maksimum  500 nm dan 380 nmtransmisi  otomatis 6 percepatan dan manual 5 percepatanpenggerak  four-wheel drive', 'first drive chevrolet colorado lt 2017'),
(73, 'apa yang ada dalam pikiran anda ketika melihat sesuatu yang berwarna merah apapun itu yang pasti segala hal yang identik dengan warna merah biasanya sesuatu yang berani dan cepat menarik perhatian lihat saja mercedes-benz c43 amg 4matic cabriolet yang sedang kami coba ini yang pasti mobil cabriolet ini sungguh sexy dan terlihat agresif membaca sejarah keluarga c-class jenis cabriolet ini baru diperkenalkan pada generasi kelima sejak era baby benz 190e w201 sampai di era w205 pabrikan asal stuttgart ini baru terpikir membuat tipe cabriolet di generasi ini hasilnya bisa anda nilai sendiri tak kalah keren dengan cabriolet dari trah keluarga mercy lainnya bukan yang membuat mobil cantik ini jadi semakin istimewa lagi adalah karena terlahir sebagai keluarga tuner resmi pabrikan mercedes-benz yaitu amg yup ini adalah amg c43 yang merupakan model terbaru dari trah model c-class berperforma tinggiini bukan pertama kalinya c-class dimodifikasi oleh amg sejak 1995 sudah hadir model c36 amg kemudian lanjut dengan seri c43 c55 dan terkini amg c63melihat interiornya kemewahan khas mercy langsung terasa begitu anda masuk dan duduk di jok model semi bucket elektriknya yang berlapis kulit dengan red stitching dan lapisan suede hitam di bagian tengah memberikan kesan mewah sekaligus sporty setir dengan balutan kulit juga mantap digenggam dan lapisan karbon kevlar di fascia tengah memberikan kesan sporty yang kuat untuk atapnya c-class cabriolet dibekali atap berbahan fabric yang mewah anda bisa membuka-tutup atap ini dalam waktu 20 detik bahkan bisa sambil berjalan dibawah 10 kpj demi alasan keamanan yang tak kalah mengagumkan kekedapan kabin tetap terjaga meskipun atapnya berbahan fabricamg c43 ini dibekali mesin konfigurasi v6 yang berkapasitas 2996 cc biturbo klaim pabrikan mobil ini mampu menghasilkan tenaga 367 dk di 5500-6000 rpm dengan torsi maksimum 520 nm di 2000-4200 rpm tak heran klaim pabrikan c43 amg mampu menembus 0-100 kpj dalam waktu 48 detik dan bisa mencapai top speed 250 kpj bandingkan dengan spek tertingginya yaitu c63 dengan mesin v6 30l biturbo yang memiliki tenaga 362 dk sebagai penyalur tenaga mesin ke roda transmisi 9g-tronic dengan sistem awd sudah menjadi standar untuk mobil ini ditambah lagi kehadiran sistem penggerak empat roda 4matic yang mendistribusikan torsi 3169 antara roda depan dan belakang membuat mobil ini semakin istimewa ketika bermanuveruntuk suspensi amg ride control dengan tiga tingkat pengaturan juga sudah menjadi fitur standar semuanya bisa dioperasikan melalui tombol pada konsol tengah tak hanya itu gardan belakang juga dilengkapi fitur elastokinematics untuk membuat berkendara jadi lebih dinamis selain itu tersedia lima mode pengendara dapat diatur melalui mode amg dynamic selectnah waktunya mencoba si merah yang dijual di showroom importir umum blinkz blinkz jakarta ini namun karena keterbatasan ruang untuk mencoba performanya kami harus puas dengan pengetesan yang seadanya kenyataannya begitu pedal gas dipijak dan raungan mesin biturbo ini menyalak bisa mengobati kekecewaan kamimelihat jarum spidometer dan rpm yang berlomba naik begitu pedal gas diinjak lebih dalam memberikan kepuasan tersendiri bahkan ketika kami mencoba bermanuver dengannya tak ada gejala bodyroll berlebih yang membuatnya terasa limbung semuanya terasa pas perfect', 'first drive mercedes-benz amg c43 2017'),
(74, 'kehadiran wuling yang menceburkan diri ke segmen lmpv cukup membuat heboh indonesia setahun belakangan tak main-main modalnya dalam menghadirkan sebuah produk lmpv pembangunan pabrik sampai penyebaran dealer pun dilakoninya dan akhirnya kami sudah menjajal produk perdana yang lahir dari pabrik wuling cikarang jawa baratdan akhirnya kami pun telah mendapat kesempatan menjajal confero satu-satunya produk wuling yang resmi meluncur pada tahun ini bahkan kami mendapat kesempatan menjajalnya sebelum confero resmi diriliswuling memang sejak awal memperkenalkan mpv-nya ini ingin menyasar pasar mpv yang saat ini dikuasai avanza-xenia di indonesia jadi anda bisa lihat wuling bahwa wuling memang membuat mobil ini sebagai mpv sejati dengan desain memanjang dan lebar khas mobil pengangkut tujuh penumpangkami juga sudah pernah membuat video first impression mobil ini saat diperkenalkan di giias 2016 dan anda bisa menontonnya di channel youtube otodriver atau klik link ini tapi tampilan wuling kini berubah jadi lebih manis di negara asalnya mobil ini baru saja melakukan facelift dan langsung diadopsi untuk pasar indonesiasejak menjajal confero di kawasan pantai mutiara jakarta sesjujurnya membuat kami sudah berkesan terutama pada sisi interior di confero tipe tertinggi terbilang sangat wah untuk sebuah lmpv wuling menerapkan material empuk pada bagian doortrim dan jok berbahan kulit juga melapisi ketiga baris joknyauntuk posisi mengemudi jok bagian pengemudi ini tidak bisa diatur posisi ketinggiannya sehingga anda tidak dapatkan posisi kenyamanan yang maksimal selain itu sistem pengaturan kemudinya hanya ada tilt steering namun yang paling berkesan adalah jok baris kedua yang bermodel captain seat dengan lebar bodi yang mencapai 1691 mm menjadikan kami saat jadi penumpang cukup puas belum lagi kai dimanjakan dengan colokan usb tapi sayangnya hanya ada satu maka jika dua penumpang baris kedua juga butuh isi daya gadget anda harus menyiapkan adaptor multi usb walau menyodorkan kemewahan dan kenyaman tempat duduk tapi cukup keliru jika anda memilih confero tipe tertinggi ini sebab tak seperti avanza dan kawan-kawan captain seat hanya mampu mengakomodir dua penumpang sajasatu yang juga tak dimiliki kompetitornya adalah fitur tire pressure monitoring system walau terbilang sepele namun cukup penting untuk memastikan tekanan angin di keempat ban dalam kondisi ideal ini demi konsumsi bahan bakar yang optimalunit yang kami tes ini adalah confero s yang dipersenjatai mesin 1500 cc empat silinder p-tec dvvt tenaganya 107 dk dengan torsi 142 nm daya tersebut disalurkan ke roda belakang alias rear wheel drive keuntungannya pun kami rasakan ketika melahap tanjakan mesin ini terasa halus dan tidak memiliki getaran yang mengganggu memang tendangan tenaganya tergolong biasa saja bisa jadi karena beban dari bobot keseluruhannya yang cukup gambot pada saat mengemudi confero di pantai mutiara kami juga mengangkut 3 penumpang dan kami dapat kesempatan memeras tenaganya mobil ini lagi di denpasar bali tapi lagi-lagi dengan muatan rekan 4 orang awak media nasionalmelahap jalanan denpasar yang cenderung lancar cukup menyenangkan apalagi kopling dan gas-nya cukup empuk tapi justru dari situ kami harus pandai-pandai gantung kopling agar akselerasi lmpv dengan rem cakram belakang ini bisa melesat sudut pandang dari bagian pengemudi yang memiliki posisi yang tinggi memang terasa mudah untuk mengontrol seluruh bagian mobil mpv ini namun ada hal yang sedikit mengganggu yaitu adalah sistem kemudinya yang terasa sangat ringan sehingga terasa melayang saat kami mengetesnya hingga 80 kmjam tapi justru sangat memudahkan pengedalian ketika manuver putar balik dan sejenisnyasatu hal yang jadi catatan kami confero punya bantingan suspensi yang kurang dewasa ketika dipacu di lintasan gravel nan bergelombang di daerah pantai serangan bali dimensinya yang gambot harus kami katakan kurang pas dengan karakter suspensinya setidaknya hindari ngebut di jalanan tak rata dengan mobil initapi ketika sudah kembali ke jalanan aspal mulus suspensi bekerja cukup baik kestabilan dan ayunan suspensi mobil merek china ini cukup untuk menina-bobo-kan para penumpang nilai positif juga didapat soal peredaman kabinnya raungan suara mesin dan juga suara angin serta suara yang berasal dari roda tidak terlalu tembus ke dalam kabin tapi lagi-lagi ini karena masih dicoba dalam jarak yang sangat pendek dan hanya mampu mencapai kecepatan maksimum 80 kmjamkesimpulandecak kagum harus kami akui setelah menjajal pendatang baru ini baik di jakarta maupun di bali ya apalagi kalau bukan karena harganya yang tergolong murah jika dibandingkan dengan seteru lmpv lainnya dengan modal kurang rp 200 juta anda sudah bisa merasakan kabin yang cukup wah tapi memilih confero maka anda harus melupakan kemudahan berpindah gigi sebab confero tak ada tipe transmisi otomatik-nya kelebihan1 kabin sangat lega dan cukup nyaman2 fitur keselamatan tergolong lengkap3 kopling dan gas halus saat diinjak kekurangan- tarikan awal kurang responsif- citra mobil cina yang masih melekat - kemudi terlalu ringan spesifikasiwuling confero s 2017kapasitas mesin 1500 cc 4 silindertenaga maksimum 107 dk  5800 rpmtorsi maksimum 142 nm  4400 rpmpenggerak rear wheel drivetransmisi manual 5 percepatan', 'first drive wuling confero s 15l'),
(75, 'kia grand sedona nama ini harus diakui masih belum bergaung di percaturan mpv indonesia namun bagaimana jika kia carnival mobil yang sempat booming di era awal 2000-an pasti tahu sosok mobil fenomenal asal korea selatan ini carnival merupakan large mpv pertama yang dihadirkan kia di indonesiakia grand sedona sendiri merupakan generasi penerus dari kia carnival dna sang mpv besar tersebut masih melekat pada grand sedona yakni mpv yang mampu mengangkut banyak penumpang bahkan hingga 11 orang penumpangdalam acara yang bertajuk kia media drive yang diselanggarakan di kawasan ancol jakarta pekan lalu kami berkesempatan menjajal grand sedona generasi terbaru yang pertama kali diluncurkan 2016 silam seperti apa impresi berkendara penantang hyundai h1 inisaat melihat bagian eksteriornya menurut kami desainnya menarik sesuai prinsip kia yang menciptakan mobil kelas dunia grand sedona tampil dengan garis-garis serta lekukan yang membuatnya begitu menawan bahkan memiliki aura khas mobil eropasaat menyandarkan badan di kursi pengemudi rasanya anda seperti mengendarai sebuah mpv yang berukuran tidak terlalu besar berkat posisi mengemudi yang sangat ergonomis tak hanya itu dimensi atap yang tidak terlalu tinggi juga dapat membuat anda lupa bahwa grand sedona ini adalah mpv gambot melihat layar instrumennya anda akan disajikan sebuah panel yang menganut multi information display dan sangat informatif selain itu tombol-tombol pengaturan audio pengontrol mid dan cruise control tergolong mudah dioperasikan jari-jari sambil berkendaraketika mobil ini dijalankan ada 1 hal yang membuat kami takjub ya handling dari grand sedona ini luar biasa meski berbodi bongsor namun penerus kia carnival ini memiliki gejala body roll yang sedikit ketika melahab tikungan selain itu karakter suspensinya bisa dikatakan cukup dewasa tidak terlalu keras juga tidak terlalu empuk bahkan ketika berkendara di kondisi jalan rusak sekalipun mobil korea selatan ini masih tergolong nyamanpuas melakukan manuver kini saatnya menekan pedal gas sedalam mungkin seketika itu juga jeritan suara mesin khas v6 meraung performanya pun impresif meski kami tidak melakukan pengetesan dengan menggunakan alat penghitung berbasis gps namun kami merasakan akselerasi', 'first drive kia grand sedona 2017'),
(76, 'siapa yang tak asing dengan merek porsche ya pabrikan supercar ternama asal stuttgart jerman ini merupakan sebuah brand yang cukup sukses dengan menciptakan jajaran mobil-mobil supernya selain performa yang dihasilkan porsche selalu melansir model yang memiliki desain eksterior yang bisa dibilang sangat khasdalam acara yang bertajuk porsche media picnic drive kami memilih mengendarai sebuah supercar terbaru keluarannya yakni porsche 718 boxster mengambil rute dari porsche jakarta center jakarta selatan hingga bsd tangerang selatan otodrivber tempuh untuk emrasakan sensasi the boxster inisaat melihat bagian luarnya desainnya sangat menawan perpaduan antara lekukan garis di sekujur bodi serta atap kanvas berlapis kevlarnya mampu menarik perhatian banyak orang tak perlu berlama-lama kami pun langsung masuk ke ruang kabinnyaketika memasuki ruang interior dan menyandarkan badan di jok anda akan merasa nyaman berkat jok kemudi yang empuk dan lebar serta posisi mengemudi yang sangat ergonomis saat melihat layar instrumen mobil ini memiliki desain instrumen khas porsche akan tetapi kini dipadukan dengan sebuah layar mid canggih yang dapat menunjukkan berbagai data musik yang sedang diputar hingga sistem navigasisaat menggenggam lingkar kemudinya terasa mudah digenggam sebab setir ini memiliki diemater yang lebih kecil dibandingkan versi lawas fitur hiburannya pun juga bisa dibilang up to date pasalnya sistem hiburannya mampu memanjakan pengguna dengan berbagai fungsi di antaranya apple car play mirroring dan car wi-fiberalih ke bagian atap buka tutup atapnya bisa dibilang sangat cepat pihak porsche mengklaim mekanisme ini hanya membutuhkan waktu kurang dari 20 detik saja saat membuka penuh maupun mentup sempurnatak sabar kami pun langsung memacu boxster 718 ini menyusuri padatnya jalanan ibu kota rasanya luar biasa sebab jika anda mengemudikannya di kemacetan sekalipun pengemudi akan tetap merasa nyaman dikarenakan jok kemudi yang empuk serta posisi duduk yang sangat ergonomisselain itu juga tidak adanya hentakan layaknya supercar ketika mobil berada di konsisi berkendara stop and go hal ini senada dengan klaim pihak porsche bahwa produknya bisa diandalkan untuk meghadapi kepadatan di kota-kota besar di indonesianamun ketika berada di jalanan yang lengang kami pun langsung menekan pedal gas dalam-dalam performanya menakjubkan jambakan dari mesin berkapasitas 2500 cc turbo bertenaga 345 dk dipadu dengan transmisi otomatis pdk sport chrono mampu membuat punggung menempel cukup lengket dengan sandaran jok bahkan saat diadu dengan porsche 911 carrera pun boxster 718 ini mampu melesat bersamaan hingga kecepatan 150 kmjam dan akhirnya meninggalkannyahal ini berkat bobot boxster yang jauh lebih ringan dibandingkan 911 carrera selain itu porsche mengklaim bahwa 718 boxster mampu menghasilkan akselerasi 0-100 kmjam dalam waktu 42 detik sajadisamping itu ketika diajak bermanuver boxster mampu melahap berbagai tikungan dengan baik namun sayangnya kami tidak melakukan pengetesan di trek tertutup sehingga kami pun tidak dapat mengetes mobil ini secara maksimal kesimpulanporsche 718 boxster merupakan salah satu sport compact yang merupakan entry level dari jajaran produk-produk porsche desain eksteriornya sangat menawan serta kemampuan akselerasi tergolong baik tak hanya akselerasinya versi atap terbuka dari porsche cayman ini juga memiliki kemampuan menikung yang kami rasa sangat baik selain itu mekanisme atap terbuikanya juga impresif hanya memakan waktu kurang dari 20 detik atap konvertibelnya mampu membuka maupun menutup dengan sempurna sangat pas untuk anda yang mencari mobil kencang sekaligus atraktif kelebihan1 akselerasi mantap2 handling yang baik3bertabur fitur-fitur canggih4 pengoperasian atap terbuka yang cepat kekurangan1 suara dari luar kurang bisa diredam dengan baik2 visibilitas terbatas ketika atap tertutup spesifikasiporsche 718 boxsterharga  rp 19 milyar estimasikapasitas mesin  2500 cc flat 4 turbotenaga maksimum  345 dktorsi maksimum  420 nmtransmisi  otomatis 7 percepatan dual clutch pdkpenggerak  roda belakang', 'first drive porsche 718 boxster 2017'),
(77, 'mobil mungil satu ini adalah saudara dari pabrikan mobil eropa kenamaan yaitu mercedes-benzyup smart yang pernah hadir meramaikan pasar otomotif indonesia beberapa tahun silam ini kembali hadir melalui gerai importir umum ivans motor yang bermarkas di kawasa sunter jakarta utara bukan sekedar smart fortwo biasa tapi smart brabus ya tuner brabus ini adalah rumah modifikasi khusus mercy dan smartapa saja perbedaan smart brabus ini dibandingkan smart standar yang pasti bodi-kit sudah pakai lansiran brabus pelek brabus knalpot brabus dan di interior anda akan melihat shiftknob dan tuas handbrake bertuliskan brabus tak terkecuali sektor mesinnya brabus telah memodifikasi unit 3 silinder 898 cc dengan turbo sehingga mampu menghasilkan tenaga sampai 109 dk brabus pun berani mengklaim mobil dua pintu ini bisa menempuh', 'first drive smart fortwo brabus 2017');
