(78, 'segmen penjualan double cabin di indonesia yang bisa dibilang stagnan tak menyurutkan pt tata motors distribusi indonesia tmdi meluncurkan xenon d-cab buatan india ini meluncur pada giias 2016 lalu dan sampai sekarang memang belum terdengar gaungnyapasalnya tmdi memproyeksi xenon xt sebagai kendaraan andalan operasional di perusahaan-perusahaan perkebunan maupun tambang tentunya bukan hal mudah bagi tmdi mewujudkan proyeksi tersebut sebabnya kompetitor xenon xt yang rata-rata d-cab merek jepang punya nama yang lebih harum di kalangan pengusaha perkebunan dan tambangberuntung otodriver mendapat kesempatan merasakan performa xenon xt di trek off road atas ajakan tmdi 163 lantas apa yang membuatnya lebih unggul dari pada d-cab merek jepangjangan lihat tampangnya yang terbilang serius jika anda berniat memiliki xenon xt untuk mobil harian di perkotaan tapi kenyamanan dan fiturnya yang standar d-cab harusnya mampu menunjang aktivitas harian yang tak mementingkan sebuah mobil stylishjok dibungkus dengan fabric bercorak dan warna gelap yang pas untuk habitat aslinya ia bakal tak mudah terlihat kotor walau aktivitas penumpang dan pengemudi di hutan atau situs proyekyang menarik dan tak ditemui di mobil pada umumnya kantung udara di sisi penumpang depan bisa disetel aktif tidaknya ini bisa digunakan ketika mobil hanya ditumpangi 1 orang pihak tmdi menyebut hal ini jadi penekan biaya perbaikan jika terjadi kecelakaan karena hanya satu airbag yang mengembang bagian pengemudi walau tak tersedia kantung udara penumpang di jok belakang mendapat sabuk pengaman tiga titik selain itu tata juga menyediakan penyetelan elektris lampu utama pengemudi bisa menyesuaikan sorot lampu xenon xt untuk membantu visibiltas saat berkendara malam sayangnya lampunya masih halogenkarena targetnya jadi pekerja keras maka untuk kelengkapan hiburan sifatnya additional tak tersedia radio maupun pemutar musik di dasbor mobil yang dilengkapi rem ber-abs initak sabar menjajalnya di trek off road buatan otodriver langsung ambil ancang-ancang di balik kemudi tapi ternyata xenon xt putih ini tak diperbolehkan tmdi mencicipi off road tersedia xenon xt modifikasi ringan khusus untuk kami merasakan berbagai handicap off road xenon xt yang sebagian bodinya dibungkus cutting sticker ini mendapat ubahan berupa penggantian bumper depan custom ban pacul spek off road dan peninggian sok depan sebanyak 5 cm tmdi mengklaim tak melakukan ubahan di sektor mesin xenon xt iniokay otodriver pun percaya diri melintas tiap rintangan tak seperti d-cab 4wd lainnya pemilihan mode penggerak xenon xt ada di sisi kanan kemudi dan bisa diubah moda penggeraknya sembari berjalanxenon xt tak menganut transmisi constant mesh seperti mobil pada umumnya transmisi 5 percepatannya pakai tipe g76 system yang membuat perpindahan gigi tak sekalipun kami rasakan kasar di lain sisi torsinya memang terasa kuatpada mode 4h di gigi 1 kami bahkan tak perlu menginjak pedal gas dan kopling saat merayap di trek berbatu menanjak dan menyusuri sungai buatan saat tenaga momen melaju mulai hilang karena ban tersangkut batu kami bahkan hanya sedikit saja menekan pedal gas untuk membuatnya tetap melaju hal itu karena xenon xt punya rasio gigi yang cukup besar dan tentunya ditunjang oleh tenaga dan torsi yang mumpuni tercatat di data spek tenaganya 148 dk di 4000 rpm dan torsinya mencapai 320 nm yang sudah diraih sejak 1500 rpm bukan omong kosong pada tanjakan ekstrem xenon xt sama sekali tak menemui kesulitan berarti untuk melahapnya sekali lagi kopling tak kami injakmesin turbo diesel 2200 cc berteknologi variabel geometris elektrik tentunya berperan penting dalam penyajian performa tersebut teknologi tersebut prinsip kerjanya serupa dengan vgt pada mesin toyota fortuner turbo-nya yang dilengkapi motor elektrik membuat kinerja semakin presisi dan menghilangkan gejala turbo lag otodriver yang selain mencoba sebagai pengemudi dan penumpang di bangku belakang tak merasakan guncangan berlebih dari mobil yag pakai per daun di roda belakangnya ini suspensi depan juga sudah dilengkapi torsion bar yang diklaim tmdi bebas perawatan untuk mendukung handling xenon xt juga sudah dilengkapi limited slip diferential lsd yang otomatis bekerja saat diperlukan kesimpulantmdi sangat berharap xenon xt bisa bermanfaat sebagai kendaraan operasional di trek tanah yang rata atau berkerikil tapi dengan performanya yang mengesankan masuk trek off road yang cukup berat pun harusnya bisa diemban olehnya sayangnya xenon xt bukanlah d-cab bertampang rupawan seperti rata-rata kompetitornya  kelebihan- performa mesin mumpuni- suspensi nyaman- transmisi haluskekurangan- desain terlalu standar- minim fitur hiburan- citra merek yang harus dibangun kembali spesifikasitata xenon xtharga rp rp 320 juta otr dki jakartakapasitas mesin 2200 cc 4 silindertenaga maksimum 148 dk4000 rpmtorsi maksimum 320 nm1500 rpmtransmisi manual 5 percepatanpenggerak four wheel drive', 'first drive tata xenon xt 2017'),
(79, 'chevrolet indonesia sempat memperkenalkan generasi baru dari suv mereka yaitu all new chevrolet trailblazer pada ajang giias 2016 namun saat itu mereka belum menjualnyanah februari 2017 ini merek asal amerika serikat tersebut meluncurkannya di kempinski hotel jakarta pusat tadi siang 232 namun sebelum diluncurkan chevrolet mengajak para awak media untuk mengujinya lebih dahulu di kawasan sekitar sentul bogor 222otodriver juga diajak merasakan mobil yang akan menjadi rival dari mitsubishi pajero sport toyota fortuner dan isuzu mu-x sebelumnya pihak chevrolet sudah pernah mengajak otodriver untuk juga dapat merasakan all new chevrolet trailblazer ini di provinsi cebu filipina namun saat itu kami hanya dapat merasakan varian bermesin 2800 ccvarian tersebut berbeda dengan yang akan diluncurkan karena untuk pasar indonesia hanya akan mendapatkan mesin 2500 cc duramax vgt turbo diesel mesin tersebut memuntahkan tenaga yang besar berkisar 180 ps dengan torsi 440 nm ini adalah nilai torsi yang paling tinggi di segmennya ungkap yuniadi haksono hartono selaku chevrolet external affairs  pr director gm indonesiachevrolet membuat sejumlah rute yang memiliki kontur menanjak terjal dan ternyata torsi besar trailblazer memang benar terasa karena mobil ini tidak perlu bekerja keras untuk melahap tanjakannya ada fitur lain yang sangat membantu saat akan mulai menanjak yaitu hill assist control sehingga di saat mobil tidak akan mundur ke belakang karena rem akan bekerja secara otomatis menahan mobil selama 3 detik untuk membantu memberi waktu kepada pengemudi memindahkan kaki dari pedal rem ke pedal gasbegitu juga saat menuruni tanjakan ada fitur yang menjadi standar trailblazer tipe ltz ini yaitu down hill assist yang secara otomatis bekerja saat menuruni tanjakan dengan menahan laju mobil agar tidak tergelincir fitur ini akan lebih berguna lagi saat menuruni jalanan yang konturnya rusak serta licin karena akan mengerem satu-persatu rodanya untuk bisa memberikan traksi yang baik dan tidak tergelincirselesai mencoba fitur-fitur dan tenaga mesinnya di tanjakan kami dipersilakan untuk istirahat sejenak serta melihat bagian eksterior suv ini dengan seksama dari tampilan eksteriornya bagian depan mobil ini benar-benar tampil berbeda dibanding sebelumnyahadir dengan desain kap mesin bumper gril dan lampu utama baru yang kini dilengkapi juga dengan day running light drl led sayangnya walaupun sudah hadir dengan drl tetap saja tidak dilengkapi dengan sistem penerangan utama led ataupun hid seperti rivalnya pajero sport dan fortunertapi untuk di bagian samping tidak ada perubahan signifikan karena hanya desain pelek yang berubah serta kini berdiameter 18 inci sebagai standarnya selebihnya tidak ada yang berubah satu pun dengan versi sebelumnyasedikit yang disayangkan pula pada bagian belakangnya karena tampilannya lagi-lagi tidak ada yang berubah satu pun dengan desain yang masih sama total dengan generasi sebelumnya hingga desain lampu belakang led-nya masih sama sajaselesai beristirahat kami diajak kembali untuk melanjutkan perjalanan untuk dapat merasakan sensasi lainnya tapi sebelum memulai perjalanan kami diminta untuk merasakan fitur remote start yang dimana memungkinkan sang pemilik untuk menyalakan mobil dari remote kuncinya mobil ini akan menyala selama 10 menit dan mengaktifkan sistem pendingin mobil pada temperatur 25 derajat celciustapi walaupun mesin sudah menyala anda juga tidak perlu khawatir mobil akan hilang dibajak oleh orang karena pintu mobil tetap dalam keadaan terkunci dan apabila orang memaksakan masuk ke dalam mobil ia tidak akan mampu melakukan perpindahan tuas transmisinya karena tetap terkunciuntuk bisa memulai perjalanan anda harus membuka door lock dari remote kemudian memasukan anak kuncinya ke slot kunci kontak lalu putar ke posisi on agar mobil dapat dioperasikan secara normaldalam kabinnya hadir dengan dashboard berdesain baru yang langsung mencuri perhatian ini menjadi salah satu kelebihan dari trailblazer baru karena desain dasbornya yang lebih modern dengan gaya khas amerika yang kuat mulai dari kisi-kisi ac tombol-tombol tuas perseneling yang berukuran serba besar interior dengan balutan kulit warna coklat tua juga menambah kesan mewah bercampur dengan sedikit aksen aluminium pada panel pintu tuas perseneling dan konsol tengah dan juga ada panel berwarna hitam solidpada instrumen banyak informasi yang ditampilkan mulai dari odometer trip meter rata-rata konsumsi bahan bakar posisi tuas transmisi tekanan angin tiap roda jumlah penumpang yang duduk serta yang sudah menggunakan seatbelt dan informasi lainnya semuanya ini diakses dari tuas lampu sen ini sangat lengkap jika dibadningkan dengan rival-rivalnyafitur audionya hadir dengan head unit touchscreen 8 inci yang berteknologi chevrolet mylink dengan fitur mulai dari radio cd usb aux apple carplay dan android auto pengemudi juga dapat mengakses dengan mudah dari tombol yang berada di sisi kiri lingkar kemudi mulai dari volume track dan juga ada voice commanduntuk sisi kanannya terdapat pengaturan cruise control dan pengaturan tingkat sensitivitas fitur collision alert fitur ini berguna untuk memberikan peringatan kepada pengemudi saat mobil di depannya mengerem mendadak ia akan memberitahu dengan suara serta lampu berwarna merah yang akan terlihat di kaca depan bagian supirtidak mau berlama-lama saya langsung mengatur posisi duduk yang sesuai karena posisi duduk saya tadi sudah berubah pengaturannya dapat dilakukan dengan mudah karena diatur secara elektris khusus untuk bagian pengemudisaat mulai berjalan suspensinya terasa berbeda dengan generasi pendahulunya sebagai sebuah suv ladder frame biasanya permasalahan yang hadir adalah soal kelimbungan tapi ternyata ini tidak terlalu terasa karena mounting yang menghubungkan antara bodi dan sasis memiliki desain baruhal ini sempat disampaikan oleh vanchana unakul selaku general director of engineering gm thailand  southeast asia saat saya mencoba mobil ini di filipina karena jika sebelumnya menggunakan dua tumpuk karet kini menggunakan satu buah karet saja namun karet tersebut dilapisi dengan plat sehingga gejala limbung pun berkurangputaran kemudi juga terasa sangat ringan karena suv besar ini dilengkapi electronic power steering eps namun eps ini juga bekerja secara otomatis menambah beban setir menjadi berat secara perlahan saat memasuki speed tinggi di mobil sport penggunaan eps mungkin kerap digugat karena mengurangi feeling berkendara tapi di suv besar seperti ini eps menjadikan pengendaraan lebih mudah terutama ketika harus bermanuver di celah sempit chevrolet juga mengklaim kalau trailblazer facelift ini merupakan suv pertama di kelasnya yang memakai power steering elektriksoal harganya untuk tipe yang kami coba ini adalah tipe ltz yang merupakan tipe tertinggi dan dijual dengan harga rp 455 juta sangat menarik kesimpulanthe all new chevrolet trailblazer ini bakal menjadi pesaing kuat dari dua nama besar suv ladder frame di indonesia yaitu pajero sport dan fortuner harganya kompetitif serta fitur jelas terlengkap di segmennya kehadiran konektivitas apple carplay dan android auto radar pemantau sekitar remote start engine hill descend control dan mesin bertorsi paling besar membuat ia memiliki value for money sangat baik spesifikasichevrolet the new trailblazer 25 duramax vgt turbo 4x2 kapasitas mesin  2500 cc turbo dieseltenaga maksimum  180 pstorsi maksimum  440 nmtransmisi  otomatik 6-speedpenggerak  rear wheel driveharga  rp 455 juta', 'first drive chevrolet trailblazer ltz 25 duramax'),
(80, 'segmen hatchback city car kembali bergeliat setelah didatangi pemain baru yaitu proton iriz dibaca airiz 1300 cc mobil yang di negara asalnya malaysia juga punya varian 1600 cc ini harus diakui membawa berbagai keunggulan yang tak dimiliki pesaingnyasetelah seremonial peluncuran iriz di fx mall senayan jakarta pusat 192 lalu otodriver mencoba jajal mobil yang akan bertarung melawan honda brio rs nissan march mitsubishi mirage dan sebagainya sejak awal melihat wujud iriz langsung terlintas di pikiran bahwa ini adalah honda brio yang sedikit gemuk memang kami akui ungkapan itu agak memaksakan karena walau punya area buritan yang secara vertikal nyaris rata mirip rivalnya dari honda itu tapi kaca belakangnya tak sebesar brio secara keseluruhan dimensi iriz juga lebih besar dibanding brio tapi sekali lagi jika diperhatikan seksama tarikan desain bodinya mirip city car honda tersebutsaat memandangnya dari depan tampangnya memang keren apalagi lampu utamanya yang sudah mengadopsi tipe proyektor sorot lampu depan ini juga bisa diatur oleh pengemudi secara elektris sayangnya ia belum dilengkapi drl maupun lampu kabutcoba masuk ke dalam melihat bagasinya sepertinya ia punya kapasitas lebih besar dibanding mirage sayangnya kami belum bisa menguji kapasitas bagasi tersebut tapi dalam klaim di brosurnya bagasinya bisa menampung dua koper ukuran sedangmencoba duduk di dalam jok penumpang kesan pertama adalah kelapangan kabin yang tak seperti city car sekelasnya dengan panjang keseluruhan mobil ini yang 3920 mm dengan lebar 1722 mm dan tinggi 1554 mm otomatis menjadikannya yang terbesar di kelasnya desain dan finishing panel interior iriz juga terbilang rapih dan apik ditambah empuknya jok semakin membuat penumpang betah bagi yang membawa anak balita iriz juga menyediakan kaitan isofix dan tether di bangku penumpang sayangnya sandaran kepala bangku penumpang belakang modelnya fixed bila anda berpostur tinggi headrest ini tak memiliki fungsi mengamankan tapi kepraktisannya baik layaknya hatchback bangku ini juga bisa dilipat dengan konfigurasi 6040 untuk mendukung kapasitas bagasicukup merasakan kabin belakang maka otodriver melompat ke balik kemudi sangat menarik bangku di depan sudah model semi bucket dan dibungkus material fabric dengan jahitan yang rapi satu yang mengganjal adalah model audionya yang meski 2-din tapi tak ada layar ini membuat kurang selaras dengan trend sekarang yang mengedepankan sistem multimedia dengan layar sentuh besar tapi setidaknya ia bisa memutar beragam platform musik digitalpenasaran akan sumber tenaganya maka mesin pun kami nyalakan suara dan getaran yang halus diredam dengan baik pula oleh kabin saat tuas diposisikan ke d mobil pun dengan dinamis melaju setir yang ringan saat keluar parkiran dan tarikan yang cenderung smooth terasa cukup memuaskan karakter ini cocok bagi pengemudi pemula atau wanitabegitu bertemu jalan lurus maka langsung saja pedal gas mulai ditekan lebih dalam transmisi cvt yang dimiliki iriz memang tak bisa digolongkan rasa sport anda harus pandai mengatur mengambil momentum yang pas agar akselerasi diraih dengan maksimal tapi begitu memasuki putaran menengah tenaga dari mesin yang diklaim racikan lotus ini sangat baik melesatkan mobil berbobot 1150 kg ini tenaga 93 dk memang tergolong baik untuk di kelasnya yang membuatnya semakin menyenangkan untuk dikendarai adalah karakter suspensinya yang lembut tapi saat menikung dalam kecepatan menengah suspensi tipe macpherson strut dengan stabilizer bar sangat baik menjaga mobil tetap mantap dalam posisinyaredamannya juga oke saat mobil melibas polisi tidur maupun jalanan jelek seolah tak mau nanggung proton memberikan beragam fitur yang mendukung performa seperti electronic stability control esc dan traction control tc sayangnya kami belum bisa mengeksplorasi lebih dalam mobil dengan mesin berteknologi vvt ituuntuk review lebih komprehensif proton iriz ini akan kami sajikan dalam video review yang akan tayang dalam beberapa waktu mendatang  kesimpulanharus diakui proton iriz menawarkan sensasi mengemudi yang cukup menyenangkan ditambah detail finishing iriz yang rapih juga jadi hal yang harus diapresiasi dari mobil cbu malaysia ini dengan harga rp 185 jutaan konsumen tentunya akan terpuaskan dari deretan fitur yang sangat bermanfaat mulai dari esc hill assist sampai bangku semi bucket ala mobil balap siap memukau konsumen  kelebihan- performa mesin dan suspensi terasa responsif- detail interior bagus- bertabur fitur- eksterior menarik kekurangan- tampilan audio - belum ada lampu kabut- citra merek yang harus dibangun kembali spesifikasiproton iriz 13l cvt 2017harga rp rp 185283000kapasitas mesin 1332 cc 4 silindertenaga maksimum 93 dk5750 rpmtorsi maksimum 120 nm4000 rpmtransmisi otomatik cvtpenggerak front wheel drive', 'first drive proton iriz 13l 2017'),
(81, 'pt bmw group indonesia baru saja memberi kesempatan otodriver untuk menjajal satu produk barunya yaitu seri-7 yang kini menjadi program yang diutamakan sepanjang tahun 2017 dalam kegiatan ini disediakan 2 varian sekaligus yaitu 730 li yang sudah dirakit di indonesia dan varian 740 li yang menjadi top of the line dan dalam status cbutahun 2017 ini kami akan lebih fokus pada produk high end kami yaitu seri-7 walaupun hadir dalam ckd dan cbu bukan artinya ada perbedaan kualitas namun kami ingin memberikan pilihan bagi konsumen untuk bisa menyesuaikan kebutuhannya tutur jodie otania selaku vice president marketing communication bmw group indonesiakami langsung penasaran untuk mencoba versi ckd yaitu 730 li impresi pertama melihat varian ini jika dilihat tidak secara seksama tidak ada perbedaan signifikan di eksteriornya bahkan kami pun cenderung tidak menyadarinya kalau ada perbedaanternyata di bagian eksterior ada perbedaan dan yang paling signifikan adalah desain pelek double spoke berukuran 19 inci yang membuat 730 li lebih terlihat sporty ketimbang 740 li yang terlihat lebih elegan dengan pelek berdesain jari-jariselain itu perbedaan juga terlihat pada panel-panel krom yang berada di bumper depan dan belakang karena untuk 740 li dilengkapi dengan aksen krom yang lebih banyak dibandingkan dengan seri 730 li namun banyak orang awam pun yang tidak bisa langsung menyadari hal inimasuk ke dalam interiornya saat duduk di bagian depan kami masih merasakan kemewahan yang sama seperti model teratasnya 740 li yang sudah pernah kami tes pengaturan posisi duduk yang bisa dilakukan secara elektrik sehingga terasa lebih mudah untuk mendapatkan posisi nyaman kami pun siap membawa jalan sedan mewah rakitan lokal ini dengan jarak tempuh kurang lebih 613 km pada hari itu dengan rute jakarta - cirebon - bandungnamun setelah berlama-lama melakukan perjalanan dari jakarta menuju cirebon barulah perbedaan terasa saat menyalakan ac memang tidak ada perbedaan dalam mengatur pendingin kabin ini tapi saat mencari fitur pengharum kabin serta ionic ternyata fitur tersebut absen di mobil iniselain itu kulit yang melapisi seluruh interior 730 li adalah tipe dakota yang sama seperti pada bmw x5 kulit ini lebih bertekstur kasar dibandingkan dengan nappa leather yang hadir pada 740 li begitu juga di bagian plafon 730 li yang menggunakan pelapis berbeda karena 740 li menggunakan suede alcantarakegiatan first drive bermasa beberapa awak media nasional ini kebetulan mengambil rute jakarta menuju cirebon melalui tol cipali cocok untuk merasakan sensai performa dapur pacunya mesin 2000 cc empat silinder turbo yang menghasilkan tenaga 258 dk dengan torsi 400 nm sebenarnya sempat kami khawatirkan bakal tak memberikan performa yang impresif untuk mobil yang memiliki bobot 1795 kg ini tapi dugaan itu ternyata salah besarlecutan tenaga mobil ini masih terus terisi dari putaran bawah hingga menengah ke atas yang terbantu berkat transmisi otomatis 8 percepatannya girboks ini sangat responsif sehingga penyaluran tenaga dari mesin ke roda selalu tersalurkan dengan baik melakukan overtaking ketika berada di kecepatan 120 kmjam pun sangat mudah dilakukan bmw mengklaim bahwa 730 li ini mampu berakselerasi dari', 'first drive bmw 730li ckd 2017'),
(82, 'renault kwid yang resmi meluncur di indonesia beberapa bulan lalu memang bukan ber-skema low cost green car atau yang tenar dengan singkatan lcgc tapi karena spesifikasi dan harganya yang tergolong ekonomis maka mau tak mau kwid bergesekan dengan lcgcberbagai menu unggulan pun disuguhkan kwid untuk memalingkan konsumen lcgc belum lagi konsep desain mobil mungil ini yang beda dari lainnya mobil yang dibuat secara utuh di india ini menerapkan gaya crossover pada bahasa desainnyaaura crossover bisa langsung terbaca dari penggunaan fender yang pakai aksen hitam doff menariknya pada fender depan terdapat lampu sein detail kecil yang membuatnya terlihat kerenwalau disebut mini crossover tapi dengan ground clearance 180 mm tak diimbangi dengan ban yang proporsional setidaknya keempat bannya kurang kekar secara visual alias pandangan mata ukurannya juga mini 15580 r13desainnya secara keseluruhan memang bisa dibilang menarik tapi karena memang di negara asalnya india kwid merupakan sebuah mobil yang dibuat supaya murah maka tak jarang ditemui detail yang kurang klik belum masuk ke dalam kabin reduksi fitur sudah terlihat kaca depan hanya dilengkapi satu bilah wiper sedangkan kaca belakang tak ada wiper maupun elemen anti embuntapi begitu masuk kabin kesan mobil murah seketika hilang setelah mata disapa indikator full digital apalagi layar sentuh 7 inci juga siap memanjakan pengemudi dan penumpang mulai dari radio ipod usb aux navigasi yang bisa update via usb hingga bluetooth mantap diemban oleh monitor tersebut ini istimewa untuk ukuran mobil seharga lcgcuntuk desain jok tak ada masalah lumayan empuk tapi untuk bangku pengemudi otodriver agak kesulitan menyetel posisi maju - mundur mungkin mekanisme relnya perlu diberi tambahan gemuk agar lancarkwid juga memberikan beraneka tempat penyimpanan wadah botol koin dan laci di dasbor lengkap tersedia satu hal yang unik adalah tombol power windownya renault tidak memposisikannya di daun pintu ini membuat pemakaiannya memang agak canggung namun pengemudi lebih mudah mengatur jendela kiri bila tak ada penumpangmencoba duduk di bangku belakang juga memberikan sensasi tersendiri tapi sekali lagi jangan kaget karena untuk buka tutup kaca penumpang belakang harus memutar engkol meski begitu penumpang juga masih merasakan dengan baik hembusan kesejukan ac yang ditiup dari depanbangku belakang juga bisa dilipat untuk memberi tambahan ruang bagasi sayangnya proses pelipatan terbilang agak keras jika tak mau disebut susah tiap ujung bahu jok belakang harus ditarik kemudian dilipat bersamaan agar bisa menekuk sempurnauntuk urusan angkut barang di bagasi juga terbilang oke tersedia juga penutup bagasi agar barang bawaan tak terlihat lantas kapasitasnya yang 300 liter tergolong sangat besar sebuah koper ukuran besar yang bisa membawa perlengkapan berlibur seminggu saja muat dengan mudahpuas menelisik kabinnya otodriver pun mencoba berada di balik kemudi suara khas mesin tiga silinder yang diusungnya masih dalam batas kewajaran saat masuk ke dalam kabin oh ya kwid juga dilengkapi penyetel sorot lampu depan mau arah sorot ke atas atau bawah pengemudi tinggal mengaturnya dari kenop yang agak merepotkan penyetelan spion masih manual dan harus dari luarkopling cukup ringan diinjak tapi saat pertama melaju getaran mesin 3 silinder membuatnya sulit untuk halus ketika setengah kopling melaju di gigi pertama tarikannya memang oke di putaran atas tenaganya sangat galak dan mesin terdengar seakan siap melaju kencang kami belum melakukan pengetesan 0-100 kmjam di first drive ini namun seharusnya menorehkan hasil baikkemudi mobil bertransmisi manual 5 percepatan ini sangat enteng getaran jalan pun tak terasa electronic power steering ini juga sangat memudahkan saat parkir di tempat sempit manuver maju - mundur maupun belok patah-patah sangat mantap diemban apalagi ditunjang dimensinya mobil ini yang ringkasmenjajalnya di trek lurus respon akselarasi kwid bermesin 1000 cc ini memang terasa oke tapi kami masih berpikir dua kali saat akan membawa mobil yang pakai ban ukuran 15580 dengan pelek 13 inci menikung kencang apalagi kwid yang punya berat sekitar 700 kg ini belum dilengkapi abssecara singkat mobil ini memang layak untuk harganya yang rp 1177 juta meski begitu kami tetap akan melihat bagaimana rasa dan performanya ketika diajak berjalan dalam jarak jauh untuk ulasan lebih detail dan komprehensif nantikan video review renault kwid yang sedang kami produksi nanti akan kami tayangkan setelah beres pastikan anda sudah subscribe ke channel youtube oto driver kesimpulanrenault kwid yang dijual dalam harga sekitar rp 117 jutaan memang jadi pendobrak segmen lcgc tapi karena ia cbu dari india dan di sana memang diciptakan sebagai mobil ekonomis maka jangan kaget melihat finishing touch dari bagian produksinya tapi dengan fitur-fitur yang diusung tentunya mampu mengejutkan penggunanya tak sampai keluar uang rp 120 juta sudah bisa punya mobil eropa ehmm bermerek eropa maksud kami layak untuk anda tunggu video review kami nanti kelebihan- harganya ekonomis- fitur hiburannya bagus- ac dilengkapi berbagai penyetelan- instrumen digital- bagasi legakelemahan- beberapa material dan finishing tak rapih- getaran mesin 3 silinder - tanpa penyetelan spion elektrik spesifikasirenault kwid 2017 mtharga rp 1177 jutakapasitas mesin 999 cc cc 3 silindertenaga maksimum 67 dk5500 rpmtorsi maksimum 91 nm4250 rpmtransmisi manual 5 percepatanpenggerak front wheel drive', 'first drive renault kwid mt 2017'),
(83, 'melanjutkan sport coupe yang setahun lalu diluncurkan audi yakni tt generasi terbaru akhirnya di pertengahan 2016 merek asal jerman itu kembali meluncurkan varian yang lebih bertenagaadalah audi tts yang kini membopong mesin 2000 cc dan output tenaga lebih besar kian membuat otodriver penasaran beruntung kami dapat kesempatan mengenal mobil rupawan ini di kantor pusat audi indonesia jakarta selatanmemang hanya sekedar impresi saja saat membawanya pun hanya di area kompleks indomobil tapi terasa puas untuk mengenal tts dengan dimensi yang terbilang ringkas untuk sebuah sport car kami lebih senang menyebutnya sebagai mobil yang cantik ketimbang tampan tapi bukan berarti tts tak punya aura galak lampu depannya yang masih sama seperti tt seolah memadukan karakter kuat nan futuristik apalagi lampu led nya saat mode siang alias drl membetuk pola garis l yang terlihat kerenidentitas darah eropa juga tetap hadir dari grill ekstra besar walau hal ini sangat tak asing karena juga sudah ada di varian tt seperti keluarga besar tt terdahulu ia masih menurunkan kemampuan memikat pandangan siapapun yang melihat lekuk bodi keseluruhannyamempertahankan atap yang membulat ia diklaim mendukung tingkat aerodinamika dengan baik walau sekali lagi ia tetap terlihat cantik apalagi unit yang kami jajal adalah warna hitam bernama brilliant black yang kian menambah nilai anggunnyadengan pelek lingkar 19 inci berdesain palang lima tts tetap terlihat wibawa jika mengantarkan pengemudinya ke pesta dan tetap oke untuk diajak sekedar show off bukan sekedar keren di luar ternyata di dalamnya mampu memikat hati pengemudinya jugabukan karena interiornya yang memang dilengkapi sepasang jok semi bucket tapi panel indikatornya yang terbilang canggih audi menyebutnya dengan nama virtual cockpit yang menggusur semua indikator bermekanisme kabel maupun analog sebagai gantinya di depan setir tts kini terpampang layar monitor yang akan menyala untuk menyajikan bermacam-macam informasi mulai dari takometer di sebelah kiri dan spidometer dengan angka mentok di 300 kilometer per jam di sisi kanan sampai info jumlah sisa bahan bakar di tangki sangat informatif penyajiannyabahkan jika takometer dan spidometer terasa terlalu kecil di mata anda keduanya juga bisa diubah ke ukuran lebih besar di antara dua indikator tersebut pengemudi juga dimungkinkan membuka peta berbasis gps untuk memandu ke tujuan perjalanan dengan begitu tentunya ia tak membuat leher lekas pegal seperti mobil kebanyakanbelum lagi ada fitur indikator tekanan angin keempat ban yang berguna memberi info jika salah satu diantaranya kurang angin bukan cuma penunjuk tekanan angin dengan visual 4 dimensi di beberapa menu lainnya virtual cockpit membuat pengemudi serasa mengemudikan mobil masa depanasyiknya itu semua bisa diatur pengemudi dari tombol-tombol yang ada di setir terlalu lama mengutak-atik virtual cockpit membuat otodriver hampir kelupaan mengulik bagian lain di interior pada dasarnya tts memberikan impresi posisi mengemudi khas sport car eropa jok mirip yang ada di mobil balap terbungkus rapih dengan kulit warna gelap yang menguatkan hawa racing melongok kebelakang ternyata ada jok juga yang membuat kami penasaran seperti apa rasanya duduk disitu jangankan duduk akses masuk kabin belakangnya saja terasa sulit setelah jok depan ditekuk habis plus dimajukan dengan sistem elektrik yang prosesnya terasa lama otodriver yang ukuran badannya tergolong slim saja agak bingung mau pakai gaya apa untuk melewati celah dari jok depan yang sudah terlipat begitu sudah di kabin belakang ternyata rasanya jauh dari nyaman untuk kami yang punya tinggi 170 cm bangku belakang ini sepertinya lebih cocok untuk diduduki anak-anak usia 10 tahunan dari pada orang dewasa hal itu juga semakin pas dengan hadirnya beragam fitur pendukung yang diberi audi di kabin belakang ini mulai dari sabuk pengaman sampai tersebarnya tether untuk memasang kursi balitatak mau berlama-lama kami otodriver pun kembali ke bangku pengemudi untuk merasakan dapur pacunya tapi sekali lagi kami harus menerima kenyataan bahwa area test yang sangat terbatas hanya bisa dipakai untuk memacu tts kurang dari 20 km per jamandai tts yang bersama kami ini ada plat nomernya mungkin lecutan mesin 2000 cc turbo dengan teknologi tfsi bisa kami rasakan di jalanan apa daya kami pun hanya bisa geber-geber gasnya saja ternyata lengkingannya sangat merdu seperti selayaknya sport car sejati dari brosurnya tertulis tts bisa menghasilkan daya sampai 310 dk dan torsi puncak 380 nm angka yang terbilang besar dari mesin 2000 cc turbo hasil racikan insinyur audi di jerman pun membuat mobil dengan blok dan kepala silinder alumunium ini mematok redline tachometer di angka 6700 rpm dengan tenaga sebesar itu penggerak 4 roda dan hadirnya launch control audi tts diklaim bisa menuntaskan 0-100 kmjam tak sampai 5 detiksaat dibawa berlari kecang harusnya ia juga punya pengendalian yang baik karena audi menggunakan material aluminium campuran pada struktur rangkanya ditambah sayap di bagasi belakang yang akan terbuka ke atas jika menyentuh kecepatan 130 km per jam mobil ini juga diklaim punya hambatan angin yang terbilang rendah saat sayapnya terlipatdengan dimensinya yang ringkas membawa tts di area parkir yang penuh belokan dan sempit tak terasa sulit tts yang dimensinya lebih kecil dari sebuah honda brio terasa mudah saja melibas beragam tanjakan curam khas parkiran gedungakselarasi mobil bertransmisi otomatik 6 percepatan ini juga tergolong tidak liar apalagi dengan kawalan empat rem cakram besar membuatnya enak bermanuver deselerasi tapi tentunya kemampuan maksimal mobil ini baru akan terasa di jalan raya semoga saja nantinya audi indonesia memiliki unit tes untuk kami review lengkap kesimpulanmemang siapa orang yang membeli sebuah sport car coupe untuk membawa serta anaknya untuk duduk di bangku belakang maka ketidaknyamanan bangku belakang tts masih tergolong lumrah karena kenikmatan mengemudi generasi audi tt benar-benar diimprovisasi dengan sukses dalam tts ini dengan desainnya yang cantik dan modern tentunya tts layak untuk menambah koleksi mereka yang hobi akan sport car tapi bukan berarti tts tak layak untuk jadi sport car pertama untuk yang baru mencoba main segmen inikelebihan- tampilan eksterior menarik- fitur lengkap dan canggih- manuver di tempat sempit tergolong mudah kelemahan- penyetelan elektris jok depan terasa lambat- kabin belakang tak cocok untuk orang dewasa- ground clearance cukup rendahspesifikasiaudi tts harga rp 1825 miliarkapasitas mesin 2000 cc 4 silinder segaristenaga maksimum 310 dk torsi maksimum 380 nm transmisi otomatik 6-speed s-tronicpenggerak all wheel drive', 'first drive audi tts 2016'),
(84, 'mengisi segmen yang sebenarnya tak begitu bergairah hyundai indonesia percaya diri memasukkan hatchback terbaru dengan trah i kebetulan ajang giias 2016 diamanfaatkan hyundai mobil indonesia memberi kesempatan otodriver untuk menjajalnya kami pun langsung merapat ke area test drivememang kesan pertama yang diberi i20 cenderung biasa-biasa saja dari sini otodriver agak ragu apakah ia mampu menaklukan lawannya yang terbilang digdaya apa lagi kalau bukan honda jazz suzuki swift dan mazda2 tak ditemui lekukan bodi yang agresif maupun desain bumper bergaya sport ia lebih mengarah ke hatchback yang profilnya jauh dari kesan galakkendati demikian hyundai berusaha menimbulkan kesan modern dari penggunaan grill cukup besar dan lampu yang tiap ujungnya melancip apalagi adanya fog lamp yang digabung drl led membuatnya terlihat menawan nah begitu melongok ke belakang barulah aura dinamis mulai muncul ada spoiler diatas kaca belakang tapi ukurannya tak begitu besar yang lagi-lagi meredam unsur galaknya dan satu hal yang menggelitik kami adalah bagian di pilar c penampang pilar ini dibungkus material plastik yang saat diketok suaranya mirip plastik dasbor mobil lcgc entah apa maksudnya pemakaian bahan plastik ini toh demikian jika diperhatikan seksama dari bagian belakang memang i20 tak bisa dibilang cupu dan saat mencoba melihat mesinnya terasa berat sekali ketika mengangkat kap mesin mobil buatan india ini artinya material bodi cukup tebaldesainer yang merancangnya konon mantan desainer yang pernah bekerja untuk volkswagen jadi tak heran jika i20 jadi salah satu harapan hyundai bertarung di pasar eropa lantas apakah kiblat eropa juga membuatnya kaya akan fitur di dalam kabin kami pun mencoba mencarinyainterior serba gelap yang memunculkan aura dinamis memang memberi kenyamanan yang baik walau joknya belum dibungkus material kulit dasbor yang masih berbahan plastik keras juga tampil menarik dan cenderung beraura sportybertabur fitur hiburan di area depan yang kami temui di layar sentuh 8 inci-nya saja sudah tersedia pemutar cd dvd usb mp3 aux dan perangkat gps mobil yang memiliki empat speaker ini juga memudahkan pengemudi untuk mengatur lagu atau radio berkat adanya tombol di kolom setirmencoba pindah ke bangku penumpang belakang ternyata juga tak kalah menarik dari sini penumpang juga bisa mengatur embusan dinginnya ac karena adanya ventilasi di konsol tengah posisi duduk pun terasa pas untuk postur rata-rata orang indonesia yang 170 cm apalagi joknya juga lumayan empukmenariknya bangku belakang ini bisa dilipat dan mengahasilkan ruang yang terhubung bagasi dengan dasar rata tentu hal ini menciptakan daya angkut barang yang lega mungkin untuk sekedar memasukkan sebuah sepeda gunung masih bisa tapi dalam posisi direbahkanpuas menilik belakang kami pun segera pindah ke balik setir dan mencoba membawanya jalan suara mesinnya yang lembut saat start makin membuat kami penasaran performa mobil bertransmisi otomatik empat percepatan inikebetulan di area test drive giias 2016 ada beberapa obstacle yang bisa menguji kaki-kaki mobil maju perlahan di kecepatan rendah dan mulai masuk ke rintangan pertama berupa enam baris polisi tidur mini mobil yang punya ground clearance 150 mm ini cukup baik bantingan suspensinya saat melahap gelombang-gelombang obstacle walau guncangan tetap terasa tapi redaman dari suspensi membuat orang di dalam kabin tak begitu terguncanghyundai i20 punya torsi 133 nm yang bisa diraih pada 4000 rpm membuatnya tak begitu kesusahan saat melibas rintangan kedua yang berupa tanjakan buatan memang tak terlalu curam sudut kemiringan tanjakannya tapi setidaknya otodriver tak perlu menekan pedal akselarasi terlalu dalam untuk membuat mobil yang punya dua noken as alias dohc ini menanjak lepas dari area halang rintang kamipun disuguhkan pada trek lurus untuk mengeksplorasi tenaganya satu yang disayangkan i20 tipe otomatik ini hanya dibekali empat percepatan padahal teknologi transmisinya sudah shiftronicberakselerasi menggunakan mobil bermesin 1400 cc ini sebenarnya menyenangkan karena terbilang responsif tapi begitu menekan pedal lebih dalam lagi yang terjadi malah seperti over-revving sebelum sistem komputer mengintervensi untuk oper ke gigi lebih tinggi kendati demikian torque converter di transmisi otomatik ini masih tergolong baik menyalurkan tenaga ke roda depan fwdhandlingnya pun juga terasa lumayan enak berkat kawalan suspensi depan mcpherson strut dengan stabilzer dan yang belakang dilengkapi coupled torsion beam axle hatchback berlingkar roda 16 inci ini sayangnya belum mengaplikasi rem cakram di keempat roda baru di kaki-kaki depannya saja tapi karena adanya fitur abs tentu tak terlalu risau saat bermanuver agresifkesimpulanbertarung di segmen yang dihuni pemain asal jepang sekelas honda jazz membuatnya jadi alternatif konsumen terhadap medium hatchback desainnya yang menarik tapi kalem jadi daya pikat tersendiri walau ada plastik keras yang harus hinggap di pilar c hyundai juga berkomitmen memberikan performa dengan mesin 1400 cc walau yang tipe otomatik rasanya lebih pas untuk manuver dalam kota dibanding melaju di jalan bebas hambatan  kelebihan- tampilan eksterior menarik- fitur lumayan banyak- bantingan lumayan nyaman- akomodasi tergolong besar kelemahan- kurang bertenaga di kecepatan tinggi- material plastik di interior- transmisi hanya 4-speedspesifikasihyundai all new i20 atharga rp 249 jutakapasitas mesin 1368 cc 4 silindertenaga maksimum 100 dk  6000 rpmtorsi maksimum 133 nm  4000 rpmtransmisi otomatik 4-speed shiftronicpenggerak front wheel drive', 'first drive hyundai i20 2016 at'),
(85, 'seminggu setelah resmi diluncurkan kami dapat kesempatan merasakan mengemudi bmw x1 edisi terbaru memang masih dalam jarak pendek setidaknya cukup untuk mendapatkan impresi pertama suv yang dibuat ckd di indonesia inibmw lebih suka menyebut jenis mobil ini dengan istilah sport activity vehicle dan disingkat sav kata activity di tengah itu ternyata memang pas untuk all new x1 ini yang cocok untuk karakter pengemudi yang kegiatannya kesehariannya dinamisbisa dilihat dari tampilan luarnya yang memancarkan aura young and cool walau desainnya tetap cocok untuk anda yang kesehariannya lebih sering pakai jas dan dasi tersedia warna putih hitam biru dan abu-abu bagi calon pemiliknya kebetulan unit tes yang kami pakai adalah tipe sdrive 18i dengan kelir biru dongker walau sekilas mirip warna mobil dinas pejabat tni au tapi unsur metalic-nya menjadikannya terihat berkelasdesainnya secara keseluruhan berubah total dibanding x1 generasi terdahulu ia terlihat seperti x3 tapi bila anda melihatnya langsung maka anda akan melihatnya seperti miniatur x3 ukurannya yang kompak jelas terlihatmeski begitu akomodasi di dalam tergolong sangat lega dan jauh meningkat dari sebelumnya apalagi di bagasi x1 tak memiliki ban serep karena menggunakan ban rft praktis daya angkut barang makin besar ban rft yang terkenal cukup mahal ini juga dilindungi asuransi selama 3 tahun anda bisa meminta penggantian semisal rusak karena kecelakaan atau benturan keras di jalan bila kapasitas bagasi kurang memadai anda bisa melipat bangku baris kedua dari bagasi terdapat tombol elektrik yang jika ditekan maka bangku akan langsung melipat ratasebelum duduk di balik kemudi otodriver mencoba di bangku baris kedua bukan cuma kulit joknya yang membuat terkesan tapi ada pilihan setelan maju mundur bangku penumpang bisa memajumundurkan jok nya sejauh 15 cm dengan menarik tuas di bagian samping bawah ini berguna bila ingin membawa barang lebih banyak di bagasidi tipe termahal ini penumpang juga dimanjakan dengan panoramic roof yang membuat aura mahal serta lega muncul dari segi keamanan kantung udara juga tersedia di bangku baris belakang ini belum lagi dudukan child seat standar isofix yang disediakanuntuk nuansa interior tak ada yang mengganjal semuanya tampak nyaman dan mewah khas bmw puas dengan kenyamanan kabin belakang maka kami langsung pindah ke depan untuk merasakan sensasi mengemudinyaarea tes yang berada di wilayah epicentrum jakarta selatan sebenarnya tak cukup memuaskan untuk memerah tenaga maksimal suv ini jalanan di area ini yang tersusun dari conblock punya kontur cenderung tak rata justru menjadi sedikit ujian untuk suspensi x1 terbarukedua jok di depan desainnya sekilas mirip yang ada di sedan berperforma tinggi saat badan bersandar ternyata memang benar-benar nyaman memeluk punggung semoga saja bagi pengemudi berpostur tambun juga tak ada masalah mengenai bangku kekecilantombol engine start pun ditekan dan dan suara mesin bensin halus terasa tidak ada kesan kalau ini mobil 3 silinder getarannya juga tak terasa berbeda dengan di mini cooper yang memakai mesin sama oke tak sabar tuas persneling diposisikan pada d dan perlahan x1 melaju oh ya transmisi 6-speed ini diambil juga dari mini sehingga tuasnya belum memakai model joystick seperti kebanyakan bmw lainnyabmw menyediakan tiga mode berkendara pada x1 2016 ini yakni ada sport eco pro dan comfort ketiganya bisa dipilih dengan menekan tombol di samping tuas transmisi pada awal-awal melaju kami coba langsung posisikan pada mode sportmencoba tekan pedal gas secara spontan ternyata tarikannya cukup responsif tenaga awal pun mengesankan tak berlebihan jika kami samakan seperti karakter sedan cepat dan lincah ia memang memiliki tenaga 14 dk lebih rendah dibanding mesin bensin non-turbo di generasi sebelumnya tapi torsinya membesar 20 nm apalagi torsi maksimal itu sudah bisa didapat sejak 1250 rpmtapi ada satu yang bisa mengganggu anda ketika putaran mesin berada di atas 4000 rpm mulailah dengungan khas 3 silinder terdengar tidak merdu untuk didengar tapi dalam sisi penyaluran tenaga tak ada masalah sama sekali ia tetap terasa halus dan responsifsaat dikendarai normal anda juga tak bisa merasakan kalau mobil ini sekarang berpenggerak depan ia tetap terasa lincah dan mengasyikkan saat bermanuver wajar karena mini yang jadi basisnya juga merupakan salah satu mobil penggerak depan paling menggugah dikemudikanlantas kami pun pindah ke mode eco pro disebut pihak bmw punya karakter yang mengejar efisiensi bahan bakar powernya pun terasa tak begitu nendang cocok untuk berkendara di dalam kota yang lebih sering menggunakan kecepatan pelanberkendara di mode ini bmw mengklaim x1 bisa menghasilkan kehematan hingga 18 kml itu berdasarkan hasil tes mereka di eropakarakter suspensinya sendiri cukup menyenangkan ia cenderung lembut untuk ukuran suv dan tak jadi melemah saat diisi 4 orangsatu yang kurang kami suka adalah feedback dari setir karena menggunakan power steering elektrik setir mobil ini kehilangan rasa dari jalan tak banyak umpan balik yang anda rasakan di setir ketika berkendara serasa terisolasi bagi kebanyakan orang ini menambah kenyamanan di tangan tapi bagi pengemudi antusias akan merasakan hal yang kurang tapi itu tidak signifikanyang jelas x1 ini tetap menyenangkan dikendarai dengan penyaluran tenaga halus pengendalian presisi serta bantingan suspensi cukup nyaman pecinta akselerasi mungkin tak begitu puas karena output mesin ini memang lebih kecil dari x1 bermesin 2000 cc bensin atau turbo diesel yang digantikannya apalagi saat ini baru tersedia 1 opsi mesintapi harganya memang menyenangkan tipe termurah dihargai rp 619 juta off the road yang artinya lebih murah dari sebelumnya sedangkan tipe termewah xline seperti mobil tes kami kali ini dihargai rp 659 juta off the road tak jauh beda dibanding mercedes-benz gla 200 dan audi q3 14 tfsi yang menjadi pesaingnyaapalagi ia juga tidak pelit fitur dalam kondisi standar anda sudah mendapatkan atap panoramik navigasi satelit indonesia sistem idle stop bagasi elektrik serta smart keyless entry kami juga sangat menyukai pemilihan corak panel kayu di pintu dan dasbornya kesimpulanmobil ini solid dalam kualitas dan tetap asyik dikendarai anda tak perlu khawatir akan penggerak depannya karena ia tetap terasa seperti bmw karakter suara mesin mungkin bisa mengganggu untungnya baru muncul di putaran tinggi akomodasi makin lega dan harga kompetitif membuat x1 sangat layak dipertimbangkan kalau anda mencari suv premium di rentang harga itu kelebihanmesin tanpa getaran nyamanakomodasi dan kepraktisan baikpengendalianfitur lengkap kekurangantenaga mengecil dibanding sebelumnyadengungan 3 silinder di putaran atasfeedback setir minim spesifikasibmw all new x1 sdrive 18i harga rp 619 juta off the road kapasitas mesin 1500 cc 3 silinder twinpower turbotenaga maksimum 136 dk  4400 rpmtorsi maksimum 220 nm  1250 rpm0-100 kmjam 97 detik klaimtransmisi otomatik 6-speedpenggerak front wheel drive', 'first drive bmw x1 sdrive 18i 2016');
