(86, 'apa yang terlintas di pikiran saat anda mendengar kata bentley sedan super mewah mobil sport ternyata keduanya menjadi satu paket dalam harga fantastis semua itu akan menenggelamkan anda dalam kenikmatan luar biasa manakala sudah berada di balik kemudinya dan perlahan menekan pedal gas sirkuit sentul bogor menjadi tempat untuk membuktikan kata-kata tadidengan hadirnya bentley continental gt v8 s otomatis menambah varian bentley continental di tanah air hal ini dipercaya pt grandauto dinamika gad sebagai apm bentley akan laris manis diserap pasar luxuy cars indonesiasetelah acara seremonial perkenalan bentley continental gt v8 s pihak pt gad memberi kesempatan otodriver menjajal langsung unit test berwarna jingga itu bodinya yang bongsor dengan lekukan desain khas aristokrat bentley namun tetap memadukan unsur kemewahan modern menjadikannya tampil tetap stylish pada unit test kali ini yang paling menarik perhatian kami adalah warnanya yang cukup menyegarkan mata bagi beberapa orang mungkin berpendapat miring saat melihat mobil super mewah nan serius berwarna oranye lebih cocok untuk mobil anak muda tapi tentu sangat sedikit anak muda yang memiliki rp 8 miliar lebih untuk dibelanjakan membeli mobil ini justru di situlah kelihaian bentley dalam memadukan unsur kemewahan dan tampilan yang stylish dengan warna jeruk secara keseluruhan membuat mobil ini jadi tak nampak begitu galakmodel ini sudah melakukan facelift meskipun tak terlalu drastis ubahannya dua headlamp bulat di tiap sisi kiri-kanan tetap dipertahankan pabrikan asal inggris ini grill berukuran besar yang tak ada bedanya dari varian w12 6000 cc kian menambah kesan eksklusif aura sporti baru terlihat saat memalingkan pandangan ke bumper bagian bawah yang terintegerasi dengan kawat ram sarang lebah begitu juga bumber bagian belakang yang sebenarnya hanya berdesain garis lurus namun karena dipadu ujung knalpot yang sporti jadi terlihat gahar secara menyeluruh tapi area bagasi lagi-lagi tetap mempertahan kan ciri khas bentleymobil dua pintu ini menggunakan pelek berukuran 21 inci pada keempat rodanya desain pelek berpalang tujuh ini sebenarnya lebih cenderung terlihat elegan dari pada sporti dan tampilannya sangat pas bepadu dengan bodi kiri dan kanan yang minim lekukansepasang spion yang dilengkapi lampu sein led cukup kontras warnanya dalam dominasi warna jingga menyala di bodi detail warna spion bisa saja disesuaikan senada warna bodi jika calon pemilik berkehendak karena bentley mengakomodir keinginan tiap konsumennya untuk mempersonalisasi tiap mobilnya puas menelisik eksterior coupe asal britania raya ini otodriver pun masuk ke dalam kabinnya lagi-lagi bentley menyebut bahwa calon konsumennya bisa menentukan bahan dan warna apa yang dipakai untuk material pembungkus jok dan beberapa panel yang jadi unit test kali ini interiornya tampil cukup elegan kulit jok berwarna krem dan hitam senada dengan door trim dan lingkar kemudi saat duduk di bangku depan akan ada mekanisme kepala seatbelt yang otomatis maju dari belakang menyodorkan ke arah punggung menyesuaikan bangku pengemudi juga sangat dimanjakan dengan berbagai pilihan penyetelan saat memajukan bangku secara otomatis setir juga perlahan turun mobil ini seolah paham jika pengemudinya berpostur pendekbentley menghadirkan head unit layar sentuh berukuran 8 inci yang bisa menampilkan sistem navigasi dan audio dengan kapasitas penyimpanan memori hingga 30 gb bahkan penyetelan suspensi hingga percakapan telepon bisa dioperasikan melalui layar inisudah gatal ingin merasakan seperti apa performanya kami pun menyalakan mesin grand tourer ini sabuk pengamana sudah pakai pintu masih terbuka terasa cukup berat ternyata untuk menutup pintunya untungnya dilengkapi penarik vakum sempat menekan pedal gas sebelum pintu tertutup raungan mesin v8 terdengar galak bernada serakbentley continental gt v8 s menganut transmisi otomatik delapan pecepatan yang memindahkan gigi hampir secepat kopling ganda sebelum jalan tuas transmisi diposisikan pada mode s perasaan lumayan berdebar saat perlahan jalan keluar area pitlane dan begitu masuk trek langsung saja coba tancap gas masuk di tikungan pertama alias r1 suspensi bekerja sangat baik berbeda dengan tipe v8 tanpa s mobil ini memiliki setting suspensi sport yang lebih keras tak akan membuai anda dengan kenyamanan ala bentley tapi membuat mobil berbobot 2 ton lebih ini menikung layaknya mobil sport ringan selain suspensi v8 s juga memiliki mesin bertenaga 20 dk lebih besarmencoba lebih dalam lagi menekan pedal gas tarikan mesin 4000 cc dengan suntikan twin-turbocharged benar-benar membuat punggung menempel dengan sandaran jok uniknya nyaris tak ada suara bising mesin yang masuk ke dalam kabin redaman suara di kabin sangat baik akselerasi mobil ini tak main-main dengan penggerak all wheel drive ia mampu mencatat 0-100 kmjam tak sampai 5 detikjelang memasuki ke sebuah tikungan yang cukup teknikal pedal gas sedikit dikendorkan dan mobil mudah saja menuruti perintah dari lingkar kemudi setelah itu dicoba akselarasi spontan dengan menghentakkan pedal gas mobil berbobot 2750 kg ini pun bisa melesat dengan baik otodriver pun paham seperti apa rasanya hentakan 521 dkmasuk ke tikungan terpelan di sentul yakni s kecil suspensi 4 link double wishbone dan trapezoidal multi-link yang mengawal keempat roda dengan sangat baik mendukung manuver tikungan chicane ini dapat mudah dilibas dengan suspensi yang terkendali oleh komputer mobilkeluar s kecil dihadapkan dengan trek lurus otomatis transmisi bekerja keras menyalurkan tenaga mesin transmisi otomatik dari supliernya zf sangat baik menyalurkan tenaga dengan lost power yang relatif sedikit anda bisa bayangkan saat naik dari lantai satu ke lantai dua dengan anak tangga yang lebih banyak tentu tenaga yang dikeluarkan lebih sedikit bukan demikian pula pada transmisi yang punya rasio sampai delapan percepatanoh ya continental gt v8 s tersedia pula fitur padle shift di lingkar kemudi tapi dalam kesempatan ini kami lebih memilih untuk tak menggunakannya sampai masuk ke sebuah tikungan cepat tak terasa juga gejala body roll untuk versi v8 s ini bentley mereduksi ketinggian suspensi sampai sekitar 10 mm fitur electronic stability control juga berperan dalam handlingnya yang sangat baiksayang pada sesi test ini tak membolehkan kami untuk melintasi trek lurus di depan tribun saat berbincang dengan roland staehler chief operating officer pt gad di paddock ia menyebut bahwa continental gt v8 s bisa menyentuh top speed sampai 308 kmjam oh my godsecara umum bentley v8 s ini terasa sama mengesankannya dengan versi w12 6000 cc bertenaga 635 dk ia tetap terasa sangat cepat halus berfitur sama serta suaranya pun begitu merdu dan berwibawa tapi memang ada sedikit ganjalan bahwa ini bukan varian tertinggi secara kesan berkendara tidak terlalu masalah bagi kami tapi secara psikologis bukan yang diinginkan kaum berduit karena biasanya mereka selalu ingin versi tertinggi  kesimpulandalam sebuah bentley continental gt v8 s terdapat perwujudan sebuah grand tourer yang stylish mewah dengan kelincahan berkendara yang agrsif dengan tenaganya yang luar biasa besar cocok bagi anda yang mencari kecepatan tinnggi tapi dengan daya tariknya tersendiri continental gt v8 s sangat pas untuk sekedar menghadiri sebuah pesta mewah dan membuat pemiliknya tampak penuh wibawa bicara value for money v8 s ini lebih menarik ketimbang versi w12 yang lebih mahal rp 1-2 miliar  kelebihanmesin sangat bertenagakehalusanfitur selengkap w12ada pilihan personalisasi mobilkekuranganbangku baris kedua terasa cukup sempitharga setara supercar italiajaringan servis sangat terbatasspesifikasibentley continental gt v8 sharga rp 8 miliar off the road estimasikapasitas mesin 4000 cc v8 twin turbotenaga maksimum 521 dk6000 rpmtorsi maksimum 680 nm1700 rpmtransmisi otomatik 8-speed penggerak all wheel drive', 'first drive bentley continental gt v8 s'),
(87, 'memenuhi undangan isuzu indonesia otodriver berangkat ke thailand untuk menjajal suv andalan merek asal jepang tersebut isuzu mu-x facelift yang awal maret kemarin diluncurkan ternyata cukup mengesankandengan hadirnya mu-x facelift suv besar andalan isuzu itu pun kini punya dua pilihan mesin baru yakni 1900 cc dan 3000 cc keduanya berjenis turbo diesel akselerasi dan ketangguhan suspensinya cukup baik untuk membuatnya sebagai salah satu suv tertangguh di pasarselain opsi mesin baru bagian eksterior juga mengalami perubahan walau tak mencolok terlihat lampu drl dengan led ada di samping lampu kabut adapun aksesori yang menjadi daya tarik antara lain led drl di sebelah fog lamp berbeda dengan mu-x terdahulu yang lampu drlnya terletak di bawah grill lampu sein juga masih hadir di bawah sepasang kaca spionnya bagian belakang tak ada ubahan dari model sebelumnya desain gagah khas suv sekelasnya masih terpancar adanya antena sirip di atap bagian belakang bahkan menambah kesan sporty sayang ujung ujung knalpot belum diberi improvisasi desain terbaru oleh isuzu masih berupa pipa bulat masuk ke dalam kabin kesan serius dan tangguh hadir karena dominasi warna hitam namun kenyamanan tetap sangat baik menyetel bangku pengemudi sudah model elektrik dengan menekan tombol di sisi kanan bawah bangkudesain dan fitur yang terdapat pada lingkar kemudi masih belum ada ubahan terbaru pengemudi masih dimudahkan mengatur audio dari lingkar setir monitor 7 inci juga hadir di dasbor dengan dihiasi panel pengatur penyejuk udara serta entertainment system berbentuk bulat di bawahnyamencoba duduk sebagai penumpang di bangku baris kedua juga cukup nyaman saat keempat roda mobil melibas permukaan tanah tak rata guncangan dapat diredam degan sangat baik apalagi terdapat monitor di plafon untuk menghibur penumpang menjadikan perjalanan makin menyenangkantapi bangku baris ketiga tak senyaman di baris depannya ruang geraknya yang cukup sempit tentu lebih cocok untuk penumpang berpostur maksima