dala tarikan lambat walau transmisinya automatic redaman suspensinya juga sangat baik namun jika anda menginginkan suasana mewah di dalam kabin mungkin anda bisa sedikit kecewa interior mu-x yang sangat maskulin tentu lebih cocok untuk yang berkarakter tangguh  kelebihan- mesin bertenaga- kabin cukup nyaman- terdapat panel ac sampai bangku baris ketigakelemahan - desain tak berubah banyak- airbag hanya ada di bangku depan- kabin tak terlalu mewahspesifikasiisuzu mu-x 4x2 30 ddi da dvd at harga 1364000 baht rp 5135 jutakapasitas mesin 2999 cctenaga maksimum 1745 dk3600 rpmtorsi maksimum 380 nm1800-2800 rpmtransmisi otomatik 6-speedpenggerak four wheel drive', 'first drive isuzu mu-x 30 4x4'),
(88, 'industri otomotif di eropa memang sudah berumur lebih tua dibandingkan benua lain oleh sebab itu eropa kerap dijadikan tolok ukur dalam hal teknologi desain keamanan maupun kenyamanan tapi biasanya harga mobil eropa memang mahallantas bagaimana jika ia dilempar ke pasar dengan harga setara rivalnya dari jepang akankah ia masih superior kami pun mengendarai langsung unit vw polo 12 tsi yang bertarung head-to-head dengan honda jazz toyota yaris dan mazda2 di pasar ia dibanderol hanya rp 259 juta membuatnya jadi mobil jerman paling terjangkautadinya polo generasi terbaru ini hanya dijual dalam varian 14 bermesin 1400 cc normally aspirated dengan tenaga tak sampai 90 dk varian itu dinilai bertenaga lemah sehingga tak menggugah untuk dikemudikan kemudian di giias 2015 lalu vw mengganti varian 14 dengan 12 tsi walau berkapasitas hanya 1200 cc varian ini disokong turbo hingga menghasilkan tenaga 105 dk serta torsi 175 nm yang merupakan torsi terbesar di kelasnyadari luar tak ada yang berubah sosok polo tetap terlihat ganteng dan rapi kami tak bisa menyalahkan anda yang sering keliru menyebut polo ini sebagai golf atau sebaliknya karena gurat desainnya mirip padahal golf berharga hingga rp 500 juta jadi sah saja bila ia dibilang sebagai golf versi minitidak ada teknologi terlalu mutakhir di luar lampu masih menggunakan halogen biasa bahkan drl juga belum tersedia namun setidaknya struktur bodi yang digunakan kokoh hingga ia mendapat bintang 5 dalam tes tabrak euro ncapdi belakang emblem 14 kini diganti tsi seperti biasa bagasi dibuka memakai logo vw yang bisa dioperasikan sebagai tuas sementara layaknya mobil eropa lampu kabut belakang juga sudah hadir sebagai standarmasuk ke dalam anda akan disapa oleh model dasbor yang mirip golf mk6 desainnya rapi dan berkelas dengan semua tombol diletakkan secara logis dan dalam jangkauantapi mungkin untuk mengejar harga terjangkau materialnya plastik keras semua ketika diketuk akan terasa murah untungnya di kelas ini rivalnya macam honda jazz toyota yaris atau mazda2 juga menggunakan material serupa sehingga kami tidak bisa komplain terlalu banyak akan hal iniac sendiri menggunakan climate control digital pemakaiannya sangat mudah karena tetap dilengkapi dua buah kenop bulat sementara tombol-tombol di bawahnya terlihat berkelas bagai mobil premiumpaling menarik di interior adalah setirnya yang semodel dengan golf mk7 bukan hanya cantik dipandang dan enak digenggam ia juga memiliki model flat bottom model ini memiliki keuntungan melegakan ruang di paha serta terlihat sporty tombol audio dan mid juga terpasang rapi di lingkar kemudinyaposisi mengemudi di polo terasa lebih ergonomis dari seluruh rivalnya ini disebabkan pengaturan kursi bisa naik turun serta pengaturan setir teleskopik kedua penyetelan itu juga memiliki range yang fleksibel anda bisa duduk rendah atau tinggi sesuai kemauanvisibilitasnya baik untuk ke depan maupun ke belakang boleh dibilang sangat mudah mengendarai mobil ini dimensi kompaknya juga membantu anda meliuk di kepadatan lalu-lintashal positif berikutnya adalah pengendalian terasa sekali kalau mobil ini memiliki rekayasa teknik maju meski bantingannya tetap lebih empuk dari golf mk7 meski tetap lebih keras dari golf mk6 mobil ini berubah arah sangat presisi apalagi dibantu oleh kontrol kestabilan yang menjaga traksi di berbagai kondisimelaju hingga di atas 100 kmjam tak akan membuat polo goyah dimensi boleh kecil namun kemantapannya di kecepatan tinggi merupakan yang terbaik di kelasnya anda akan merasa percaya diri berkat karakter bantingan suspensi dan kestabilannyanah sekarang pertanyaan yang paling mendasar seberapa baik mesin mungil di mobil ini seperti kita tahu ia hanya berkapasitas 1197 cc dan dilengkapi turbo tenaganya yang 105 dk juga kalah dari rival jepangnya meski torsi 175 nm merupakan yang terbesarsaat mengendarainya ke bandung mesin ini tak kesulitan sama sekali melibas tanjakan cukup curam di tol cipularang ia terasa jauh lebih responsif ketimbang rivalnya dari jepang memang ada sedikit waktu dibutuhkan sebelum turbonya bekerja penuh turbo lag tapi setelah itu akselerasinya sangat positifmeski ini baru tes jarak pendek kami coba mengetes akselerasinya kondisi memang tidak ideal dilakukan di siang hari dan ditumpangi 2 orang tapi ternyata ia sanggup menembus 0-100 kmjam dalam 102 detik ini artinya tak kalah dibanding honda jazz toyota yaris atau mazda2bila tes dilakukan di malam hari dengan penumpang 1 orang seperti standar kami hasilnya pasti lebih baik bahkan mungkin di bawah 10 detiksecara umum kami merasa torsi besarnya banyak memainkan peranan sehingga walaupun tenaga maksimal kalah sedikit dibanding lawannya polo tetap terasa sangat bertenagasatu penyebab lainnya adalah penggunaan transmisi dsg 7-speed kopling ganda transmisi ini memindahkan gigi secepat kilat dan sangat halus di kemacetan pun kelihatannya transmisi ini telah diprogram sangat baik oleh vw sehingga halus tak gugup seperti terjadi di polo 14 atau golf tsi mk6sayangnya ia belum dilengkapi oleh paddle shift jadi jika ingin memindahkan gigi secara manual harus melalui tuas transmisi di konsol bukan masalah krusial tapi beberapa rival lain telah memiliki paddle shift yang menambah asyik saat mengemudi agresiftransmisi ini juga dilengkapi dengan mode sport yang sangat terasa perbedaannya saat diaktifkan posisi gigi ditahan lebih rendah sehingga mesin berputar lebih tinggi dan lebih siap mengeluarkan tenaga begitu pula saat mengerem ia akan lebih agresif menurunkan gigidi lain sisi transmisi ini memang tanpa slip bagai manual alhasil penyaluran daya lebih efisien dipadu rasio gigi yang memungkinkan mesin berputar hanya 2000 rpm di 100 kmjam ini membuat konsumsi bbm di tolnya berada pada kisaran 20 kml sementara di dalam kota ia mudah saja menembus 13 kml meski begitu dalam soal jenis bbm ia mensyaratkan oktan 95 berbeda dengan rival lainnya yang cuma mensyaratkan oktan 91secara umum duduk di depan memberikan pengalaman menyenangkan dan mobil ini memang paling asyik dikemudikan dibanding pesaingnya satu mobil yang paling mendekati adalah mazda2 tapi posisi mengemudi dan akselerasinya belum mengalahkan polo di lain sisi pengalaman duduk di belakang agak berbeda ceritanyaruang kaki dan kepala yang ditawarkan polo tak jauh berbeda dibanding mazda2 alias sempit duduk di belakang polo dan segera berpindah yaris atau jazz maka duo jepang itu akan terasa seperti limusinselain itu juga tak banyak kepraktisan yang diberikan mobil ini bagasinya juga terbatas jok belakang memang bisa melipat seperti normalnya hatchback tapi tak akan ada banyak tempat untuk menyimpan barang bawaan laci penyimpanan tertutup hanya ada 1 dan cup holder pun hanya 4 tempat penyimpanan terbuka memang ada 8 tapi ukurannya sangat kecil semuaartinya jelas cara terbaik menikmati polo ada di kabin depan sedangkan kabin belakang memang masih bisa mengakomodir orang dewasa meski bukan untuk perjalanan jarak jauhsistem hiburan yang digunakan polo bersistem terintegrasi meski belum touch screen dan resolusinya rendah bentuknya rapi dan berkelas tersedia pula slot usb sd card dan aux di interface-nya selain itu ia sudah memiliki fasilitas koneksi bluetooth untuk telepon dan musikkualitas suara yang dihasilkan cukup baik meski speaker yang digunakan memang tak sekuat yang ada di golf atau varian vw lainnya cukup bagus detailnya walau tak akan memuaskan kuping emas penikmat audio  kesimpulandengan harga rp 259 juta polo memberikan kesenangan berkendara kestabilan keamanan serta salah satu desain terbaik di kelasnya material interiornya memang bukan kelas premium tapi anda akan merasakan keunggulan rekayasa teknik jerman akselerasinya menawan begitu pula konsumsi bbm yang dihasilkannya bila anda membutuhkan compact hatchback untuk mengakomodir keluarga atau perjalanan jauh maka rivalnya seperti honda jazz atau toyota yaris akan memberi lebih banyak manfaat penggila fitur juga akan mendapati seleranya mengarah ke mazda2 tapi bila lebih sering digunakan sendiri polo akan memberi kesenangan berkendara khas jerman  kelebihan performa kuat konsumsi bbm posisi mengemudi pengaturan jok dan setir fleksibel konektivitas bluetooth pengendalian kelemahan harus oktan 95 material interior ruang belakang sempit kepraktisan  spesifikasivw polo 12 tsiharga rp 259 jutakapasitas mesin 1197 cc jumlah silinder 4tenaga maksimum 105 dk5000 rpmtorsi maksimum 175 nm1550-4100 rpm0-100 kmjam 102 detik transmisi otomatik 7-speedpenggerak front wheel drive', 'first drive vw polo 12 tsi'),
(89, 'sebagai mobil yang menyasar kaum funky tak heran kalau mini membuat banyak varian dari satu basis intinya tiap konsumen punya kebutuhan berbeda tapi di antara lainnya clubman selalu merupakan varian paling masuk akal dengan kepraktisan serta akomodasi bagai mpvgenerasi terbaru mini cooper clubman sebentar lagi masuk ke indonesia dan belum-belum memiliki figur mencengangkan kini ia merupakan mini terpanjang dan terlebar dibanding lainnya bahkan mini cooper hatchback 4 pintu dan countryman saja masih kalah dari mobil iniminggu lalu kami bertolak ke singapura untuk jadi satu dari sedikit jurnalis yang diizinkan menjajal mobil ini pertama kali sebelum masuk resmi ke indonesia diperkirakan maret akan melenggang dan pihak mini mengaku sudah mendapat pesanan konsumen untuk mobil iniada 2 tipe disediakan untuk kami yakni mini cooper clubman dan mini cooper s clubman walau nama hanya berbeda satu huruf s beda speknya lumayan cooper clubman mengusung mesin 3 silinder 1500 cc bertenaga 136 dk sementara yang ditambahi s memakai unit 4 siinder 2000 cc bertenaga 192 dk kedua mesin itu memakai turbo dan ditemani transmisi otomatis 6-speedtampilan luarnya tak jauh beda dan keduanya tetap unik dilihat terutama bagian belakang di bagian inilah banyak orang jatuh cinta pada clubman ia masih meneruskan desain orisinalnya berpuluh tahun lalu yang menggunakan pintu terpisah model bar model ini pun bukan pengecualiannamun di generasi terbaru ini clubman memakai lampu yang sangat berbeda dibanding mini lainnya lampu belakangnya berjenis led dan membentuk oval horisontal sangat cantik dilihat apalagi ketika lampu led yang membentuk garis vertikal dinyalakan pada malam hari dua buah knalpot hadir untuk menambah kesan sportsatu yang menarik adalah penggunaan antena macam sirip hiu di atas belakang oke ini memang bukan hal baru tapi mini memiliki opsi antena dengan lampu led merah di atasnya ia bisa dinyalakan via remote ketika kita kesulitan mencari mobil di pelataran parkir kabarnya mini clubman versi indonesia akan memakai fitur inimembuka kedua pintu bagasi dapat dilakukan tanpa menyentuhnya tinggal kantungi kunci dan ayunkan kaki ke bawah bagasi maka secara otomatis pintu kiri terbuka masih kurang lebar ayunkan kaki sekali lagi untuk membuka yang kanan menutupnya sendiri masih manual fitur ini berguna bila anda membawa banyak barang di tangan dan tak ada orang lain yang bisa membantu teknologi ini sebelumnya sudah ada di bmw dan lantas diaplikasikan ke mini clubmansetidaknya 1 koper besar dan 2 koper sedang bisa masuk ke dalam bagasinya ini jelas merupakan prestasi hebat untuk sebuah mini jika masih dirasa kurang anda juga dapat melipat bangku belakang untuk menyediakan ruang sangat lega ala mobil estate memang kenyataannya mobil ini walaupun merupakan hatchback yang dipanjangkan terlihat bagai sebuah estateberpindah ke bangku belakang anda akan langsung disapa oleh ruang kaki berlimpah kami yang berpostur hampir 180 cm saja dapat duduk dengan nyaman eski bangku depan disetel sesuai posisi mengemudi ideal kami layaknya mobil nyaman clubman juga dilengkapi oleh sandaran tangan untuk penumpang bukan sekadar basa-basi sandaran tangan ini cukup besar dan dilengkapi 2 buah cup holderduduk di belakang ini sebetulnya cukup nyaman dengan ruang kaki dan kepala lega tapi yang sedikit mengganggu adalah sudut sandaran yang tegak dan tak bisa diatur kerebahannya dalam perjalanan jauh hal ini kurang menyenangkan bagi penumpang belakang tapi kalau sekadar perjalanan jarak dekat ini adalah mini yang bisa anda beri kuncinya ke sopir dan duduk di belakang apalagi untuk versi indonesia akan memakai atap panoramiktapi tentu saja bila melakukan hal itu anda berpotensi kehilangan kesempatan merasakan keasyikan berkendara terlepas dari dimensinya ini adalah sebuah mini yang mengedepankan keasyikan berkendara apalagi dengan dukungan teknologi bmw di belakangnya jadi sekarang kita lihat apakah ia masih menggugahketika masuk ke kokpit secara cepat akan mendapatkan posisi berkendara ideal berapapun postur tubuh anda ini dikarenakan pengaturan tilt dan teleskopik dari setir yang begitu leluasa lebih fleksibel ketimbang banyak mobil lainnya anda bisa pilih duduk agak selonjor atau tegak dan posisi tangan ke setir tetap dalam batas aman mobil yang kami tes dilengkapi dengan rem parkir elektrik sehingga ketika menjalankannya tinggal injak gas sedikit secara otomatis rem parkir pun melepastipe pertama yang kami coba adalah cooper clubman dengan mesin 1500 cc mesin 3 silinder ini sama dengan yang digunakan di mini hatchback bmw seri-2 active tourer dan grand tourer well sebenarnya bmw i8 juga memakai mesin serupa tapi dengan tenaga jauh lebih besar terpenting di mpv seri-2 dan mini cooper hatchback performanya sangat baik serta begitu hematsuara 3 silindernya tak begitu terdengar ketika berjalan normal saat berakselerasi keras barulah terdengar dengungan khas itu akselerasinya memang tidak menghebohkan mini mengklaim 0-100 kmjam dalam 9 detik ia memang terasa lebih pelan ketimbang hatchback mengingat bobotnya yang melebihi 1500 kgmode sport bisa diaktifkan untuk membuat putaran mesin lebih tinggi meski paddle shift absen di model ini untungnya anda tetap bisa memindahkan transmisinya secara manual via tuas transmisi di tengahbantingan mobil ini terasa empuk ketika melewati polisi tidur pengendaliannya sendiri tetap tajam walaupun tak seagresif hatchback namun kami menyukai karakter seperti ini karena terasa lebih manusiawi untuk dikendarai sehari-hari seperti diketahui handling dari mini hatchback memang disukai pengemudi antusias namun untuk orang kebanyakan bisa dirasa terlalu tajam nah penambahan bobot dan dimensi di clubman ini seakan menjinakkan hal tersebutkarena tes ini hanya jarak pendek kami tak bisa mendapatkan figur akurat konsumsi bbm-nya tapi secara logis ia mestinya tetap irit meski tak sebaik hatchback sebagai catatan tipe hatchback memiliki konsumsi bbm dalam kota 12 kml dengan mesin inisetelah parkir kami lantas berpindah ke cooper s clubman bahan material interiornya memang lebih mewah sesuai dengan posisinya sebagai varian lebih mahal di singapura mobil ini berharga sekitar 15 di atas versi 1500 cc harga tepat varian ini adalah 166300 dolar singapura atau rp 16 miliar jangan kaget dulu karena harga mobil di singapura memang bisa 2 kali lipat lebih di sinisaat menyalakan mesin terdengar deruman yang lebih merdu sejak pertama kali dijalankan sudah terasa tenaganya tak perlu menginjak gas dalam untuk melajukannya cepat begitu gas diinjak lebih dalam badan pun cukup terempas ke jok masukkan ke moda sport agresivitas makin bertambah begitu pula deruman knalpotnyahanya dalam 71 detik ia mampu menuntaskan 0-100 kmjam bukan itu saja di moda sport suspensi juga bertambah keras yang membuatnya memiliki manuver sangat sigap cukup untuk membuat pasangan dan anak anda di belakang terlempar keras ke samping kalau anda kepala keluarga yang baik bermanuverlah dengan mobil ini setelah seluruh anggota keluarga dan barang bawaannya dikeluarkanmobil ini masih terasa seperti mini walaupun berukuran maxi semua keasyikan mengemudinya hadir bahkan ditambah kepraktisan memukau meski begitu beberapa kelemahan mini artinya juga hadir seperti tuas buka pintu dari dalam yang tidak ergonomis dengan bentuk telapak tangan manusia serta harganya juga kelihatannya tak akan murahbelum ada harga resmi tapi perkiraan kami bisa bermain di rp 650-850 juta perbedaan harga mesin 1500 cc dan 2000 cc di sini juga akan lebih besar ketimbang singapura karena perbedaan pajak versi terkencang john cooper works dari mobil ini diprediksi hadir akhir tahun kesimpulanits mini for the family anda tak perlu mengorbankan kesenangan mengemudi kepraktisan dan akomodasi keluarga bentuknya juga lebih menarik dilihat ketimbang varian lainnya walaupun itu kembali ke masalah selera mobil ini tetap terasa menyenangkan seperti halnya mini cooper lain fiturnya lengkap kualitas hebat serta performa dan pengendalian memukau bahkan masih layak untuk duduk di belakang dan menggunakan jasa sopirkelebihanposisi mengemudidesain luar dalamperforma cooper sakomodasi legafitur lengkap dan modernkepraktisanpengendalian presisibantingan suspensi nyaman cooper kelemahankarakter suara mesin cooperjok belakang agak tegakdesain tuas pembuka pintuharga diperkirakan tinggispesifikasimini cooper clubmanharga  rp 650 juta estimasikapasitas mesin  1499 ccjumlah silinder  3tenaga maksimum  136 dk4500-6000 rpmtorsi maksimum  220 nm1250 rpm0-100 kmjam  90 detik klaim transmisi  otomatik 6-speedpenggerak  front wheel drive', 'first drive all new mini cooper clubman 2016'),
(90, 'suv dan mpv sama-sama digemari di indonesia jadi kenapa tak menggabungkan keduanya seperti honda br-v kami mencobanya langsung untuk melihat apakah ini sebuah resep jitu lokasi uji coba kali ini adalah di pulau balikonsep mobil seharusnya pas untuk pasar indonesia menggabungkan ketangguhan suv dengan akomodasi 7-seater mpv lantas ditempatkan di harga rp 200 jutaan tipe termahal e prestige yang kami coba ini berharga rp 260 jutaan sedang bila anda rela melepas beberapa fitur dan kemewahan br-v bisa ditebus rp 2265 jutatongkrongannya gagah sekaligus cantik kesamaan dengan mobilio yang menjadi basisnya hanya terlihat pada tarikan garis samping sisanya berbeda apresiasi mesti diberikan pada desainer honda yang merancangnya sangat baik tampilan luar ini akan semakin keren kalau anda berani memilih warna spesial di mobil ini yakni merah dan hijau memang bukan warna paling populer tapi akan membuat mobil terlihat lebih segardi dalam anda akan disambut dasbor senada jazz dan mobilio facelift terlihat dewasa dan berkelas namun penyuka material lunak akan kecewa karena material yang digunakan semuanya merupakan plastik keras termasuk pada trim pintu posisi mengemudi sendiri sangat mirip dengan mobiliodipersenjatai mesin 1497 cc yang dipakai mobilio jazz city serta hr-v akselerasi br-v cukup positif walau transmisinya cvt namun penambahan bobot membuatnya terasa lebih lambat dari mobilio meski ia cukup kuat menanjak area gunung batur bali tempat kami melakukan tes tidak impresif tapi cukupbantingan suspensi mobil ini lebih kaku dari mobilio itu diperlukan mengingat ketinggian mobil bertambah selain itu suspensi ini terasa tangguh saat diajak melewati off-road ringan gejala limbung juga minimal di jalan makin aman karena mobil kami ini dilengkapi kontrol kestabilan kontrol traksinya juga mampu menjaga cengkeraman ban saat berakselerasi di jalan berpasir yang menanjakmengendarai br-v lebih menyenangkan dibanding rivalnya seperti toyota rush dan terios transmisi cvt-nya halus dan cukup responsif serta lebih halus dan tenang di jalan ia terasa seperti mengendarai sebuah mpv tapi dengan tongkrongan lebih tinggijangan lupakan juga ia diklaim honda sebagai low suv dengan ground clearance tertinggi di kelasnya tepatnya 201 mm ketika kami ajak mengarungi rute berbatu di kawasan gunung batur tidak pernah sekalipun mengalami gejala bodi bawah bersentuhan jalan alias mentok namun anda mesti sedikit berhati-hati pada tipe termahal ini karena spoiler depannya sedikit mengurangi sudut datang maksimum alias approach angle akomodasi baris kedua sangat lega postur 180 cm pun tetap akan merasakan ruang kaki lega hadirnya pengaturan kerebahan menambah kenyamanan jok tengahsedangkan di belakang ruang kaki sanggup mengakomodir hingga 170 cm walau paha tidak akan tersangga sayangnya meski kapasitasnya 7 orang cuma tersedia 6 headrest dari sisi akomodasi saat jok ditegakkan semua sisa ruang bagasi masih bisa dimuati 1 orang dewasa itu masih bisa diluaskan lagi dengan melipat jok paling belakangkami belum melakukan tes konsumsi bbm karena kondisi pengetesan di pegunungan tak memungkinkan kami menjalankan prosedur standar namun kami prediksi tetap hemat meski sedikit lebih boros dari mobiliosecara umum sensasi berkendara di br-v lebih ke arah mobilio ketimbang hr-v anggap saja ini sebuah mobilio dengan ketangguhan lebih baik desain lebih cantik akomodasi lebih baik sedikit serta fleksibel diajak ke beragam medan ini adalah mpv yang di-suv-kan sedang rivalnya dari daihatsu merupakan suv yang di-mpv-kan dengan menambah 2 jok lagi di area bagasidata tes lengkap akan kami sajikan setelah kami meminjam mobil ini di jakarta dalam jangka panjang dengan begitu kami akan bisa mendapatkan figur akselerasi konsumsi bbm serta karakter pengendaraan yang lebih akurat spesifikasi honda br-v prestige cvtharga  rp 2615 jutakapasitas mesin  1497 ccjumlah silinder  4tenaga maksimum  120 dk6600 rpmtorsi maksimum  145 nm4600 rpm transmisi  otomatis cvtpenggerak  front wheel drive plusdesain eksterior menarikground clearance tinggiakomodasi legakestabilantransmisi halusstability control sudah adapilihan warna menarikminusmaterial plastik keras di interiortransmisi tanpa moda manualjumlah headrest hanya 6suspensi agak keras', 'first drive honda br-v prestige cvt'),
(91, 'aston martin db9 merupakan sebuah mobil sport fenomenal selain citra james bond yang melekat pada mereknya akselerasi buas pengendalian dengan g-force menekan tubuh serta keindahan suaranya akan membuat anda serasa 20-30 tahun lebih muda akan tetapi apalah arti sebuah tawa senang bila hanya dinikmati sendirikini ada cara untuk membuat seluruh keluarga turut tersiksa pula oleh g-force yang dihasilkan mobil ini aston martin membuat db9 versi 4 pintu yang dinamai rapide kami pun mencoba rapide s bertenaga 552 dk pengujian ini memang belum kami lakukan jangka panjang hanya beberapa jam di kawasan jakartadari luar anda akan langsung mengagumi keindahan lekuk tubuhnya yang seksi ia 4 pintu tapi siluetnya tetap terlihat macam 2 pintu dibanding rivalnya seperti porsche panamera atau ferrari ff ia terlihat jauh lebih seksi tapi begitu masuk ke dalam anda akan lebih tercengang lagikabin mobil ini didesain dengan sangat indah baik di depan maupun belakang tidak mungkin anda tak merasa spesial berada di dalamnya setiap detail dibangun dengan desain berkelas serta material terbaik pakai jas saat mengendarainya anda akan merasa jadi james bond yang ehm sudah berkeluargasaat pertama kali menjalankannya kami terkejut dengan betapa mudahnya beradaptasi dengan mobil ini penyaluran tenaganya halus radius putar relatif rendah posisi mengemudi sempurna serta visibilitas memadai ke depan membuatnya sangat intuitif dikendaraibegitu pula saat pedal gas ditekan penuh karena belum menggunakan turbo pengiriman tenaga ke ban via transmisi 8-speed berlangsung linear dan terprediksi semakin tinggi rpm semakin deras akselerasinya terutama di atas 5000 rpm lengkingan mesin v12-nya akan selalu membuat anda mencari terowongan dan membuka jendelatak banyak fitur multimedia yang bisa dimainkan di mobil lupakan fitur multimedia layar sentuh semuanya masih dioperasikan tombol-tombol kecil kecilnya ukuran tombol membuat tampilan semakin keren meski butuh adaptasi untuk menghapal letak masing-masing tombol ada layar lipat yang bisa membuka saat anda mengaktifkan fitur navigasi sayangnya cuma itu kegunaannya tampilan navigasi yang ada juga kurang mahal karena terlihat sekali merupakan produk garmin kami sarankan dilipat saja kecuali anda benar-benar tersasar di jalanapalagi aston martin ingin anda fokus ke mengemudi karena meski mudah dikendarai mobil ini sanggup melaju 0-100 kmjam dalam 42 detik dan berlari terus hingga 327 kmjam pengendaliannya juga luar biasa mencengkeram anda tak akan merasa mengendarai mobil yang berat lantas karena penggerak belakang ia juga bisa diajak melakukan drift meski kami tak yakin anda tega melakukan hal itu setelah membelinya dengan cucuran keringat sendirijangan sekali-kali melirik bangku belakang sebagai tempat duduk anda lantas menggunakan sopir walau dibangun secara mewah dan ergonomis ruang yang tersedia cukup terbatas lebih cocok untuk anak hingga 155 cm anda bisa saja tetap duduk di belakang tapi bukan itu cara terbaik menikmati mobil ini porsche panamera harus diakui memang memberi akomodasi yang lebih baik di belakangduduklah di jok pengemudi dan ajak seluruh keluarga menikmati kedahsyatan mobil ini jika ingin santai anda juga tetap dapat menikmatinya sebagai karya seni luar biasa tak perlu tanya konsumsi bbm karena itu pasti di luar pikiran saat anda rela menebusnya rp 105 miliar harga memang bisa berbeda tergantung opsi angka itu untuk spek mobil tes kamispesifikasi aston martin rapide sharga  530000 poundsterling rp 105 mkapasitas mesin  5935 ccjumlah silinder  v12tenaga maksimum  552 dk6650 rpmtorsi maksimum  630 nm5500 rpm transmisi  otomatis 8-speedpenggerak  rear wheel drive kelebihanbentuk sangat menarikmesin buasdesain dan kualitas interior mengagumkankarakter mesin naturalsuara v12 normally aspirated nan seksiposisi dan kemudahan mengemudieksklusivitaskelemahanminim fitur multimedianavigasi terlihat murahbelakang agak sempit', 'first drive aston martin rapide s'),
(92, 'tak lama setelah peluncuran all new kijang innova 23 november lalu akhir pekan kemarin toyota mengundang kami dan beberapa media untuk melakukan test drive di bali lokasi ini dipilih karena mereka ingin kami dapat merasakan all new kijang innova dalam berbagai bentuk lintasan seperti aspal jalanan rusak lintasan tanjakan berkelok dan turunan berkelokdalam pengetesan ini otodriver memilih satu buah innova tipe g at bermesin bensin 1tr-fe terbaru yang berteknologi dual vvt-i 2000 cc selain telah merasakan varian diesel termahal kami juga penasaran terhadap mesin bensin lama tapi barunya ini disebut lama karena masih sejenis dengan innova sebelumnya dibilang baru karena kini menggunakan pengatur katup variabel dual vvt-i tenaga dan torsi juga hanya naik sedikit tenaga 139 ps naik 3 ps dari sebelumnya sedang torsi hanya naik 01 kgmkita mulai dari luar dulu bagian eksterior tipe ini memang terlihat paling sederhana dibandingkan dengan dua tipe di atasnya v dan q ini karena absennya aksen krom yang terdapat pada grill lis kaca yang membuat tampangnya menjadi lebih sederhana selain itu tatanan headlamp juga terlihat tidak ada projektor seperti tipe q dan minus led pada lampu depan ini masuk ke dalam kabinnya toyota sedikit memberikan sentuhan yang eksentrik dalam memilikh warna interior jok dan doortrim berwarna antara coklat dan oranye ini membedakannya dengan tipe q yang berwarna hitam elegan sedangkan tipe v dan g mendapatkan warna seperti ini pertama terasa aneh namun lama-lama terasa nyaman juga dan membuat interior all new kijang innova menjadi unik lingkar kemudi juga terdapat perbedaan tombol-tombolnya tidak sebanyak tipe q ini dikarenakan tombol sisi kanan pada tipe q adalah untuk pengaturan mid berlayar tft pada speedometernya sedangkan untuk tipe g hanya sebatas menampilkan informasi yang tidak sebanyak tipe q satu lagi yang absen di tipe g adalah immobilizer agak disayangkan karena kijang adalah salah satu incaran pencoleng untungnya masih ada alarm di lain sisi kenyamanan mobil ini boleh diacungi jempol suspensinya dapat meredam berbagai kontur aspal yang rusak di beberapa bagian saat perjalanan dari lovina menuju kintamani tanpa mengganggu kenyamanan para penumpang media lain yang satu mobilsasis yang diklaim sudah diganti bahannya agar lebih rigid benar terbukti di lintasan antara kintamani menuju ubud yang sangat berkelok-kelok adalah pengalaman berbeda dalam sebuah all new kijang innova karena mobil ini terasa stabil dikendarai bobot setir terasa pas di kecepatan tinggi tapi sayangnya terasa agak berat di kecepatan rendah kekedapan suara dari luar kabin sangat baik berkat peningkatan peredaman yang terpasang di firewall dan dasar lantai mobil sehingga suasana di kabin juga lebih senyap walaupun kita tau tipe g ini adalah varian terendah dari all new kijang innovatatanan dasbor bagian tengahnya sedikit berbeda controller ac tidak digital seperti tipe q begitupun controler ac di bagian belakang juga tidak digital melainkan analog tapi hal ini tidak menggangu kualitas pendinginan hanya perbedaan fitur kemewahan saja sayang fitur ambient light tidak ada di varian tipe g ini sehingga kemewahan kabin agak berkurang karena absennya fitur tersebut tapi sekali lagi harap diingat varian ini harganya sangat renyah dan cuma sedikit di atas rp 300 juta saat menghadapi jalan-jalan menanjak dan berbelok performa mesin bensin ini terasa agak kewalahan sangat jauh di bawah versi diesel kenaikan tenaga sedikit kami rasa habis terkompensasi peningkatan bobot agak menggelitik hingga saat ini toyota belum merilis bobot innova terbaru tapi dengan penambahan panjang 150 mm lebar 55 mm dan tinggi 45 mm dari sebelumnya plus penambahan sejumlah fitur logis rasanya kalau bobot pun meningkatakan lebih baik fungsikan fitur terbaru di mobil ini yakni drive mode yang memiliki posisi penyetelan power gas terasa menjadi agresif dan perpindahan gigi terjadi saat rpm lebih tinggi agar tetap mendapatkan tenaga yang optimal saat menanjak power mode ini juga sangat membantu saat ingin mendahului mobil yang berada di depanbila anda hanya ingin menikmati innova terbaru yang lebih nyaman dan modern di trim termurahnya maka model ini memberi value for money baik tapi bila ingin merasakan inovasi toyota di sektor mesin maka tipe diesel akan jauh lebih menggoda dan membuat senyum saat berakselerasisaat ini kami belum bisa memberi figur akselerasi atau konsumsi bbm-nya yang diklaim membaik dengan teknologi dual vvt-i nanti begitu mobil ini sudah bisa kami pinjam di jakarta dan melalui seluruh standar pengetesan barulah hasilnya akan kami sampaikan lebih detail dalam sajian artikel test drive lengkap', 'first drive toyota all new kijang innova 20g at'),
(93, 'general motors gm indonesia kemarin 112 meluncurkan varian terbaru dalam jajaran keluarganya yaitu chevrolet trax sebuah compact suv bermesin 1400 cc turbo dengan tenaga terbsar di kelasnya yakni 140 dk otodriver mendapatkan kesempatan untuk merasakan chevrolet trax varian tertingginya yaitu tipe ltz seharga rp 291 jutamasuk ke dalam kabin posisi duduknya terasa agak tinggi dan ini baik karena membuat pengemudi bisa melihat ke segala arah dengan mudah untuk mengontrol posisi mobil tapi tunggu dulu ternyata pengaturan tinggi jok di mobil ini sangat fleksibel ia dapat diatur dari posisi sangat tinggi hingga sangat rendah fitur teleskopik juga ada dalam mobil ini sehingga pengemudi juga semakin nyaman dalam mengatur posisi duduknya bisa dibilang posisi mengemudinya sangat ergonomis di kelasnya speedometer digital dengan rpm analog dan layar mid yang begitu informatif juga membuat sangat menariktatanan pada dasbor bagian tengah tergolong cukup simpel tapi sekaligus memberi sentuhan modern dan fungsional terdapat perangkat infotainment layar sentuh 7 inci yang sangat responsif fitur chevrolet mylink dapat diakses dengan mudah via bluetooth disaat sudah terkoneksi anda bisa memainkan video dan musik yang ada pada smartphone anda bahkan bila dikoneksi dengan produk apple fitur siri juga bisa diaktifkan ia pun mendukung fasilitas radio internet yang memungkinkan akses ke lebih dari 50 ribu stasiun radio di dunia varian ltz ini juga dilengkapi dengan kamera mundur sehingga membantu pengemudi dalam melakukan parkirsayang akomodasi untuk penumpang belakang kurang baik ruang kaki penumpang belakang terasa agak sempit untuk orang yang berpostur tinggi agak sempit selain itu kapasitas bagasinya cukup kecil dibanding rival-rivalnya saat iniberbicara performa tenaganya sudah terasa sejak dari rpm bawah padahal mesinnya berkapasitas kecil ini dikarenakan mesin mungil ini dilengkapi dengan turbocharger alhasil tenaganya mencapai 140 dk dengan torsi 200 nm sungguh angka yang cukup fantastis untuk sebuah compact suv karena untuk mobil yang berjenis sama belum ada mobil yang memiliki tenaga sebesar itu di trek lurus sentul yang hanya sepanjang 800 meter mobil ini dengan mudahnya menyentuh 160 kmjamptenaga besar itu disalurkan ke roda depan menggunakan transmisi 6 percepatan otomatis dengan tiptronic jadi bisa mengganti transmisi dengan mode manual sayangnya trax belum dilengkapi dengan paddle shift jadi untuk fungsi mengganti perpindahan gigi hanya menggunakan tombol yang berada di perseneling agak terasa kurang natural bila dibandingkan paddle shiftkarakter suspensi trax sangat baik layaknya sebuah suv premium yang nyaman dan lembut saat melewati jalan bergelombang dan rusak suspensinya berhasil meredam semuanya kabin yang senyap juga semakin membuat terasa nyaman saat mengendarai mobil ini hebatnya suspensi empuk ini masih didukung pengendalian yang cukup baik selain itu banyak fitur-fitur lainnya yang canggih dan sangat berguna contohnya seperti hill assist start yang sudah bekerja secara otomatis fitur ini bekerja saat pedal rem dilepas mobil tetap berhenti selama 3 detik dengan maksud agar pengemudi sempat memindahkan kaki ke pedal gas agar mobil ini bisa melaju dengan mudah saat berhenti di tanjakansayang kami tidak mendapatkan kesempatan untuk merasakan fitur hill descent control padahal ini adalah fitur unggulan yang hanya ada di varian ltz ini dikarekan tidak ada sesi trek turunan mencoba fitur iniada fitur lainnya yang memudahkan penumpang untuk bisa mengisi baterai gadget ataupun perangkat elektronik lainnya berkat socket listrik 230 volt di bagian belakang konsol tengah', 'first drive chevrolet trax ltz'),
(94, 'oktober ini kami bertandang ke bali untuk merasakan langsung model maserati salah satunya ghibli varian ini menarik perhatian kami karena 2 hal pertama ini yang terbaru lantas ghibli juga merupakan maserati paling murah karena berada di kelas mercy e-class dan bmw seri-5meski paling murah tapi ia tetap tidak murah harganya berada di kisaran rp 2-3 miliar karena tak memiliki varian bermesin rendah paling rendah saja bermesin 2979 cc twin turbo bertenaga 330 dk yang artinya setara dengan mercy e 400 atau bmw 535i sementara tipe ghibli s yang kami coba memiliki 410 dk dari mesin serupatenaganya jelas mengagumkan laju 0-100 kmjam tuntas dalam 50 detik dan mobil akan terus berakselerasi hingga 285 kmjam kemudian ia memiliki suara knalpot yang sangat merdu anda tak akan bosan memacu hanya untuk mendengarkan suara merdu mesin v6-nya yang seperti mobil balapdari luar ia juga terlihat bengis dengan gril serta 3 buah lubang insang di samping khas maserati tapi begitu masuk ke dalam anda akan melihat pemandangan berbeda ciri maserati yang menempatkan tombol-tombolnya seakan secara acak tak ditemui lagi dasbor dan seluruh tombol serta tuas kontrol diletakkan secara rapi desain ini sangat mirip dengan quattroporte generasi terakhir makanya maserati juga menjuluki ghibli sebagai baby quattroportemengarungi bali dengan mobil ini terasa fantastis di mode eco sekalipun ia tetap terasa bertenaga dan knalpot menderum merdu begitu tombol sport ditekan seketika ia makin agresif dan bersuara mengeras matikan kontrol kestabilan maka dengan mudahnya anda melakukan aksi drifting dengan mobil inidalam keadaan standar mobil ini telah memiliki fitur lengkap misalnya navigasi layar sentuh lampu adaptif serta rem parkir elektrik ia lebih lengkap dari mercedes-benz e-class meski belum berfitur sebanyak bmwnamun dalam hal berkendara ghibli tetap membawa sejarah hebat maserati posisi duduknya luar biasa dipadu karakter suspensi dan setir yang presisi saat menikung akan tetapi cerita agak berbeda di belakang karena ruang kakinya sempit untuk ukuran kelasnyabila anda tipe eksekutif muda yang suka disopiri dan duduk belakang ini bukan mobil untuk anda tapi bila gemar menyetir sendiri maka maserati mobil yang tepat harganya memang sangat mahal tapi memang ini bukan merek sembarangan dan telah memiliki sejarah 101 tahun membangun mobil sportsatu hal lagi tentu membanggakan meletakkan kunci mewahnya di meja ketika berkumpul dengan petrol head lainnyaspesifikasi  maserati ghibli s harga  rp 28 miliar estimasi tergantung opsikapasitas mesin  2979 ccjumlah silinder  v6tenaga maksimum  410 dk5500 rpmtorsi maksimum  550 nm1750-5000 rpm transmisi  otomatis 8-speedpenggerak  rear wheel drive0-100 kmjam  50 detik klaim', 'first drive maserati ghibli s');
INSERT INTO `artikel` (`id_artikel`, `isi_artikel`, `judul_artikel`) VALUES
(98, 'kelebihantenaga besar dan instan suara mesin interior cantik dan modern pengendalian sangat presisi jaringan servis luas kekurangansuspensi sangat keras mahal ruang bagasi sempit karena ban serep konsumsi bbmkondisi pengetesan waktu  12-may-2016 2300permukaan jalan  aspalcuaca  cerahbeban penumpang  68 kgbahan bakar  20  tekanan ban depan 34 psitekanan ban belakang 34 psisuhu udara  28 cdivisi amg di mercedes-benz pernah membuat mobil legendaris yaitu sls-class mobil tersebut dibangun langsung di markas amg dari awal bukan modifikasi model jalanan seperti lainnyakini amg kembali mengeluarkan model yang murni dibuat mereka yakni gt untuk indonesia kita mendapat tipe gt s yang lebih bertenaga berbeda dengan sls yang menyasar supercar macam ferrari dan lamborghini gt s ini menyasar mobil sport macam porsche 911 atau maserati gran turismopada video ini reviewer otodriver fitra eri melompat ke balik setir mercedes-amg gt s untuk melihat apa saja yang ditawarkan mobil ini dari berbagai sisi tentu saja bukan sekadar data brosur tapi kami sampaikan pula data pengetesan kami sendiri serta impresi yang dirasakan mobil ini juga sudah kami tes sejauh ratusan kilometer untuk menghasilkan impresi yang akuratjangan lupa klik like bila anda menyukai video ini juga isi comment tentang mobil ini atau kritik untuk perbaikan kami ke depannya jangan lupa juga share video ini ke teman-teman anda yang mungkin sedang membutuhkan informasi mengenai mobil', 'test drive mercedes-benz amg gt 2016'),
(99, 'kelebihaninterior memukau fun to drive mesin efisien dan kuat pengendalian kepraktisan kekuranganeksterior biasa saja minus navigasi satelit harga agak tinggikondisi pengetesan waktu  19-may-2015 2330permukaan jalan  aspalcuaca  cerahbeban penumpang  68 kgbahan bakar  75  tekanan ban depan 34 psitekanan ban belakang 34 psisuhu udara  28 c', 'test drive bmw seri-2 active tourer 2015'),
(100, 'kelebihankenyamanan posisi mengemudi instrumen futuristis akomodasi desain eksterior kekuranganpengendalian ground clearance rendah pelipatan bangku belakangkondisi pengetesan waktu  13-may-2015 2235permukaan jalan  aspalcuaca  cerahbeban penumpang  68 kgbahan bakar  40  tekanan ban depan 32 psitekanan ban belakang 32 psisuhu udara  28 cnissan serena berkode c26 ini memang lompat 2 generasi dari sebelumnya yakni c24 alhasil ubahan yang terjadi sangat banyak bukan cuma eksteriornya yang modern meski tetap berciri serena interiornya juga terasa masa kinidi 2015 serena melakukan sedikit ubahan facelift untuk menyegarkan tampilannya itu bisa dilihat dari bentuk lampu depan belakangnya akan tetapi esensi sebagai sebuah mpv medium nan lega dan praktis tetap tak berubahmemiliki mesin 147 dk dengan transmisi otomatis cvt serena menghasilkan 118 detik untuk berakselerasi dari diam ke 100 kmjam serena juga memiliki fitur moda sport pada transmisinya untuk bermain di putaran atas dengan mengaktifkan fitur ini mesin akan terasa lebih responsifdesain nissan serena sangat kuat kesan mpv mengotak memang ia terlihat modern dengan bodi menjulang dan bagian depan landai kekinian dengan rancangan lampu baru yang dilengkapi daytime running light bertajuk signature lamp elegan namun tegas di belakang lampu led sangat kental nuansa jepang membuat sangat berbeda dibandingkan pendahulunyadi dalam pemilik serena akan menghargai bentuk instrumen digital nan keren selain itu kaca lebar di segala sisi membuat ia terasa lega sekaligus menciptakan visibilitas mengagumkan secara keseluruhan desainnya cukup positif dan mencerminkan sebuah mpv nan praktis dan legapengendaliannya sendiri khas mpv tinggi yakni agak limbung memang masih masuk toleransi tapi bila membawa penumpang penuh anda harus lebih halus dalam bermanuver limbung ini memang efek dari suspensi lunak yang digunakanserena sebelumnya terkenal boros bbm generasi terbaru ini memang tak memiliki fitur canggih penghemat bbm seperti start stop  namun penerapan transmisi cvt dan bentuk landai di depan nan aerodinamis lumayan membantu kehematannya kini di dalam kota ia mampu menempuh 101 kmliter sementara di rute tol dengan 149 kmliter sedangkan kebutuhan bbm minimum serena adalah oktan 92sedangkan dalam hal teknologi tidak ada yang baru di serena kecuali instrumen digital mesin dan transmisinya sendiri cukup konvensional dengan katup variabel serta cvt traction dan stability control pun belum termasuk peranti standarbantingan suspensi empuk jelas merupakan highlight dari serena keheningan kabinnya cukup baik meski suara dari kendaraan sebelah masih masuk karena penggunaan kaca yang lebar untuk pengemudi posisi duduknya ergonomis untuk sebuah mpvjok tengah dan belakang sendiri tidak terlalu akomodatif karena ukurannya yang langsing juga tidak tersedia armrest sisi luar untuk jok tengah tapi dengan ruang lega serena sangat layak untuk perjalanan jauh bagasi belakang pun memadai dengan penyimpanan cukup besar di bawah lantainyadalam hal kepraktisan biar angka yang bicara di dalam kabinnya serena memiliki 13 cup holder didukung 6 penyimpanan tertutup dan 11 penyimpanan terbuka artinya anda bisa dengan mudah meletakkan hampir semua jenis barang di mana sajaakses masuk ke mobil dan bagasi juga mudah dengan lantai rendah bangku tengah bisa digeser maju mundur serta ke samping sayangnya jok tengah ini memang tak bisa diputar balik arah seperti model sebelumnya kehadiran konsol tengah besar yang bisa digeser ke jok tengah maupun depan juga terbukti menunjang kepraktisan satu yang merupakan kelemahan adalah pelipatan jok belakang ke samping ini sedikit mengurangi daya angkut dan agak repot dalam melipatnyadi tipe tertingginya serena merupakan mpv yang terlengkap di kelasnya dalam kondisi standar ia sudah dilengkapi atap panoramik cruise control monitor touch screen monitor tv belakang climate control digital drl lampu hid kamera parkir serta double blowerada 3 varian serena di indonesia yakni x highway star panoramic serta panoramic autech ketiganya bermesin sama hanya berbeda di fitur di kelasnya rival serena lumayan banyak yakni toyota nav1 mazda biante serta mitsubishi delica nav1 sangat baik dalam hal akomodasi dengan bentuk mengotaknya serta memiliki desain interior cantik sementara biante sendiri unggul dalam hal konsumsi bbm dengan mesin skyactiv-nya delica di lain sisi cukup unik sasis kuat serta ground clearance tinggi membuatnya dapat melibas beragam medan secara lebih fleksibelkesimpulanserena memiliki kenyamanan serta akomodasi yang sangat baik untuk kelasnya mobil ini juga cukup menyenangkan untuk dikemudikan harga jual kompetitif juga membuat serena merupakan favorit di kelas medium mpv', 'test drive nissan serena 2015'),
(96, 'sejak peluncurannya pada awal juli lalu all new kia picanto platinum hadir sebagai varian termewah dengan penyegaran pada segi eksterior yang tampil lebih mewah kini city car asal korea ini memiliki grill lebih luas serta diberikan sentuhan aksen krom pada foglampselain itu di balik headlamp telah disematkan projektor led yang berdampingan dengan led drl dan lampu belakang pun sudah led menjadi lebih mewah dari picanto sebelumnya harganya kini melonjak jadi rp 187 juta rasanya kurang lengkap nih kalau tidak mencobanya langsungsaat masuk ke dalam kabin posisi duduk terasa nyaman dengan pengaturan jok yang masih manual untuk postur 170 cm dengan berat 69 kg masih cukup terasa leluasa sementara ketika memegang erat stir sudah tidak perlu repot lagi untuk mengatur hiburan dalam kabin karena tersedia tombol audio controlselain itu feeling mengemudi juga mudah didapat berkat ukuran yang kompak dengan kaca depan yang memiliki ruang pandang luas spion dengan pengaturan elektrik juga membantu kontrol secara maksimal dan menambah kesan istimewabahkan mesin bisa langsung menyala tanpa menggunakan kunci berkat tombol startstop engine mesin berkapasitas 1248 cc dual cvvt ini seperti saudara kandungnya hyundai i10 menyala secara halus dengan tuas transmisi otomatis lima percepatancity car asal negeri gingseng ini mampu melesat dengan lincah dari tenaga yang dihasilkan sebesar 87 dk pada putaran 6000 rpm dan torsi maksimal 123 kg-m pada 4000 rpm mesin tersebut membuatnya tetap irit bahan bakar seperti klaim kiafun to drive langsung didapatkan berkat wheelbase 2385 mm ia terasa cukup lincah meski gejala limbung di kecepatan tinggi belum dapat kami tes di ruang terbatas ini picanto platinum terbaru memang cocok untuk berkeliaran di tengah-tengah kota dengan kepadatan lalu linttas satu kritik setir terasa kurang natural dan butuh tenaga untuk mengembalikannya ke tengahsepertinya kehadiran platinum untuk kasta termewah ini bisa berpotensi mengganggu rival sekelasnya bila hanya melihat dari fitur serta kemewahan yang ditawarkan tapi harga akan menjadi kendala bagaimanapun harga mobil ini mendekati hatchback 1500 cc tidak seperti mitsubishi mirage toyota etios valco atau honda brio yang menawarkan harga di bawah rp 180 juta', 'first drive new kia picanto platinum'),
(97, 'kelebihanperforma mesin konsumsi bbm kabin lega kenyamanan pengendalian desain kekuranganaudio kurang mudah digunakan tak ada manual lampu interior kuning layout mesin kurang rapikondisi pengetesan waktu  01-nov-2016 0200permukaan jalan  aspalcuaca  cerahbeban penumpang  68 kgbahan bakar  20  tekanan ban depan 32 psitekanan ban belakang 32 psisuhu udara  27 csudah 10 generasi civic hadir di dunia mobil ini sangat terkenal dengan inovasi keasyikan berkendara serta kehematannya namun civic generasi ke-9 sebelum ini agak mengecewakan karena tak menawarkan banyak hal baru dibanding sebelumnya namun generasi terbaru ini berbeda bukan hanya desainnya sangat menawan mobil ini juga memakai unit mesin turbo berkapasitas 1500 cc dengan tenaga 173 ps dan torsi 220 nm ia merupakan civic paling bertenaga yang pernah masuk resmi ke indonesiapada video ini reviewer otodriver fitra eri dan hariawan arief melompat ke balik setir honda civic 15l turbo untuk melihat apa saja yang ditawarkan mobil ini dari berbagai sisi tentu saja bukan sekadar data brosur tapi kami sampaikan pula data pengetesan kami sendiri serta impresi yang dirasakan mobil ini juga sudah kami tes sejauh ratusan kilometer untuk menghasilkan impresi yang akuratdi video pertama fitra eri memaparkan impresi awal mengendarai mobil ini sedangkan di video kedua hariawan arif mengambil data-data pengetesan yang valid ketika mengetesnya dalam jangka panjangjangan lupa klik like bila anda menyukai video ini juga isi comment tentang mobil ini atau kritik untuk perbaikan kami ke depannya jangan lupa juga share video ini ke teman-teman anda yang mungkin sedang membutuhkan informasi mengenai mobil', 'test drive honda civic turbo 2016'),
(95, 'ford focus 15 l ecoboost akhirnya bisa kami arahkan menuju adelaide hills untuk merasakan performanya hmm rasanya memang tidak seperti bermesin 1500 cc dengan suhu udara d kota adelaide sekitar 17 derajat celcius daerah perkebunan anggurnya bisa lebih dingin lagi tetapi kontur perbukitan membuat sesi tes kali ini cukup menyenangkan jadi bisa mencoba langsung apa maksud ford menanamkan karakter fun to drive pada focus iniharus diakui meski bermesin 1500 cc focus ini tak terasa seperti pakai mesin kecil tampaknya ford berusaha sekali menghadirkan mesin-mesin kecil tapi berperforma tinggi ya seperti pada focus ini yang biasa mengandalkan mesin 2000 cc kali ini pakai mesin 1500 cc atau seperti fiesta adiknya hanya dibekali dapur pacu 1000 cc namun terasa seperti sumber tenaga 1500 cctampaknya ford cukup sukses mengembangan mesin kecil bertenaga besar terasa pada focus ini tenaganya memang tidak seperti layaknya mobil 1500 cc melewati tanjakan terjal menuju adelaide hills hatchback ini tak kesulitan tarikan tetap enak apalagi kalau tuas persneling digeser ke posisi s hanya putaran atasnya terasa agak mengambang namun untuk pengendaraan normal sih enakurusan handling juga terbukti mumpuni menaklukkan rute perbukitan menuju kebun anggur menunjukkan karakter focus yang cukup baik memegang kontur jalanan beberapa varian kami sempat coba handling tipe titanium terasa lebih mantap ketimbang varian sport kemungkinan perbedaan ban berpengaruh pada pengendaliannya terlebih fitur baru esp dengan est membuat mobil lebih mudah dikendalikan pas banget rute yang kami lewati terguyur hujan sehingga kemantapan pengendalian bisa sekaligus teruji', 'first drive ford focus 15l ecoboost');
